5:{s:4:\"data\";s:26:\"WordPress 4.5“Coleman”\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:44:\"https://cn.wordpress.org/2016/04/17/coleman/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:53:\"https://cn.wordpress.org/2016/04/17/coleman/#comments\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Sun, 17 Apr 2016 03:18:28 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"category\";a:1:{i:0;a:5:{s:4:\"data\";s:8:\"Releases\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:32:\"https://cn.wordpress.org/?p=1024\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:11:\"isPermaLink\";s:5:\"false\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:49:\"WordPress 4.5简体中文版现已开放下载。\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:7:\"jimmyxu\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:26377:\"<div style=\"width: 692px\">\n<p>WordPress 4.5简体中文版现已<a href=\"https://cn.wordpress.org/releases/\">开放下载</a>，或在您的WordPress仪表盘中升级。我们将此版本命名为“Coleman”，以纪念爵士萨克斯手科尔曼·霍金斯。4.5的全新功能协助您精简工作流程，无论您要写作还是建构网站。</p>\n<div id=\"v-scFdjVo6-1\" class=\"video-player\"><video id=\"v-scFdjVo6-1-video\" width=\"692\" height=\"388\" poster=\"https://videos.files.wordpress.com/scFdjVo6/video-604c4abe08_scruberthumbnail_1.jpg\" controls=\"true\" preload=\"metadata\" dir=\"ltr\" lang=\"en\"><source src=\"https://videos.files.wordpress.com/scFdjVo6/video-604c4abe08_dvd.mp4\" type=\"video/mp4; codecs=&quot;avc1.64001E, mp4a.40.2&quot;\" /><source src=\"https://videos.files.wordpress.com/scFdjVo6/video-604c4abe08_fmt1.ogv\" type=\"video/ogg; codecs=&quot;theora, vorbis&quot;\" /><div><img alt=\"Introducing WordPress 4.5 “Coleman”\" src=\"https://videos.files.wordpress.com/scFdjVo6/video-604c4abe08_scruberthumbnail_1.jpg\" width=\"692\" height=\"388\" /></div><p>Introducing WordPress 4.5 “Coleman”</p></video></div>\n<hr />\n<h2 style=\"text-align: center\">编辑功能的改善</h2>\n<p><img class=\"aligncenter size-full wp-image-4220\" src=\"https://wordpress.org/news/files/2016/04/illustration-short-inlinelinks.png\" alt=\"illustration-short-inlinelinks\" width=\"1000\" height=\"400\" /></p>\n<h3>行内链接</h3>\n<p>通过降低分心的编写界面，轻易地链接内容，让您更专注在您的写作上。</p>\n<p><img class=\"aligncenter size-full wp-image-4265\" src=\"https://wordpress.org/news/files/2016/04/editing-shortcuts-big.gif\" alt=\"editing-shortcuts-big\" width=\"960\" height=\"576\" /></p>\n<h3>格式捷径</h3>\n<p>您喜欢在编写列表和标题时使用格式捷径吗？伴随着水平线和<code>&lt;code&gt;</code>现在它们变得更好用了。</p>\n<hr />\n<h2 style=\"text-align: center\">自定义进步</h2>\n<p><img class=\"aligncenter size-full wp-image-4221\" src=\"https://wordpress.org/news/files/2016/04/illustration-short-responsive-preview.png\" alt=\"illustration-short-responsive-preview\" width=\"1000\" height=\"400\" /></p>\n<h3>实时响应式预览</h3>\n<p>确保您的站点在所有设备屏幕上都能完美呈现！在定制器中直接预览手机、平板及桌面的版面。</p>\n<p><img class=\"aligncenter wp-image-4239 size-full\" src=\"https://wordpress.org/news/files/2016/04/illustration-short-customlogo-whitespace.png\" width=\"1000\" height=\"440\" /></p>\n<h3>自定标志</h3>\n<p>“二〇一五”及“二〇一六”主题已经更新，现已支持自定标志，您可以在定制器的“站点识别”一节找到，</p>\n<hr />\n<h2 style=\"text-align: center\">引擎盖下</h2>\n<div class=\"under-the-hood three-col\">\n<div class=\"col\">\n<h3>智能图片缩放</h3>\n<p>生成图片的速度现在提升了50%且无损品质。<a href=\"https://make.wordpress.org/core/2016/03/12/performance-improvements-for-images-in-wordpress-4-5/\">这真的非常酷</a>。</p>\n</div>\n<div class=\"col\">\n<h3>选择性刷新</h3>\n<p>定制器现在支持<a href=\"https://make.wordpress.org/core/2016/02/16/selective-refresh-in-the-customizer/\">全方位框架</a>来渲染各部分的预览，无须使用JavaScript重写您的PHP代码。</p>\n</div>\n<div class=\"col\">\n<h3>改善脚本载入器</h3>\n<p>更好地支持了脚本头/尾的依赖关系。新的<code><a href=\"https://make.wordpress.org/core/2016/03/08/enhanced-script-loader-in-wordpress-4-5/\">wp_add_inline_script()</a></code>可以针对已注册的脚本加入额外的代码。</p>\n<h3>更棒的嵌入模板</h3>\n<p>嵌入模板已分离为不同部分，并且可以通过模板层级<a href=\"https://make.wordpress.org/core/2016/03/11/embeds-changes-in-wordpress-4-5/\">直接由主题进行覆盖</a>。</p>\n<h3>JavaScript库更新</h3>\n<p>jQuery 1.12.3、jQuery Migrate 1.4.0、Backbone 1.2.3和Underscore 1.8.3现已收录。</p>\n</div>\n</div>\n<div class=\"under-the-hood two-col\"></div>\n<hr />\n<h2 style=\"text-align: center\">开发团队</h2>\n<p><a class=\"alignleft\" href=\"https://profiles.wordpress.org/mikeschroder\"><img id=\"grav-76424a001dc6b3ebb4faca0c567800c4-0\" class=\"grav-hashed\" src=\"https://www.gravatar.com/avatar/76424a001dc6b3ebb4faca0c567800c4?d=mm&amp;s=180&amp;r=G\" alt=\"Mike Schroder\" width=\"80\" height=\"80\" /></a>此次发布由<a href=\"https://getsource.net/\">Mike Schroder</a>领头，由<a href=\"https://profiles.wordpress.org/adamsilverstein\">Adam Silverstein</a>担任发布代表，<a href=\"https://choycedesign.com/\">Mel Choyce</a>担任发布设计主管，并得到了以下个人的帮助。这次发布包含了298人的贡献。在您喜欢的音乐服务中听听科尔曼·霍金斯，并看看下面这些个人资料吧：</p>\n<p><a href=\"https://profiles.wordpress.org/mercime\">@mercime</a>、<a href=\"https://profiles.wordpress.org/aaroncampbell\">Aaron D. Campbell</a>、<a href=\"https://profiles.wordpress.org/uglyrobot\">Aaron Edwards</a>、<a href=\"https://profiles.wordpress.org/ahockley\">Aaron Hockley</a>、<a href=\"https://profiles.wordpress.org/jorbin\">Aaron Jorbin</a>、<a href=\"https://profiles.wordpress.org/abiralneupane\">Abiral Neupane</a>、<a href=\"https://profiles.wordpress.org/mrahmadawais\">Ahmad Awais</a>、<a href=\"https://profiles.wordpress.org/aidanlane\">aidanlane</a>、<a href=\"https://profiles.wordpress.org/ambrosey\">Alice Brosey</a>、<a href=\"https://profiles.wordpress.org/arush\">Amanda Rush</a>、<a href=\"https://profiles.wordpress.org/afercia\">Andrea Fercia</a>、<a href=\"https://profiles.wordpress.org/andg\">Andrea Gandino</a>、<a href=\"https://profiles.wordpress.org/nacin\">Andrew Nacin</a>、<a href=\"https://profiles.wordpress.org/azaozz\">Andrew Ozz</a>、<a href=\"https://profiles.wordpress.org/rockwell15\">Andrew Rockwell</a>、<a href=\"https://profiles.wordpress.org/andizer\">Andy</a>、<a href=\"https://profiles.wordpress.org/ankit-k-gupta\">Ankit K Gupta</a>、<a href=\"https://profiles.wordpress.org/atimmer\">Anton Timmermans</a>、<a href=\"https://profiles.wordpress.org/apaliku\">apaliku</a>、<a href=\"https://profiles.wordpress.org/aramzs\">Aram Zucker-Scharff</a>、<a href=\"https://profiles.wordpress.org/ashmatadeen\">ash.matadeen</a>、<a href=\"https://profiles.wordpress.org/bappidgreat\">Ashok Kumar Nath</a>、<a href=\"https://profiles.wordpress.org/bandonrandon\">BandonRandon</a>、<a href=\"https://profiles.wordpress.org/barryceelen\">Barry Ceelen</a>、<a href=\"https://profiles.wordpress.org/empireoflight\">Ben Dunkle</a>、<a href=\"https://profiles.wordpress.org/berengerzyla\">berengerzyla</a>、<a href=\"https://profiles.wordpress.org/neoxx\">Bernhard Riedl</a>、<a href=\"https://profiles.wordpress.org/thisisit\">Bhushan S. Jawle</a>、<a href=\"https://profiles.wordpress.org/birgire\">Birgir Erlendsson (birgire)</a>、<a href=\"https://profiles.wordpress.org/boonebgorges\">Boone B. Gorges</a>、<a href=\"https://profiles.wordpress.org/williamsba1\">Brad Williams</a>、<a href=\"https://profiles.wordpress.org/bradyvercher\">Brady Vercher</a>、<a href=\"https://profiles.wordpress.org/thebrandonallen\">Brandon Allen</a>、<a href=\"https://profiles.wordpress.org/bhubbard\">Brandon Hubbard</a>、<a href=\"https://profi