:1:{i:0;a:5:{s:4:\"data\";s:45:\"https://cn.wordpress.org/2015/12/13/clifford/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:54:\"https://cn.wordpress.org/2015/12/13/clifford/#comments\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Sat, 12 Dec 2015 22:52:22 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"category\";a:1:{i:0;a:5:{s:4:\"data\";s:8:\"Releases\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:32:\"https://cn.wordpress.org/?p=1011\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:11:\"isPermaLink\";s:5:\"false\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:49:\"WordPress 4.4简体中文版现已开放下载。\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:7:\"jimmyxu\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:37891:\"<div style=\"width: 692px\">\n<p>WordPress 4.4简体中文版现已<a href=\"https://cn.wordpress.org/releases/\">开放下载</a>，或在您的WordPress仪表盘中升级。我们将此版本命名为“Clifford”，以纪念爵士小号手<a href=\"https://en.wikipedia.org/wiki/Clifford_Brown\">克利福德·布朗</a>。4.4让您的网站更具连接性且反应敏捷。Clifford也带来了全新的默认主题，二〇一六。</p>\n<hr />\n<h2>介绍二〇一六</h2>\n<p><img class=\"aligncenter size-full wp-image-3994\" src=\"https://wordpress.org/news/files/2015/12/ipad-white-desktop-2x.png\" alt=\"A screenshot of Twenty Sixteen set in an iPad frame\" width=\"632\" height=\"428\" /></p>\n<p>我们最新的默认主题，二〇一六，是一个具现代感又不失经典博客设计风格的主题。</p>\n<p>二〇一六在任何设备上都看起来很棒。一个流动式网格设计、灵活页首，搭配各式趣味的配色，让你的内容大放异彩。</p>\n<hr />\n<h2>自适应图片</h2>\n<p><img class=\"aligncenter wp-image-3995 size-full\" src=\"https://wordpress.org/news/files/2015/12/responsive-devices-ipad-2x.png\" alt=\"An image of a laptop, iPad, Android phone, and iPhone containing the same image displayed at multiple sizes to demonstrate responsive image features.\" width=\"632\" height=\"290\" /></p>\n<p>WordPress现在以更聪明的方式显示适合任何设备的图片尺寸，确保每次皆完美呈现。您甚至不需要修改您的主题，</p>\n<hr />\n<h2>嵌入一切</h2>\n<blockquote data-secret=\"UpjyQbDxun\" class=\"wp-embedded-content\"><p><a href=\"https://make.wordpress.org/core/2015/10/28/new-embeds-feature-in-wordpress-4-4/\">New Embeds Feature in WordPress 4.4</a></p></blockquote>\n<p><iframe class=\"wp-embedded-content\" sandbox=\"allow-scripts\" security=\"restricted\" src=\"https://make.wordpress.org/core/2015/10/28/new-embeds-feature-in-wordpress-4-4/embed/#?secret=UpjyQbDxun\" data-secret=\"UpjyQbDxun\" width=\"600\" height=\"338\" title=\"&#8220;New Embeds Feature in WordPress 4.4&#8221; &#8212; Make WordPress Core\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" scrolling=\"no\"></iframe></p>\n<p>现在您可以将文章嵌入到其他WordPress网站。只要将文章URL贴入编辑器，即可看到即时嵌入预览，完整的标题、摘要及特色图片（如果您有设定），甚至会包含您的网站图标以及评论与分享链接。</p>\n<p>除了文章嵌入外，WordPress 4.4还加入五个新的oEmbed提供者：Cloudup、Reddit留言、ReverbNation、Speaker Deck及VideoPress。</p>\n<hr />\n<h2>引擎盖下</h2>\n<p><img class=\"aligncenter size-full wp-image-4003\" src=\"https://wordpress.org/news/files/2015/12/banner-1544x500.jpg\" alt=\"The WordPress REST API logo\" width=\"1544\" height=\"500\" /></p>\n<h3>REST API基础设施</h3>\n<p>REST API基础设施已整合于WordPress的核心中，将开发模式带入一个崭新的纪元。REST API为开发者提供在WordPress之上建设并扩展RESTful API的道路。</p>\n<p>基础设施是REST API多阶段推出的第一部分，而将会在未来的发布中包含核心节点。要了解更多关于核心节点或是扩展REST API的信息，请查阅官方<a href=\"https://wordpress.org/plugins/rest-api/\">WordPress REST API</a>扩展。</p>\n<h3>项目元数据</h3>\n<p>项目现在像文章一样支持元数据。请参阅<a href=\"https://developer.wordpress.org/reference/functions/add_term_meta\"><code>add_term_meta()</code></a>、<a href=\"https://developer.wordpress.org/reference/functions/get_term_meta\"><code>get_term_meta()</code></a>和<a href=\"https://developer.wordpress.org/reference/functions/update_term_meta\"><code>update_term_meta()</code></a>来获得更多信息。</p>\n<h3>评论查询改善</h3>\n<p>评论查询现在有缓存机制来改善性能。全新<code>WP_Comment_Query</code>参数能更轻松地调用、访问评论。</p>\n<h3>项目、评论以及网络对象</h3>\n<p>新的<code>WP_Term</code>、<code>WP_Comment</code>和<code>WP_Network</code>对象让与项目、评论和网络的交互变得更直观、更可预测。</p>\n<hr />\n<h2>开发团队</h2>\n<p>此次发布由<a href=\"http://scotty-t.com/\">Scott Taylor</a>领头，并得到了以下个人的帮助。这次发布包含了471人的贡献（创下新高！）。在您喜欢的音乐服务中听听克利福德·布朗，并看看下面这些个人资料吧：</p>\n<p><a href=\"https://profiles.wordpress.org/mercime\">@mercime</a>、<a href=\"https://profiles.wordpress.org/_smartik_\">_smartik_</a>、<a href=\"https://profiles.wordpress.org/a5hleyrich\">A5hleyRich</a>、<a href=\"https://profiles.wordpress.org/aaroncampbell\">Aaron D. Campbell</a>、<a href=\"https://profiles.wordpress.org/jorbin\">Aaron Jorbin</a>、<a href=\"https://profiles.wordpress.org/aaronrutley\">Aaron Rutley</a>、<a href=\"https://profiles.wordpress.org/kawauso\">Adam Harley (Kawauso)</a>、<a href=\"https://profiles.wordpress.org/adamsilverstein\">Adam Silverstein</a>、<a href=\"https://profiles.wordpress.org/adamholisky\">adamholisky</a>、<a href=\"https://profiles.wordpress.org/aduth\">aduth</a>、<a href=\"https://profiles.wordpress.org/mrahmadawais\">Ahmad Awais</a>、<a href=\"https://profiles.wordpress.org/akibjorklund\">Aki Bjorklund</a>、<a href=\"https://profiles.wordpress.org/albertoct\">AlbertoCT</a>、<a href=\"https://profiles.wordpress.org/akirk\">Alex Kirk</a>、<a href=\"https://profiles.wordpress.org/viper007bond\">Alex Mills (Viper007Bond)</a>、<a href=\"https://profiles.wordpress.org/tellyworth\">Alex Shiels</a>、<a href=\"https://profiles.wordpress.org/gounder\">Alexander Gounder</a>、<a href=\"https://profiles.wordpress.org/alireza1375\">alireza1375</a>、<a hr