xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:49:\"WordPress 4.3简体中文版现已开放下载。\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:9:\"enclosure\";a:3:{i:0;a:5:{s:4:\"data\";s:0:\"\";s:7:\"attribs\";a:1:{s:0:\"\";a:3:{s:3:\"url\";s:46:\"https://s.w.org/images/core/4.3/formatting.mp4\";s:6:\"length\";s:7:\"1574782\";s:4:\"type\";s:9:\"video/mp4\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}i:1;a:5:{s:4:\"data\";s:0:\"\";s:7:\"attribs\";a:1:{s:0:\"\";a:3:{s:3:\"url\";s:46:\"https://s.w.org/images/core/4.3/formatting.ogv\";s:6:\"length\";s:7:\"1939540\";s:4:\"type\";s:9:\"video/ogg\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}i:2;a:5:{s:4:\"data\";s:0:\"\";s:7:\"attribs\";a:1:{s:0:\"\";a:3:{s:3:\"url\";s:47:\"https://s.w.org/images/core/4.3/formatting.webm\";s:6:\"length\";s:6:\"686435\";s:4:\"type\";s:10:\"video/webm\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:7:\"jimmyxu\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:22155:\"<div style=\"width: 692px\">\nWordPress 4.3简体中文版现已<a href=\"https://cn.wordpress.org/releases/\">开放下载</a>，或在您的WordPress仪表盘中升级。我们将此版本命名为“Billie”，以纪念爵士钢琴手<a href=\"https://zh.wikipedia.org/zh-cn/%E6%AF%94%E8%8E%89%C2%B7%E8%8D%B7%E8%8E%89%E6%88%B4\">比莉·荷莉戴</a>。4.3中的新功能会让您更容易自定义网站及内容格式。</p>\n<div id=\"v-T54Iy7Tw-1\" class=\"video-player\"><video id=\"v-T54Iy7Tw-1-video\" width=\"620\" height=\"348\" poster=\"https://videos.files.wordpress.com/T54Iy7Tw/video-7601c95191_scruberthumbnail_1.jpg\" controls=\"true\" preload=\"metadata\" dir=\"ltr\" lang=\"en\"><source src=\"https://videos.files.wordpress.com/T54Iy7Tw/video-7601c95191_dvd.mp4\" type=\"video/mp4; codecs=&quot;avc1.64001E, mp4a.40.2&quot;\" /><source src=\"https://videos.files.wordpress.com/T54Iy7Tw/video-7601c95191_fmt1.ogv\" type=\"video/ogg; codecs=&quot;theora, vorbis&quot;\" /><div><img alt=\"Introducing WordPress 4.3 &quot;Billie&quot;\" src=\"https://videos.files.wordpress.com/T54Iy7Tw/video-7601c95191_scruberthumbnail_1.jpg\" width=\"620\" height=\"348\" /></div><p>Introducing WordPress 4.3 &quot;Billie&quot;</p></video></div>\n<hr />\n<h2>定制器菜单</h2>\n<div><img src=\"https://s.w.org/images/core/4.3/menu-customizer.png\" alt=\"\" /></div>\n<p>建立您的菜单，更新，然后指定至适当位置，同时还能在定制器里即时预览。流线式定制器设计提供对手机友好且更方便的介面。随着每个版本发布，它将变得更快、更好用。</p>\n<hr />\n<h2>格式快捷键</h2>\n<p><div style=\"width: 640px;\" class=\"wp-video\"><!--[if lt IE 9]><script>document.createElement(\'video\');</script><![endif]-->\n<video class=\"wp-video-shortcode\" id=\"video-995-1\" width=\"640\" height=\"360\" loop=\"1\" autoplay=\"1\" preload=\"metadata\" controls=\"controls\"><source type=\"video/mp4\" src=\"https://s.w.org/images/core/4.3/formatting.mp4?_=1\" /><source type=\"video/webm\" src=\"https://s.w.org/images/core/4.3/formatting.webm?_=1\" /><source type=\"video/ogg\" src=\"https://s.w.org/images/core/4.3/formatting.ogv?_=1\" /><a href=\"https://s.w.org/images/core/4.3/formatting.mp4\">https://s.w.org/images/core/4.3/formatting.mp4</a></video></div><br />\n您的写作流程伴随着WordPress 4.3全新格式快捷键功能将变得更快。使用星号来建立清单、井号建立一个标题。别再打断您的工作；您的文字搭配<code>*</code>和<code>#</code>看起来更加美好。</p>\n<hr />\n<h2>站点图标</h2>\n<p><img src=\"https://s.w.org/images/core/4.3/site-icon-customizer.png\" alt=\"\" /><br />\n在浏览器标签、收藏夹和移动设备主画面以站点图标作为您的站点代表。在定制器里新增您独一无二的站点图标；当您切换主题时仍保持不变。使您的站点呈现出自己的品牌。</p>\n<hr />\n<h2>更好的密码</h2>\n<p><img src=\"https://s.w.org/images/core/4.3/better-passwords.png\" alt=\"\" /><br />\n借助WordPress改进的密码设定功能使网站更安全。不再使用电子邮件接收密码，而是取得一个密码重设链接。当您在网站新增用户或编辑用户资料时，WordPress将会自动产生一个安全密码。</p>\n<hr />\n<h2>其他改善</h2>\n<ul>\n<li><strong>更顺滑的管理体验</strong> – 经过改进的跨管理界面的列表视图使您的WordPress更方便并且更容易在任何装置上运作。</li>\n<li><strong>关闭页面的评论</strong> – 新建立的页面将关闭评论，将讨论局限在您的博客，只在它们应该出现的地方显示。</li>\n<li><strong>快速自定义您的站点</strong> – 无论您是否在前台，都可以点击工具栏的自定义链接迅速为您的网站做出更改。</li>\n</ul>\n<hr />\n<h2>开发团队</h2>\n<p><a class=\"alignleft\" href=\"https://profiles.wordpress.org/obenland\"><img id=\"grav-2370ea5912750f4cb0f3c51ae1cbca55-0\" class=\"grav-hashed\" src=\"https://www.gravatar.com/avatar/2370ea5912750f4cb0f3c51ae1cbca55?d=mm&amp;s=180&amp;r=G\" alt=\"Konstantin Obenland\" width=\"80\" height=\"80\" /></a><br />\n此次发布由<a href=\"http://konstantin.obenland.it/\">Konstantin Obenland</a>领头，并得到了以下个人的帮助。这次发布包含了246人的贡献。在您喜欢的音乐服务中听听比莉·荷莉戴，并看看下面这些个人资料吧：</p>\n<p><a href=\"https://profiles.wordpress.org/mercime\">@mercime</a>、<a href=\"https://profiles.wordpress.org/aaroncampbell\">Aaron D. Campbell</a>、<a href=\"https://profiles.wordpress.org/jorbin\">Aaron Jorbin</a>、<a href=\"https://profiles.wordpress.org/adamkheckler\">Adam Heckler</a>、<a href=\"https://profiles.wordpress.org/adamsilverstein\">Adam Silverstein</a>、<a href=\"https://profiles.wordpress.org/akibjorklund\">Aki Bjorklund</a>、<a href=\"https://profiles.wordpress.org/akirk\">Alex Kirk</a>、<a href=\"https://profiles.wordpress.org/viper007bond\">Alex Mills (Viper007Bond)</a>、<a href=\"https://profiles.wordpress.org/tellyworth\">Alex Shiels</a>、<a href=\"https://profiles.wordpress.org/deconf\">Alin Marcu</a>、<a href=\"https://profiles.wordpress.org/andfinally\">andfinally</a>、<a href=\"https://profiles.wordpress.org/afercia\">Andrea Fercia</a>、<a href=\"https://profiles.wordpress.org/andg\">Andrea Gandino</a>、<a href=\"https://profiles.wordpress.org/nacin\">Andrew Nacin</a>、<a href=\"https://profiles.wordpress.org/azaozz\">Andrew Ozz</a>、<a href=\"https://profiles.wordpress.org/afragen\">Andy Fragen</a>、<a href=\"https://profiles.wordpress.org/ankit-k-gupta\">Ankit K Gupta</a>、<a href=\"https://profiles.wordpress.org/antpb\">Anth