ps://profiles.wordpress.org/sudar\">Sudar</a>、<a href=\"https://profiles.wordpress.org/sunnyratilal\">Sunny Ratilal</a>、<a href=\"https://profiles.wordpress.org/taka2\">taka2</a>、<a href=\"https://profiles.wordpress.org/tharsheblows\">tharsheblows</a>、<a href=\"https://profiles.wordpress.org/thorbrink\">Thor Brink</a>、<a href=\"https://profiles.wordpress.org/creativeinfusion\">Tim Smith</a>、<a href=\"https://profiles.wordpress.org/tlexcellent\">tlexcellent</a>、<a href=\"https://profiles.wordpress.org/tmatsuur\">tmatsuur</a>、<a href=\"https://profiles.wordpress.org/tobiasbg\">TobiasBg</a>、<a href=\"https://profiles.wordpress.org/tomasm\">Tomas Mackevicius</a>、<a href=\"https://profiles.wordpress.org/tomharrigan\">TomHarrigan</a>、<a href=\"https://profiles.wordpress.org/toro_unit\">Toro_Unit (Hiroshi Urabe)</a>、<a href=\"https://profiles.wordpress.org/toru\">Toru Miki</a>、<a href=\"https://profiles.wordpress.org/liljimmi\">Tracy (LilJimmi) Levesque</a>、<a href=\"https://profiles.wordpress.org/tryon\">Tryon Eggleston</a>、<a href=\"https://profiles.wordpress.org/tywayne\">Ty Carlson</a>、<a href=\"https://profiles.wordpress.org/desaiuditd\">Udit Desai</a>、<a href=\"https://profiles.wordpress.org/vivekbhusal\">vivekbhusal</a>、<a href=\"https://profiles.wordpress.org/westonruter\">Weston Ruter</a>、<a href=\"https://profiles.wordpress.org/willnorris\">Will Norris</a>、<a href=\"https://profiles.wordpress.org/willgladstone\">willgladstone</a>、<a href=\"https://profiles.wordpress.org/earnjam\">William Earnhardt</a>、<a href=\"https://profiles.wordpress.org/willstedt\">willstedt</a>、<a href=\"https://profiles.wordpress.org/eltobiano\">WPMU DEV Jose</a>、<a href=\"https://profiles.wordpress.org/yoavf\">Yoav Farhi</a>、<a href=\"https://profiles.wordpress.org/ysalame\">Yuri Salame</a>、<a href=\"https://profiles.wordpress.org/oxymoron\">Zach Wills</a>、<a href=\"https://profiles.wordpress.org/katzwebdesign\">Zack Katz</a>和<a href=\"https://profiles.wordpress.org/tollmanz\">Zack Tollman</a>。</p>\n<p>特别感谢<a href=\"http://siobhanmckeown.com/\">Siobhan McKeown</a>制作发布视频、<a href=\"http://hugobaeta.com/\">Hugo Baeta</a>的设计和<a href=\"http://jacklenox.com/\">Jack Lenox</a>的配音。</p>\n<p>最后，让我们感谢为发布视频制作了字幕的贡献者，这次的发布视频被翻译成了30种语言！</p>\n<p>如果您想帮忙，请查阅<a href=\"https://make.wordpress.org/\">Make WordPress</a>和我们的<a href=\"https://make.wordpress.org/core/\">核心开发博客</a>。感谢您选择WordPress，我们4.4见！\n</div>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:36:\"http://wellformedweb.org/CommentAPI/\";a:1:{s:10:\"commentRss\";a:1:{i:0;a:5:{s:4:\"data\";s:48:\"https://cn.wordpress.org/2015/08/21/billie/feed/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:38:\"http://purl.org/rss/1.0/modules/slash/\";a:1:{s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:2:\"13\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:3;a:6:{s:4:\"data\";s:42:\"\n		\n		\n		\n		\n		\n				\n\n		\n		\n				\n			\n		\n		\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:5:{s:0:\"\";a:7:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:25:\"WordPress 4.2“Powell”\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:43:\"https://cn.wordpress.org/2015/04/24/powell/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:52:\"https://cn.wordpress.org/2015/04/24/powell/#comments\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Thu, 23 Apr 2015 19:32:36 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"category\";a:1:{i:0;a:5:{s:4:\"data\";s:8:\"Releases\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"https://cn.wordpress.org/?p=977\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:11:\"isPermaLink\";s:5:\"false\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:49:\"WordPress 4.2简体中文版现已开放下载。\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:7:\"jimmyxu\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:30191:\"<div style=\"width: 692px\">\nWordPress 4.2简体中文版现已<a href=\"https://cn.wordpress.org/releases/\">开放下载</a>，或在您的WordPress仪表盘中升级。我们将此版本命名为“Powell”，以纪念爵士钢琴手<a href=\"https://en.wikipedia.org/wiki/Bud_Powell\">巴德·鲍威尔</a>。4.2中的新功能会帮助您与全世界交流共享。</p>\n<div id=\"v-e9kH4FzP-1\" class=\"video-player\"><video id=\"v-e9kH4FzP-1-video\" width=\"620\" height=\"348\" poster=\"https://videos.files.wordpress.com/e9kH4FzP/wordpress-4-2_scruberthumbnail_2.jpg\" controls=\"true\" preload=\"metadata\" dir=\"ltr\" lang=\"en\"><source src=\"https://videos.files.wordpress.com/e9kH4FzP/wordpress-4-2_dvd.mp4\" type=\"video/mp4; codecs=&quot;avc1.64001E, mp4a.40.2&quot;\" /><source src=\"https://videos.files.wordpress.com/e9kH4FzP/wordpress-4-2_fmt1.ogv\" type=\"video/ogg; codecs=&quot;theora, vorbis&quot;\" /><div><img alt=\"Introducing WordPress 4.2 &quot;Powell&quot;\" src=\"https://videos.files.wordpress.com/e9kH4FzP/wordpress-4-2_scruberthumbnail_2.jpg\" width=\"620\" height=\"348\" /></div><p>Introducing WordPress 4.2 &quot;Powell&quot;</p></video></div>\n<hr style=\"margin: 2em 0 3em\" />\n<h2 style=\"text-align: center;margin: 15px 0 20px;font-family: sans-serif;font-size: 26px\">更方便地共享内容</h2>\n<p><img class=\"alignnone size-full wp-image-3677\" src=\"https://wordpress.org/news/files/2015/04/4.2-press-this-2.jpg\" alt=\"按这里\" width=\"1000\" height=\"832\" /><br />\n收藏、编辑、发布，向您介绍最新的”按这里“工具。在工具菜单中，将”按这里“加入到您的浏览器书签或移动设备主屏幕，然后您就可以迅雷不及掩耳地共享您的内容。共享您喜欢的视频、图片和内容从来没有像现在这样简单快捷。</p>\n<hr style=\"margin: 2em 0 3em\" />\n<h2 style=\"text-align: center;margin: 15px 0 20px;font-family: sans-serif;font-size: 26px\">扩展的字符集支持</h2>\n<p><img class=\"alignnone size-full wp-image-3676\" src=\"https://wordpress.org/news/files/2015/04/4.2-characters.png\" alt=\"字符集支持：颜文字和特殊字符\" width=\"1000\" height=\"832\" /><br />\n无论您使用何种语言，在WordPress中写作都将变得更好。WordPress 4.2将原生支持许多新字符，包括中日韩文字、音乐和数学符号，以及象形文字。</p>\n<p>即使您没有在使用以上那些字符，您仍可获益——WordPress现已支持颜文字！发挥创意并用<img src=\"https://s.w.org/images/core/emoji/2.2.1/72x72/1f499.png\" alt=\"?\" class=\"wp-smiley\" style=\"height: 1em; max-height: 1em;\" />、<img src=\"https://s.w.org/images/core/emoji/2.2.1/72x72/1f438.png\" alt=\"?\" class=\"wp-smiley\" style=\"height: 1em; max-height: 1em;\" />、<img src=\"https://s.w.org/images/core/emoji/2.2.1/72x72/1f412.png\" alt=\"?\" class=\"wp-smiley\" style=\"height: 1em; max-height: 1em;\" />、<img src=\"https://s.w.org/images/core/emoji/2.2.1/72x72/1f355.png\" alt=\"?\" class=\"wp-smiley\" style=\"height: 1em; max-height: 1em;\" />与所有其他<a href=\"https://codex.wordpress.org/Emoji\">颜文字</a>来装点您的内容。</p>\n<hr style=\"margin: 2em 0 3em\" />\n<p><img class=\"alignright size-medium wp-image-3656\" src=\"https://wordpress.org/news/files/2015/04/4.2-theme-switcher-300x230.png\" alt=\"定制器中的主题切换器\" width=\"288\" height=\"221\" /></p>\n<h3 style=\"margin: 0 0 5px 0;font-size: 16px;font-weight: bold\">在定制器中切换主题</h3>\n<p>您可以在定制器中浏览和预览已安装的主题，并可让主题在您的站点亮相之前确保它能够搭配您的内容。</p>\n<div style=\"clear: both\"></div>\n<p><img class=\"alignright size-medium wp-image-3653\" src=\"https://wordpress.org/news/files/2015/04/4.2-embeds-300x230.png\" alt=\"Tumbr.com oEmbed样例\" width=\"288\" height=\"221\" /></p>\n<h3 style=\"margin: 0 0 5px 0;font-size: 16px;font-weight: bold\">更多的嵌入内容</h3>\n<p>把Tumblr.com和Kickstarter的链接粘贴进编辑器，那些内容就将魔法般地出现在您眼前。您的发布和编辑体验会随着我们的每次发布变得更密不可分。</p>\n<div style=\"clear: both\"></div>\n<p><img class=\"alignright size-medium wp-image-3654\" src=\"https://wordpress.org/news/files/2015/04/4.2-plugins-300x230.png\" alt=\"内联插件升级\" width=\"288\" height=\"221\" /></p>\n<h3 style=\"margin: 0 0 5px 0;font-size: 16px;font-weight: bold\">更流畅的插件升级</h3>\n<p>向无聊的加载屏幕说再见，并向简单顺滑的插件升级说你好。点击<em>现在升级</em>，您即可以看到魔法发生。</p>\n<div style=\"clear: both\"></div>\n<hr style=\"margin: 2em 0 3em\" />\n<h2 style=\"text-align: center;margin: 15px 0 20px;font-family: sans-serif;font-size: 26px\">引擎盖下</h2>\n<h5>utf8mb4支持</h5>\n<p>数据库字符编码已从utf8变为utf8mb4，加入了对所有4字节字符的支持。</p>\n<h5>JavaScript无障碍</h5>\n<p>您现在可以在JavaScript中通过<code>wp.a11y.speak()</code>向屏幕阅读器发送音频提醒。传入字符串，更新就会被发送到专用的ARIA即时通知区域。</p>\n<h5>分离共享的条目信息</h5>\n<p>不同分类法间共享的条目信息将在其中一条获得更新时分离。您可以在<a href=\"https://developer.wordpress.org/plugins/taxonomy/working-with-split-terms-in-wp-4-2/\">插件开发者手册</a>中获取更多信息。</p>\n<h5>复杂查询排序</h5>\n<p><code>WP_Query</code>、<code>WP_Comment_Query</code>和<code>WP_User_Query</code>现在支持使用具名的元查询条款进行复杂排序。</p>\n<hr style=\"margin: 2em 0 3em\" />\n<h2 style=\"text-align: center;margin: 15px 0 20px;font-family: sans-serif;font-size: 26px\">开发团队</h2>\n<p><a class=\"alignleft\" href=\"https://profiles.wordpress.org/drewapicture\"><img id=\"grav-95c934fa2c3362794bf62ff8c59ada08-0\" class=\"grav-hashed\" src=\"https://www.gravatar.com/avatar/95c934fa2c3362794bf62ff8c59ada08?d=mm&amp;s=180&amp;r=G\" alt=\"Drew Jaynes\" width=\"90\" height=\"90\" /></a></p>\n<p>此次发布由<a href=\"http://werdswords.com/\">Drew Jaynes</a>领头，并得到了以下个人的帮助。这次发布包含了283人的贡献，创下新高。在您喜欢的音乐服务中听听巴德·鲍威尔，并看看下面这些个人资料吧：</p>\n<p><a href=\"https://profiles.wordpress.org/mercime\">@mercime</a>、<a href=\"https://profiles.wordpress.org/a5hleyrich\">A5hleyRich</a>、<a hr