s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:25152:\"<div style=\"width: 692px\">\nWordPress 4.1简体中文版现已<a href=\"https://cn.wordpress.org/releases/\">开放下载</a>，或在您的WordPress仪表盘中升级。我们将此版本命名为“Dinah”，以纪念爵士歌手<a href=\"https://en.wikipedia.org/wiki/Dinah_Washington\">黛娜·华盛顿</a>。WordPress 4.1中的新功能帮助您聚焦于您的写作，新的默认主题也能让您有型地展示您的文章。</p>\n<hr />\n<h2 style=\"text-align: center;margin: 15px 0 20px;font-family: sans-serif;font-size: 26px\">向您介绍Twenty Fifteen</h2>\n<p><img class=\"aligncenter size-large wp-image-3389\" src=\"https://wordpress.org/news/files/2014/12/2015-laptop-1024x533.png\" alt=\"2015-laptop\" width=\"692\" height=\"360\" /></p>\n<h3 style=\"margin: 0 0 5px 0;font-size: 16px;font-weight: bold\">Twenty Fifteen，我们最新的默认主题，是一套以明晰为中心的面向博客的主题。</h3>\n<p><img class=\"alignright wp-image-3426 size-medium\" src=\"https://wordpress.org/news/files/2014/12/2015-phones-languages-small-300x250.png\" alt=\"\" width=\"300\" height=\"250\" />感谢<a href=\"\\&quot;%s\\&quot;\">Google的Noto字体家族</a>，Twenty Fifteen有着无懈可击的语言支持。</p>\n<p>简单的排版在任何屏幕尺寸上都容易阅读。</p>\n<p>您的内容永远居于最中，无论是在手机、平板、膝上型电脑还是台式机上阅读都是如此。</p>\n<hr style=\"clear: both\" />\n<h2 style=\"text-align: center;margin: 15px 0 20px;font-family: sans-serif;font-size: 26px\">免打扰写作</h2>\n<p><img class=\"aligncenter size-large wp-image-3392\" src=\"https://wordpress.org/news/files/2014/12/dfw-screen-1024x614.png\" alt=\"dfw-screen\" width=\"692\" height=\"415\" /></p>\n<h3 style=\"text-align: center;margin: 0 0 5px 0;font-size: 16px;font-weight: bold\"><em>去写吧</em></h3>\n<p>有时，您需要集中精力遣词造句。试试打开<strong>免打扰写作模式</strong>，在您开始打字时，所有会让您分心的东西都会淡出，让您只注意您的写作。您的所有编辑工具都会在您需要用到它们时立刻出现。</p>\n<hr />\n<h2 style=\"text-align: center;margin: 15px 0 20px;font-family: sans-serif;font-size: 26px\">细节之处</h2>\n<h5><strong><img class=\"alignleft wp-image-3405\" src=\"https://wordpress.org/news/files/2014/12/icon-language2.png\" alt=\"\" width=\"80\" height=\"80\" /></strong>选择语言</h5>\n<p>现在，WordPress 4.1已经有了40多种语言版本，我们也一直在进行更多翻译。您可以在常规选项中切换到任意一种语言。</p>\n<h5><strong><img class=\"alignleft wp-image-3406\" src=\"https://wordpress.org/news/files/2014/12/icon-logout1.png\" alt=\"\" width=\"80\" height=\"80\" /></strong>随处登出</h5>\n<p>如果您曾经担心过忘记在公用电脑上登出，您现在可以前往您的个人资料页面并登出您的所有会话。</p>\n<h5><strong><img class=\"alignleft wp-image-3407\" src=\"https://wordpress.org/news/files/2014/12/icon-vine1.png\" alt=\"\" width=\"80\" height=\"80\" /></strong>Vine嵌入</h5>\n<p>嵌入来自Vine的视频也已被简化为了将URL粘贴进文章里。查看我们支持的嵌入的<a href=\"https://codex.wordpress.org/Embeds\">完整列表</a>。</p>\n<h5><strong><img class=\"alignleft wp-image-3408\" src=\"https://wordpress.org/news/files/2014/12/icon-recommended1.png\" alt=\"\" width=\"80\" height=\"80\" /></strong>插件推荐</h5>\n<p>插件安装器现在会为您推荐值得一试的插件。推荐是基于您和其他用户已经安装的插件做出的。</p>\n<hr />\n<h2 style=\"text-align: center;margin: 15px 0 20px;font-family: sans-serif;font-size: 26px\">引擎盖下</h2>\n<h5>复杂查询</h5>\n<p>元数据、日期和信息查询现已支持高级条件逻辑，如嵌套语句和多种操作符——<code>A AND ( B OR C )</code>。</p>\n<h5>定制器API</h5>\n<p>定制器现在能够根据当前预览的页面有条件地显示面板和小节。</p>\n<h5>主题中的<code>&lt;title&gt;</code>标签</h5>\n<p><code>add_theme_support( \'title-tag\' )</code>让WordPress来处理复杂的页面标题。</p>\n<h5>开发者参考</h5>\n<p>通过对内联代码文档的改善，<a href=\"https://developer.wordpress.org/reference/\">开发者参考</a>现在比以往任何时候都更完整。</p>\n<hr />\n<h2 style=\"text-align: center;margin: 15px 0 20px;font-family: sans-serif;font-size: 26px\">合唱团</h2>\n<p>本次发布由<a href=\"https://profiles.wordpress.org/johnbillion\">John Blackbourn</a>领头，并得到了如下个人的帮助。在您喜欢的音乐服务中听听黛娜·华盛顿，并看看下面这些个人资料吧：</p>\n<p><a href=\"https://profiles.wordpress.org/aaroncampbell\">Aaron D. Campbell</a>、<a href=\"https://profiles.wordpress.org/jorbin\">Aaron Jorbin</a>、<a href=\"https://profiles.wordpress.org/adamsilverstein\">Adam Silverstein</a>、<a href=\"https://profiles.wordpress.org/akumria\">akumria</a>、<a href=\"https://profiles.wordpress.org/xknown\">Alex Concha</a>、<a href=\"https://profiles.wordpress.org/viper007bond\">Ale