ordPress。节日快乐，我们4.2见！\n</p></div>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:36:\"http://wellformedweb.org/CommentAPI/\";a:1:{s:10:\"commentRss\";a:1:{i:0;a:5:{s:4:\"data\";s:47:\"https://cn.wordpress.org/2014/12/23/dinah/feed/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:38:\"http://purl.org/rss/1.0/modules/slash/\";a:1:{s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:2:\"29\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:5;a:6:{s:4:\"data\";s:45:\"\n		\n		\n		\n		\n		\n				\n		\n\n		\n		\n				\n			\n		\n		\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:5:{s:0:\"\";a:7:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:27:\"WordPress 4.0.1安全更新\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:52:\"https://cn.wordpress.org/2014/11/21/wordpress-4-0-1/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:61:\"https://cn.wordpress.org/2014/11/21/wordpress-4-0-1/#comments\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Fri, 21 Nov 2014 03:51:39 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"category\";a:2:{i:0;a:5:{s:4:\"data\";s:8:\"Releases\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}i:1;a:5:{s:4:\"data\";s:8:\"Security\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"https://cn.wordpress.org/?p=942\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:11:\"isPermaLink\";s:5:\"false\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:45:\"WordPress 4.0.1简体中文版现已可用。\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:7:\"jimmyxu\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:3034:\"<p>WordPress 4.0.1现已发布，这是一次对所有较早版本的<strong>重要安全更新</strong>，我们强烈建议您立即升级您的站点。</p>\n<p>支持后台自动更新的站点将在未来几个小时内被自动升级到WordPress 4.0.1。如果您仍在使用WordPress 3.9.2、3.8.4或3.7.4，请升级到3.9.3、3.8.5或3.7.5来保证您站点的安全性。（我们不对旧版本提供支持，所以也请考虑升级到4.0.1来使用我们最新最强大的版本。）</p>\n<p>WordPress 3.9.2与更早版本均受一严重的跨站脚本漏洞影响，可能使匿名用户危害站点安全。此漏洞由<a href=\"http://klikki.fi/\">Jouko Pynnonen</a>报告。这项问题并不影响4.0版，但4.0.1版也修正了如下8个安全问题：</p>\n<ul>\n<li>三个可被网站文章作者利用的跨站脚本问题，由<a href=\"http://joncave.co.uk/\">Jon Cave</a>、<a href=\"http://www.miqrogroove.com/\">Robert Chapin</a>与WordPress安全团队的<a href=\"https://johnblackbourn.com/\">John Blackbourn</a>发现。</li>\n<li>一个可能被用来诱使用户修改密码的跨站请求伪造。</li>\n<li>一项在检查密码时可能引发拒绝服务的问题，由<a href=\"http://www.behindthefirewalls.com/\">Javier Nieto Arevalo</a>与<a href=\"http://www.devconsole.info/\">Andres Rojas Guerrero</a>发现。</li>\n<li>在WordPress发起HTTP请求时对服务器侧请求伪造攻击的额外防护，由Ben Bidner（vortfu）报告。</li>\n<li>一项极不可能发生的散列碰撞，可能导致2008年之后从未登录过的账户被盗，由<a href=\"http://david.dw-perspective.org.uk/\">David Anderson</a>报告。</li>\n<li>WordPress现在会在用户想起密码、登录并修改电子邮件地址后使早前发出的密码重设邮件中的链接失效，由<a href=\"https://twitter.com/MomenBassel\">Momen Bassel</a>、<a href=\"http://c0dehouse.blogspot.in/\">Tanoy Bose</a>与<a href=\"https://managewp.com/\">ManageWP的Bojan Slavković</a>独立报告。</li>\n</ul>\n<p>4.0.1版也修正了4.0中的23个bug，我们也做出了两项强化修改，包括在从上传的照片中提取EXIF数据时进行更好的验证，由<a href=\"http://www.securesolutions.no/\">Chris Andrè Dale</a>报告。</p>\n<p>我们感谢这些问题被<a href=\"https://codex.wordpress.org/FAQ_Security\">负责任地透漏</a>给我们的安全小组。要获取更多信息，请参见<a href=\"https://codex.wordpress.org/Version_4.0.1\">发布说明</a>或查阅<a href=\"https://core.trac.wordpress.org/log/branches/4.0?rev=30475&amp;stop_rev=29710\">修改列表</a>。</p>\n<p><a href=\"https://cn.wordpress.org/releases/\">下载WordPress 4.0.1简体中文版</a>或在仪表盘→更新中点击“现在更新”。</p>\n<p><em>已经在测试WordPress 4.1了？包含这些安全更新的beta 2现已发布（<a href=\"https://wordpress.org/wordpress-4.1-beta2.zip\">zip</a>）。更多有关4.1的信息，请参见<a href=\"https://wordpress.org/news/2014/11/wordpress-4-1-beta-1/\">beta 1发布说明</a>。</em></p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:36:\"http://wellformedweb.org/CommentAPI/\";a:1:{s:10:\"commentRss\";a:1:{i:0;a:5:{s:4:\"data\";s:57:\"https://cn.wordpress.org/2014/11/21/wordpress-4-0-1/feed/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:38:\"http://purl.org/rss/1.0/modules/slash/\";a:1:{s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:2:\"21\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:6;a:6:{s:4:\"data\";s:44:\"\n		\n		\n		\n		\n		\n				\n\n		\n		\n				\n			\n		\n\n\n		\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:5:{s:0:\"\";a:8:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:24:\"WordPress 4.0“Benny”\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:42:\"https://cn.wordpress.org/2014/09/05/benny/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:51:\"https://cn.wordpress.org/2014/09/05/benny/#comments\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Fri, 05 Sep 2014 00:38:11 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"category\";a:1:{i:0;a:5:{s:4:\"data\";s:8:\"Releases\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:30:\"http://cn.wordpress.org/?p=925\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:11:\"isPermaLink\";s:5:\"false\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:49:\"WordPress 4.0简体中文版现已开放下载。\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:9:\"enclosure\";a:2:{i:0;a:5:{s:4:\"data\";s:0:\"\";s:7:\"attribs\";a:1:{s:0:\"\";a:3:{s:3:\"url\";s:40:\"http://s.w.org/images/core/4.0/embed.mp4\";s:6:\"length\";s:7:\"3521313\";s:4:\"type\";s:9:\"video/mp4\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}i:1;a:5:{s:4:\"data\";s:0:\"\";s:7:\"attribs\";a:1:{s:0:\"\";a:3:{s:3:\"url\";s:40:\"http://s.w.org/images/core/4.0/focus.mp4\";s:6:\"length\";s:7:\"5181557\";s:4:\"type\";s:9:\"video/mp4\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:7:\"jimmyxu\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:23516:\"<div style=\"width: 692px\">\nWordPress 4.0简体中文版现已<a href=\"https://cn.wordpress.org/wordpress-4.0-zh_CN.zip\">开放下载</a>，或在您的WordPress仪表盘中升级。我们将此版本命名为“Benny”，以纪念<a href=\"https://zh.wikipedia.org/wiki/%E7%8F%AD%E5%B0%BC%C2%B7%E5%8F%A4%E5%BE%B7%E6%9B%BC\">本尼·古德曼</a>，爵士单簧管家和乐队指挥。这次发布为您带来了更顺滑的写作和管理体验，我们希望您喜欢。<br />\n<div id=\"v-bUdzKMro-1\" class=\"video-player\"><video id=\"v-bUdzKMro-1-video\" width=\"692\" height=\"388\" poster=\"https://videos.files.wordpress.com/bUdzKMro/wordpress-4-0_scruberthumbnail_0.jpg\" controls=\"true\" preload=\"metadata\" dir=\"ltr\" lang=\"en\"><source src=\"https://videos.files.wordpress.com/bUdzKMro/wordpress-4-0_dvd.mp4\" type=\"video/mp4; codecs=&quot;avc1.64001E, mp4a.40.2&quot;\" /><source src=\"https://videos.files.wordpress.com/bUdzKMro/wordpress-4-0_fmt1.ogv\" type=\"video/ogg; codecs=&quot;theora, vorbis&quot;\" /><div><img alt=\"Introducing WordPress 4.0 &quot;Benny&quot;\" src=\"https://videos.files.wordpress.com/bUdzKMro/wordpress-4-0_scruberthumbnail_0.jpg\" width=\"692\" height=\"388\" /></div><p>Introducing WordPress 4.0 &quot;Benny&quot;</p></video></div></p>\n<hr />\n<h2>优雅地管理媒体</h2>\n<p><img class=\"alignnone size-full wp-image-3316\"  src=\"//i2.wp.com/i0.wp.com/wordpress.org/news/files/2014/09/media.jpg?resize=692%2C406\" alt=\"媒体库\" width=\"632\" height=\"371\" /><br />\n在美丽、无尽的网格中浏览您上传的文件。无论您想查看或编辑多少文件，新的详情预览都能使这一过程无比迅捷。</p>\n<hr />\n<h2>管理嵌入现在前所未有地简单</h2>\n<div style=\"width: 640px;\" class=\"wp-video\"><video class=\"wp-video-shortcode\" id=\"video-925-2\" width=\"640\" height=\"360\" preload=\"metadata\" controls=\"controls\"><source type=\"video/mp4\" src=\"https://s.w.org/images/core/4.0/embed.mp4?_=2\" /><a href=\"https://s.w.org/images/core/4.0/embed.mp4\">https://s.w.org/images/core/4.0/embed.mp4</a></video></div>\n<p>在空行中粘贴一行YouTube URL，它就会魔术般地变成嵌入视频。现在用一条tweet试试。是的——嵌入现在变成了视觉体验。编辑器现在能够显示嵌入内容的真实预览，为您节约时间，也给您自信。</p>\n<p>我们也增加了默认支持的服务数量——您现在可以嵌入来自CollegeHumor的视频、来自YouTube的播放列表和来自TED的演讲。<a href=\"https://codex.wordpress.org/Embeds\">查阅所有WordPress支持的嵌入</a>。</p>\n<hr />\n<h2>专注于您的内容</h2>\n<div style=\"width: 640px;\" class=\"wp-video\"><video class=\"wp-video-shortcode\" id=\"video-925-3\" width=\"640\" height=\"360\" preload=\"metadata\" controls=\"controls\"><source type=\"video/mp4\" src=\"https://s.w.org/images/core/4.0/focus.mp4?_=3\" /><a href=\"https://s.w.org/images/core/4.0/focus.mp4\">https://s.w.org/images/core/4.0/focus.mp4</a></video></div>\n<p>写作和编辑现在变得更顺滑、更身临其境。随着您的写作，编辑器将会自动扩展来适应您的内容，并保证格式工具总是可用。</p>\n<hr />\n<h2>寻找正确的插件</h2>\n<p><img class=\"aligncenter size-large wp-image-3309\"  src=\"//i2.wp.com/i0.wp.com/wordpress.org/news/files/2014/09/add-plugin1.png?resize=692%2C405\" alt=\"添加插件\" width=\"632\" height=\"370\" /><br />\nWordPress的插件目录中现在有多于30,000个免费且开源的插件。WordPress 4.0通过加入新的条件、改善的搜索器和更可视化的浏览体验使找到符合您需要的插件变得更简单。</p>\n<hr />\n<h2>乐团</h2>\n<p>本次发布由<a href=\"http://helenhousandi.com/\">Helen Hou-Sandí</a>领头，并得到了以下优秀个人的协助。本次发布有275名贡献者参与，创下新高。在您喜欢的音乐服务中找找本尼·古德曼，并看看下面这些个人资料吧：</p>\n<p><a href=\"https://profiles.wordpress.org/sharonaustin\">_Redd</a>、<a href=\"https://profiles.wordpress.org/aaroncampbell\">Aaron D. Campbell</a>、<a href=\"https://profiles.wordpress.org/jorbin\">Aaron Jorbin</a>、<a href=\"https://profiles.wordpress.org/adamsilverstein\">Adam Silverstein</a>、<a href=\"https://profiles.wordpress.org/viper007bond\">Alex Mills (Viper007Bond)</a>、<a href=\"https://profiles.wordpress.org/tellyworth\">Alex Shiels</a>、<a href=\"https://profiles.wordpress.org/alexanderrohmann\">Alexander Rohmann</a>、<a href=\"https://profiles.wordpress.org/aliso\">Alison Barrett</a>、<a href=\"https://profiles.wordpress.org/collinsinternet\">Allan Collins</a>、<a href=\"https://profiles.wordpress.org/amit\">Amit Gupta</a>、<a href=\"https://profiles.wordpress.org/sabreuse\">Amy Hendrix (sabreuse)</a>、<a href=\"https://profiles.wordpress.org/afercia\">Andrea Fercia</a>、<a href=\"https://profiles.wordpress.org/andrezrv\">Andres Villarreal</a>、<a href=\"https://profiles.wordpress.org/zamfeer\">Andrew Mowe</a>、<a href=\"https://profiles.wordpress.org/nacin\">Andrew Nacin</a>、<a href=\"https://profiles.wordpress.org/azaozz\">Andrew Ozz</a>、<a href=\"https://profiles.wordpr