";s:8:\"Releases\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:30:\"http://cn.wordpress.org/?p=902\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:11:\"isPermaLink\";s:5:\"false\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:49:\"WordPress 3.9简体中文版现已开放下载。\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:7:\"jimmyxu\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:23707:\"<div style=\"width: 692px\">\nWordPress 3.9简体中文版现已<a href=\"https://cn.wordpress.org/wordpress-3.9-zh_CN.zip\">开放下载</a>，或在您的WordPress仪表盘中升级。我们将此版本命名为“Smith”，以纪念<a href=\"https://en.wikipedia.org/wiki/Jimmy_Smith_(musician)\">吉米·史密斯</a>，爵士风琴家。这次发布包含了众多细部修改，我们希望您喜欢。<br />\n<div id=\"v-sAiXhCfV-1\" class=\"video-player\"><video id=\"v-sAiXhCfV-1-video\" width=\"692\" height=\"388\" poster=\"https://videos.files.wordpress.com/sAiXhCfV/wordpress3-9-smith_scruberthumbnail_0.jpg\" controls=\"true\" preload=\"metadata\" dir=\"ltr\" lang=\"en\"><source src=\"https://videos.files.wordpress.com/sAiXhCfV/wordpress3-9-smith_dvd.mp4\" type=\"video/mp4; codecs=&quot;avc1.64001E, mp4a.40.2&quot;\" /><source src=\"https://videos.files.wordpress.com/sAiXhCfV/wordpress3-9-smith_fmt1.ogv\" type=\"video/ogg; codecs=&quot;theora, vorbis&quot;\" /><div><img alt=\"\" src=\"https://videos.files.wordpress.com/sAiXhCfV/wordpress3-9-smith_scruberthumbnail_0.jpg\" width=\"692\" height=\"388\" /></div></video></div></p>\n<h2 style=\"text-align: center\">更流畅的媒体编辑体验</h2>\n<p><img class=\"alignright\" src=\"https://wordpress.org/news/files/2014/04/editor1-300x233.jpg\" alt=\"编辑器\" width=\"228\" height=\"177\" /></p>\n<h3>改良的可视化编辑</h3>\n<p>新的可视化编辑器在速度、可用性、移动支持方面都有了进步。您现在可以从您的文字处理器中直接粘贴文本到可视化编辑器，无需再受杂乱的样式所困。（没错，我们在说你，Microsoft Word。）</p>\n<div style=\"clear: both\"></div>\n<p><img class=\"alignright\" src=\"https://wordpress.org/news/files/2014/04/image1-300x233.jpg\" alt=\"图像\" width=\"228\" height=\"178\" /></p>\n<h3>方便的图像编辑</h3>\n<p>裁剪和旋转工具更易访问，在您编辑文章时修改图像相比以往更加便捷。您也可在编辑器中缩放图像。</p>\n<div style=\"clear: both\"></div>\n<p><img class=\"alignright\" src=\"https://wordpress.org/news/files/2014/04/dragdrop1-300x233.jpg\" alt=\"拖放\" width=\"228\" height=\"178\" /></p>\n<h3>拖放您的图像</h3>\n<p>上传图像变得更简单，直接从桌面上拖放到编辑器中即可。</p>\n<div style=\"clear: both\"></div>\n<hr />\n<h2 style=\"text-align: center\">相册预览</h2>\n<p><img class=\"aligncenter size-full\" src=\"https://wordpress.org/news/files/2014/04/gallery1.jpg\" alt=\"gallery\" width=\"980\" height=\"550\" /><br />\n相册可在编辑器中展示能与已发布文章中的效果相媲美的图像网格。</p>\n<hr />\n<h2 style=\"text-align: center\">音频、视频的新花样</h2>\n<p>\n<a href=\'https://cn.wordpress.org/files/2014/04/AintMisbehavin.mp3\'>Ain\'t Misbehavin\'</a>\n<a href=\'https://cn.wordpress.org/files/2014/04/DavenportBlues.mp3\'>Davenport Blues</a>\n<a href=\'https://cn.wordpress.org/files/2014/04/JellyRollMorton-BuddyBoldensBlues.mp3\'>Buddy Bolden\'s Blues</a>\n<a href=\'https://cn.wordpress.org/files/2014/04/Johnny_Hodges_Orchestra-Squaty_Roo-1941.mp3\'>Squaty Roo</a>\n<a href=\'https://cn.wordpress.org/files/2014/04/Louisiana_Five-Dixie_Blues-1919.mp3\'>Dixie Blues</a>\n<a href=\'https://cn.wordpress.org/files/2014/04/WolverineBlues.mp3\'>Wolverine Blues</a>\n<br />\n图像属于相册，现在我们也对视频和音频加入了简单的播放列表，您可以方便地展示您的音乐和视频片段。</p>\n<hr />\n<h2 style=\"text-align: center\">实时挂件和顶部图像预览</h2>\n<div style=\"width: 692px\" class=\"wp-video\"><a href=\"//wordpress.org/news/files/2014/04/widgets.mp4\">//wordpress.org/news/files/2014/04/widgets.mp4</a></div>\n<p>在主题编辑器中添加、编辑并重排您站点的挂件，不再有出乎意料——实时预览您的修改，在您放心后才保存。经改善的顶部图像工具让您在自定义主题时可以上传、裁剪并管理顶部图像。</p>\n<hr />\n<h2 style=\"text-align: center\">令人惊叹的主题浏览器</h2>\n<p><img class=\"aligncenter size-full\" src=\"https://wordpress.org/news/files/2014/04/theme1.jpg\" alt=\"theme\" width=\"1003\" height=\"558\" /><br />\n寻找新主题应当是一项令人愉快的任务，通过崭新的主题浏览器漫游WordPress.org提供的无数免费主题吧。</p>\n<hr />\n<h2 style=\"text-align: center\">船员们</h2>\n<p>此次发布由<a href=\"http://nacin.com/\">Andrew Nacin</a>与<a href=\"http://www.getsource.net/\">Mike Schroder</a>牵头，并得到了以下这些优秀个人的帮助。共有267名贡献者参与了这次发布，历史新高：<br />\n<a href=\"https://profiles.wordpress.org/aaroncampbell\">Aaron D. Campbell</a>、<a href=\"https://profiles.wordpress.org/jorbin\">Aaron Jorbin</a>、<a href=\"https://profiles.wordpress.org/kawauso\">Adam Harley</a>、<a href=\"https://profiles.wordpress.org/adamsilverstein\">Adam Silverstein</a>、<a href=\"https://profiles.wordpress.org/adelval\">adelval</a>、<a href=\"https://profiles.wordpress.org/ajay\">Ajay</a>、<a href=\"https://profiles.wordpress.org/akeda\">Akeda Bagus</a>、<a href=\"https://profiles.wordpress.org/xknown\">Alex Concha</a>、<a href=\"https://profiles.wordpress.org/aliso\">Alison Barrett</a>、<a href=\"https://profiles.wordpress.org/collinsinternet\">Allan Collins</a>、<a href=\"https://profiles.wordpress.org/sabreuse\">Amy Hendrix (sabreuse)</a>、<a href=\"https://profiles.wordpress.org/afercia\">Andrea Fercia</a>、<a href=\"https://profiles.wordpress.org/nacin\">Andrew Nacin</a>、<a href=\"https://profiles.wordpress.org/norcross\">Andrew Norcross</a>、<a href=\"https://profiles.wordpress.org/azaozz\">Andrew Ozz</a>、<a href=\"https://profiles.wordpress.org/rarst\">Andrey &#8220;Rarst&#8221; Savchenko</a>、<a href=\"https://profiles.wordpress.org/andykeith\">Andy Keith</a>、<a href=\"https://profiles.wordpress.org/andy\">Andy Skelton</a>、<a href=\"https://profiles.wordpress.org/atimmer\">Anton Timmermans</a>、<a href=\"https://profiles.wordpress.org/aubreypwd\">Aubrey Portwood</a>、<a href=\"https://profiles.wordpress.org/barry\">Barry</a>、<a href=\"https://profiles.wordpress