g\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:1403:\"<p>WordPress 3.8.3现已发布，修正了<a href=\"https://wordpress.org/news/2014/04/wordpress-3-8-2/\">WordPress 3.8.2安全更新</a>中的一个bug。</p>\n<p>仪表盘中的“快速草稿”工具在3.8.2中未能正常工作，在您使用它时，您的草稿将不会被保存。尽管我们觉得不会有人用这个工具写小说，但<em>任何</em>数据丢失对我们来说都是不能接受的。</p>\n<p>我们认识到您对我们的信任，并且我们认真对待这份责任。我们对让您失望诚致歉意。</p>\n<p>仍<em>有可能</em>您上周丢失的快速草稿还在数据库中，只是您看不到它。然而，这些“丢弃的草稿”通常会在7天后被删除，而现在离我们上次发布已经过了6天。如果我们有幸救回您的草稿，您将会于更新后在“所有文章”界面看到它。（我们也将在后台推送3.8.3，所以可能您会发现列表中突然出现了一篇草稿。）</p>\n<p><a href=\"https://wordpress.org/download/\">下载WordPress 3.8.3</a>（<a href=\"https://cn.wordpress.org/wordpress-3.8.3-zh_CN.zip\">简体中文版</a>）或在仪表盘→更新中点击“现在更新”。</p>\n<p><em>这个bug也影响了3.7.2，所以我们发布了3.7.3版。但我们仍然希望您升级到最新版。</em></p>\n<hr />\n<p><em>Now for some good news:<br />\nWordPress 3.9 is near.<br />\nExpect it this week</em></p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:36:\"http://wellformedweb.org/CommentAPI/\";a:1:{s:10:\"commentRss\";a:1:{i:0;a:5:{s:4:\"data\";s:57:\"https://cn.wordpress.org/2014/04/15/wordpress-3-8-3/feed/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:38:\"http://purl.org/rss/1.0/modules/slash/\";a:1:{s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:2:\"34\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:9;a:6:{s:4:\"data\";s:42:\"\n		\n		\n		\n		\n		\n				\n\n		\n		\n				\n			\n		\n		\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:5:{s:0:\"\";a:7:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:27:\"WordPress 3.8.1维护更新\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:52:\"https://cn.wordpress.org/2014/01/25/wordpress-3-8-1/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:61:\"https://cn.wordpress.org/2014/01/25/wordpress-3-8-1/#comments\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Sat, 25 Jan 2014 03:46:56 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"category\";a:1:{i:0;a:5:{s:4:\"data\";s:8:\"Releases\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:30:\"http://cn.wordpress.org/?p=894\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:11:\"isPermaLink\";s:5:\"false\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:45:\"WordPress 3.8.1简体中文版现已可用。\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:7:\"jimmyxu\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:3832:\"<p>在WordPress 3.8发布逾六周，下载量<a href=\"https://wordpress.org/download/counter/\">逾9.3百万次</a>之后，我们很高兴能够发布WordPress 3.8.1。</p>\n<p>3.8.1版是为修正3.8中的31个bug而做出的维护更新，其中包含了对新仪表盘设计和主题管理屏幕的修正和改进。一项关于WP_Query中分类查询的问题已被修复。此外，如果您发现点击“提交”按钮后没有任何反应（或像我们中的某些人一样感到抓狂），请安心，我们已经发现并修复了这个问题。</p>\n<p>此版本也包含对<strong>嵌入推特</strong>（即将一条推特的URL置于单独的一行中）的修正，使其能够适应最近的Twitter API更新。（要查阅更多关于Embeds的资讯，请参见<a href=\"https://codex.wordpress.org/Embeds\">Codex</a>。）</p>\n<p>要查阅全部修改，请参见<a href=\"https://core.trac.wordpress.org/query?milestone=3.8.1\">工单列表</a>和<a href=\"https://core.trac.wordpress.org/log/branches/3.8?rev=27018&amp;stop_rev=26862\">修改历史</a>。此外，在开发博客上有关于此版本的<a href=\"https://make.wordpress.org/core/2014/01/22/wordpress-3-8-1-release-candidate/\">详细摘要</a>。</p>\n<p>如果您已经是WordPress 3.8的百万用户中的一员，我们将在未来几小时内为您自动在后台更新到WordPress 3.8.1。当然，这仅限<a href=\"https://wordpress.org/plugins/background-update-tester/\">支持后台更新</a>的站点。</p>\n<p><a href=\"https://wordpress.org/wordpress-3.8.1.zip\">下载WordPress 3.8.1</a>（<a href=\"https://cn.wordpress.org/wordpress-3.8.1-zh_CN.zip\">简体中文版</a>）或到管理后台的“仪表盘”→“更新”来升级。</p>\n<p>我们向以下对3.8.1做出贡献的人士致谢：</p>\n<p><a href=\"https://profiles.wordpress.org/jorbin\">Aaron Jorbin</a>、<a href=\"https://profiles.wordpress.org/collinsinternet\">Allan Collins</a>、<a href=\"https://profiles.wordpress.org/nacin\">Andrew Nacin</a>、<a href=\"https://profiles.wordpress.org/azaozz\">Andrew Ozz</a>、<a href=\"https://profiles.wordpress.org/aubreypwd\">Aubrey Portwood</a>、<a href=\"https://profiles.wordpress.org/empireoflight\">Ben Dunkle</a>、<a href=\"https://profiles.wordpress.org/cojennin\">Connor Jennings</a>、<a href=\"https://profiles.wordpress.org/dd32\">Dion Hulse</a>、<a href=\"https://profiles.wordpress.org/ocean90\">Dominik Schilling</a>、<a href=\"https://profiles.wordpress.org/fboender\">fboender</a>、<a href=\"https://profiles.wordpress.org/avryl\">Janneke Van Dorpe</a>、<a href=\"https://profiles.wordpress.org/janrenn\">janrenn</a>、<a href=\"https://profiles.wordpress.org/joedolson\">Joe Dolson</a>、<a href=\"https://profiles.wordpress.org/johnbillion\">John Blackbourn</a>、<a href=\"https://wordpress.org/news/2014/01/wordpress-3-8-1/#\">José Pino</a>、<a href=\"https://profiles.wordpress.org/kovshenin\">Konstantin Kovshenin</a>、<a href=\"https://profiles.wordpress.org/matveb\">Matias Ventura</a>、<a href=\"https://profiles.wordpress.org/mattheu\">Matthew Haines-Young</a>、<a href=\"https://profiles.wordpress.org/iammattthomas\">Matt Thomas</a>、<a href=\"https://profiles.wordpress.org/melchoyce\">Mel Choyce</a>、<a href=\"https://profiles.wordpress.org/batmoo\">Mohammad Jangda</a>、<a href=\"https://profiles.wordpress.org/morganestes\">Morgan Estes</a>、<a href=\"https://profiles.wordpress.org/nivijah\">nivijah</a>、<a href=\"https://profiles.wordpress.org/wonderboymusic\">Scott Taylor</a>、<a href=\"https://profiles.wordpress.org/sergeybiryukov\">Sergey Biryukov</a>、<a href=\"https://profiles.wordpress.org/undergroundnetwork\">undergroundnetwork</a>和<a href=\"https://profiles.wordpress.org/yurivictor\">Yuri Victor</a>。</p>\n<p><em>WordPress three eight one<br />\nWe heard you didn’t like bugs<br />\nSo we took them out</em></p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:36:\"http://wellformedweb.org/CommentAPI/\";a:1:{s:10:\"commentRss\";a:1:{i:0;a:5:{s:4:\"data\";s:57:\"https://cn.wordpress.org/2014/01/25/wordpress-3-8-1/feed/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:38:\"http://purl.org/rss/1.0/modules/slash/\";a:1:{s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:2:\"66\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}}}s:27:\"http://www.w3.org/2005/Atom\";a:1:{s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:0:\"\";s:7:\"attribs\";a:1:{s:0:\"\";a:3:{s:4:\"href\";s:30:\"https://cn.wordpress.org/feed/\";s:3:\"rel\";s:4:\"self\";s:4:\"type\";s:19:\"application/rss+xml\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:44:\"http://purl.org/rss/1.0/modules/syndication/\";a:2:{s:12:\"updatePeriod\";a:1:{i:0;a:5:{s:4:\"data\";s:6:\"hourly\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:15:\"updateFrequency\";a:1:{i:0;a:5:{s:4:\"data\";s:1:\"1\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}}}}}}}}s:4:\"type\";i:128;s:7:\"headers\";O:42:\"Requests_Utility_Ca