ase_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:95:\"https://wptavern.com/wordpress-com-adds-customization-for-amp-pages-pushes-update-to-amp-plugin\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:4882:\"<p>When Google first launched <a href=\"https://www.ampproject.org/\" target=\"_blank\">AMP</a> (Accelerated Mobile Pages), its open source initiative to speed up the mobile web, the project focused on getting publishers on board. AMP pages were featured in the &#8220;Top Stories&#8221; carousel and soon <a href=\"https://wptavern.com/google-is-amping-up-mobile-search-results-as-adoption-grows-beyond-publishing-industry\" target=\"_blank\">adoption of AMP grew beyond news publishers</a> to other industries such as e-commerce, recipe sites, and local listings. Ebay has <a href=\"https://www.ebayinc.com/stories/news/experience-the-lightning-bolt/\" target=\"_blank\">AMP&#8217;d up 15 million product category pages</a>, Pinterest is getting ready to <a href=\"https://engineering.pinterest.com/blog/building-faster-mobile-web-experience-amp\" target=\"_blank\">roll out AMP support for pins</a>, and Reddit is also <a href=\"https://redditblog.com/2016/09/20/a-faster-reddit-with-accelerated-mobile-pages/\" target=\"_blank\">serving AMP pages</a>.</p>\n<p>At the end of Septemeber Google <a href=\"https://search.googleblog.com/2016/09/search-results-are-officially-ampd.html\" target=\"_blank\">announced</a> that it has added AMP indicators to mobile search results. Users can now easily tell which results will load faster than others by looking for the AMP lightning bolt icon. The pressure is on for website owners to make their sites AMP-ready. Google said that AMP results are not yet prioritized over others, but page speed is factored into results.</p>\n<p><a href=\"https://i1.wp.com/wptavern.com/wp-content/uploads/2016/10/amp-in-mobile-search-results.png?ssl=1\"><img src=\"https://i1.wp.com/wptavern.com/wp-content/uploads/2016/10/amp-in-mobile-search-results.png?resize=1025%2C948&ssl=1\" alt=\"amp-in-mobile-search-results\" class=\"aligncenter size-full wp-image-62407\" /></a></p>\n<p>The search engine&#8217;s benchmarks demonstrate that AMP results provide a much faster experience for mobile users than pages that have not been optimized according to AMP specifications:</p>\n<blockquote><p>Today, the median time it takes for an AMP page to load from Google Search is less than one second. Beyond just saving you time with fast loading pages, AMP will also save you data &#8212; AMP pages on Search use 10 times less data than the equivalent non-AMP page.</p></blockquote>\n<p>In response with Google AMPing up mobile search results, <a href=\"https://en.blog.wordpress.com/2016/10/06/a-faster-mobile-web-wordpress-com-updates-for-accelerated-mobile-pages/\" target=\"_blank\">WordPress.com has pushed out a major update to its support for AMP pages</a>. According to Automattic representative Mark Armstrong, AMP pages have been &#8220;automatically turned on for every WordPress.com site and a sizable number of VIP publishers also turned it on manually.&#8221; This means that tens of millions of sites are now, according to Automattic&#8217;s tests, &#8220;up to 89% faster than normal faster&#8221; when reached via mobile search.</p>\n<p>The update also gives WordPress.com users the ability to customize the design for AMP pages using live preview in the Customizer. Users can select between a light and dark color screen and use a color-picker to select header text and link colors.</p>\n<p><a href=\"https://i1.wp.com/wptavern.com/wp-content/uploads/2016/10/google-amp-customizer2.png?ssl=1\"><img src=\"https://i1.wp.com/wptavern.com/wp-content/uploads/2016/10/google-amp-customizer2.png?resize=1025%2C783&ssl=1\" alt=\"google-amp-customizer2\" class=\"aligncenter size-full wp-image-62349\" /></a></p>\n<p>Automattic&#8217;s <a href=\"https://wordpress.org/plugins/amp/\" target=\"_blank\">AMP plugin</a> for self-hosted WordPress users has been updated to include support for tweaking the AMP template in the Customizer by navigating to <strong>Appearance > AMP</strong>. The plugin, which has more than 90,000 active installs, had not been updated for the past two months until today. During that time it accumulated many <a href=\"https://wordpress.org/support/plugin/amp/reviews/\" target=\"_blank\">negative reviews</a> due to lack of customizability, bugs, and no support for pages. Several users have reported that Google sent them a notification saying the AMP pages automatically created by the plugin are not compliant.</p>\n<p>The AMP plugin&#8217;s <a href=\"https://wordpress.org/plugins/amp/changelog/\" target=\"_blank\">changelog</a> details the changes in 0.4, which include support for inline styles, a fix for broken YouTube URLs, no more fatal errors when tags are not supported by post type, and handful of other improvements. The release also introduces a new filter <code>amp_pre_get_permalink</code> for creating a custom AMP permalink. Pages are still not supported, but the plugin&#8217;s FAQ tab indicates that Automattic is working on it.</p>\n<div id=\"epoch-width-sniffer\"></div>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Fri, 07 Oct 2016 20:42:13 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Sarah Gooding\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:1;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:79:\"WPTavern: The Deadline to Apply for the Kim Parsell Scholarship Is October 16th\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:29:\"https://wptavern.com/?p=62256\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:90:\"https://wptavern.com/the-deadline-to-apply-for-the-kim-parsell-scholarship-is-october-16th\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:1798:\"<p>When <a href=\"https://wptavern.com/kim-parsell-affectionately-known-as-wpmom-passes-away\">Kim Parsell passed away</a> in early 2015, the WordPress Foundation <a href=\"https://wptavern.com/the-wordpress-foundation-creates-a-traveling-scholarship-in-memory-of-kim-parsell\">created a travel scholarship</a> in her name not only to remember her, but to give a woman an opportunity to attend the largest WordCamp in the US who may not have the financial means to do so.</p>\n<p>WordCamp US is <a href=\"https://wptavern.com/the-wordpress-foundation-creates-a-traveling-scholarship-in-memory-of-kim-parsell\">accepting applications</a> for this year&#8217;s scholarship. The deadline to apply is October 16th at 12am Pacific Time. Only one scholarship will be awarded and is funded by the WordPress Foundation. It covers the cost of admission, airfare, and lodging.</p>\n<p>It does not cover things like taxis, meals outside the official event, or transportation to and from the airport. A winner will be announced on November 1st.</p>\n<p>To qualify for the scholarship, applicants must meet the following requirements.</p>\n<ul>\n<li>Must be a woman, this includes trans women.</li>\n<li>An active contributor to the WordPress project either through one of the contributor teams or as a local meetup or WordCamp organizer.</li>\n<li>Someone with financial need.</li>\n<li>Someone who has never attended WordCamp US.</li>\n</ul>\n<p>Anyssa Ferreira, who won<a href=\"https://wptavern.com/anyssa-ferreira-awarded-the-kim-parsell-memorial-scholarship\"> the scholarship</a> last year was unable to attend the event due to her travel VISA being denied. <a href=\"https://2016.us.wordcamp.org/\">WordCamp US</a> is scheduled to take place on December 2-4 in Philadelphia, PA.</p>\n<div id=\"epoch-width-sniffer\"></div>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Fri, 07 Oct 2016 19:09:39 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Jeff Chandler\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:2;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:48:\"BuddyPress: BuddyPress 2.7.0 Release Candidate 1\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:32:\"https://buddypress.org/?p=259560\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:68:\"https://buddypress.org/2016/10/buddypress-2-7-0-release-candidate-1/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:928:\"<p>BuddyPress 2.7.0 Release Candidate 1 is now available for testing. Please <a href=\"https://downloads.wordpress.org/plugin/buddypress.2.7.0-rc1.zip\">download the 2.7.0-rc1 zip</a> or get a copy via our Subversion repository.</p>\n<p>This is our last chance to find any bugs that slipped through the beta process. So please test with your themes and plugins. We plan to release BuddyPress 2.7.0 next Wednesday, October 12.</p>\n<p>A detailed changelog will be part of our official release notes, but you can get a quick overview by reading the post about the <a href=\"https://buddypress.org/2016/09/buddypress-2-7-0-beta-1/\">2.7.0 Beta 1</a> release.</p>\n<p>Let us know of any issues you find in <a href=\"https://buddypress.org/support\">the support forums</a> and/or on <a href=\"https://buddypress.trac.wordpress.org\">our development tracker</a>.</p>\n<p>Thanks in advance for giving the release candidate a test drive!</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Fri, 07 Oct 2016 01:15:21 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:8:\"@mercime\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:3;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:76:\"WPTavern: WordExpress Project Experiments with Bringing GraphQL to WordPress\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:29:\"https://wptavern.com/?p=62186\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:87:\"https://wptavern.com/wordexpress-project-experiments-with-bringing-graphql-to-wordpress\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:11373:\"<p><a href=\"https://i2.wp.com/wptavern.com/wp-content/uploads/2016/10/graphql.png?ssl=1\"><img src=\"https://i2.wp.com/wptavern.com/wp-content/uploads/2016/10/graphql.png?resize=1025%2C525&ssl=1\" alt=\"GraphQL logo\" class=\"aligncenter size-full wp-image-62337\" /></a></p>\n<p>In 2012, when Facebook started re-architecting its HTML5-driven mobile applications to be native iOS or Android apps, the company invented <a href=\"http://graphql.org/\" target=\"_blank\">GraphQL</a>. This new open source query language is being heralded as <a href=\"https://dev.to/reactiveconf/why-i-believe-graphql-will-come-to-replace-rest\" target=\"_blank\">a direct replacement for REST</a>. <a href=\"http://graphql.org/\" target=\"_blank\">GraphQL</a> provides a more efficient way of supporting the volume of interaction that takes place across Facebook&#8217;s apps every day, but it is database agnostic and built to be used beyond Facebook.</p>\n<p>Although GraphQL is still relatively new, big companies like Intuit, Coursera, Pinterest, and Shopify are using it in production. Last month GitHub <a href=\"http://githubengineering.com/the-github-graphql-api/\" target=\"_blank\">announced GraphQL support for its GitHub API</a> to answer some of the drawbacks of its REST architecture.</p>\n<p>GraphQL offers a new way of structuring communication from the client to the server that makes fetching data more efficient. In his article <a href=\"https://medium.com/chute-engineering/graphql-in-the-age-of-rest-apis-b10f2bf09bba#.93exvi6z2\" target=\"_blank\">GraphQL in the age of REST APIs</a>, Petr Bela summarizes the difference between the two types of architecture:</p>\n<blockquote><p>GraphQL’s power comes from a simple idea — instead of defining the structure of responses on the server, the flexibility is given to the client. Each request specifies what fields and relationships it wants to get back, and GraphQL will construct a response tailored for this particular request. The benefit: only one round-trip is needed to fetch all the complex data that might otherwise span multiple REST endpoints, and at the same time only return the data that are actually needed and nothing more.</p></blockquote>\n<p>Last month Facebook announced that GraphQL is exiting the &#8220;technical preview&#8221; stage and is now production ready. It has been <a href=\"http://graphql.org/code/\" target=\"_blank\">implemented in many different programming languages</a> and has already been adopted by companies that wanted a more efficient way of accessing data.</p>\n<h3>WordExpress Brings GraphQL to WordPress</h3>\n<p>Ramsay Lanier, a JavaScript front-end developer who works at <a href=\"https://nclud.com/\" target=\"_blank\">nclud</a> in Washington, D.C., has created a GraphQL-powered WordPress implementation called <a href=\"http://wordexpress.io/\" target=\"_blank\">WordExpress</a>. Lanier is not a fan of PHP and doesn&#8217;t like working with the loop or templates, all the things that have historically comprised the bulk of WordPress front-end development. He created WordExpress as a Node.js application with the goal of replacing PHP with JavaScript for the presentational side of WordPress. It uses Express on the backend and React components on the frontend. GraphQL sits between the two to retrieve data from the WordPress database.</p>\n<p>&#8220;When I originally started out with the idea for WordExpress, I wanted to use the REST API, but I found the existing endpoints were not what I wanted,&#8221; Lanier said. &#8220;I would end up having to write a bunch of custom endpoints and chaining calls together. So I thought I’d give GraphQL a try.&#8221;</p>\n<p>He found that GraphQL is more efficient than REST, because it reduces round trips to the server, allowing developers to focus on what data the client really needs. Lanier highlighted the benefits as they pertain to WordPress sites:</p>\n<blockquote><p>With GraphQL, the client determines the exact data it needs via a GraphQL query. The GraphQL query has a custom resolving function that determines how that data is retrieved. In that function, you can even hit multiple databases. For example, with WordPress you have a MySQL database, but you might also have a Mongo database for an application that stores other data that doesn’t need to be relational. In the GraphQL resolving function, you can make calls to retrieve data from both databases and send it back to the client in one server round trip.</p></blockquote>\n<p>WordExpress, in its current form, is a good starting place for building JavaScript-powered applications that use WordPress for administration. Lanier said this development setup allows him to create components of web pages and applications much more easily than with PHP templates.</p>\n<p>&#8220;With React, each component contains not just the markup to display stuff, but the styling for that component, the data the it requires to work, and any interaction logic as well &#8211; all in one or two files,&#8221; he said.</p>\n<h3>WordExpress&#8217; Current Challenges: Plugin Compatibility and Server-Side Rendering</h3>\n<p>Despite all the exciting benefits of more efficient queries and the possibility of a JavaScript-powered frontend, the WordExpress project has a number of serious challenges that would make it troublesome to use in production beyond a simple blog installation. It is not compatible with the vast majority of WordPress plugins, as most are written in PHP.</p>\n<p>&#8220;Essentially, I’ve replaced the entire front end, which means any plugins that affect the front end won’t do anything,&#8221; Lanier said. &#8220;However, you can certainly leverage existing plugins that affect the admin side of things (like Advanced Custom Fields or the AWS S3 plugin). Anything that manipulates how WordPress data is stored in MySQL is still usable &#8211; you just need to modify your GraphQL schema and queries to work with them.&#8221;</p>\n<p>The other major challenge is getting server-side rendering to work, which is required for handling things like SEO and meta tags. Apollostack, which WordExpress uses to fetch the data and deliver it to the React components, has only recently added <a href=\"https://github.com/apollostack/react-apollo/pull/83\" target=\"_blank\">early support for auto server-side rendering</a>.</p>\n<p>&#8220;I’ve switched from using Facebook’s Relay to ApolloStack,&#8221; Lanier said. &#8220;Both are pretty new technologies and I’m not sure if either has really figured out how to handle Server Side rendering very well. I haven’t looked into it in a few months, and things have been moving pretty quickly with ApolloStack, so they might have figured it out by now.&#8221;</p>\n<p>For now, WordExpress is just a proof-of-concept and Lanier said he doesn&#8217;t have plans to try to support existing plugins. Given that WordExpress cannot currently leverage themes and plugins, some of the best parts of the WordPress ecosystem, Lanier said developers who use this stack are probably more interested in preserving the power of the admin side of WordPress.</p>\n<p>&#8220;I love the WordPress admin,&#8221; he said. &#8220;It&#8217;s very powerful and easy to use to manage content. WordExpress would be a starting point for any JavaScript developer that wants to build WordPress applications using just JavaScript.&#8221;</p>\n<p>Lanier&#8217;s goal with WordExpress is to turn it into an npm package that can be reused in a variety of different React projects. He has already published two WordExpress npm packages that work together: <a href=\"https://www.npmjs.com/package/wordexpress-schema\" target=\"_blank\">wordexpress-schema</a> (handles the GraphQL schema and connection settings) and <a href=\"https://www.npmjs.com/package/wordexpress-components\" target=\"_blank\">wordexpress-components</a> (currently houses the first two components, WordExpressPage and WordExpressMenu). Since the project is built on Node.js, developers can make use of any npm package they want, a consolation for limited plugin compatibility.</p>\n<h3>GraphQL and the WP REST API</h3>\n<p>Many of those who are predicting that GraphQL will become a direct replacement for REST are also of the opinion that the two can co-exist. In fact, Facebook has recently written a guide for <a href=\"http://graphql.org/blog/rest-api-graphql-wrapper/\" target=\"_blank\">wrapping a REST API in GraphQL</a>.</p>\n<p>&#8220;It’s likely that if GraphQL proves to be effective, it will co-exist with REST APIs,&#8221; said Petr Bela. &#8220;Some APIs will use REST, some will use GraphQL. Some might support both.&#8221; He <a href=\"https://medium.com/chute-engineering/graphql-in-the-age-of-rest-apis-b10f2bf09bba#.3gl6k8kse\" target=\"_blank\">predicts</a> that it would take the industry years, perhaps even a decade, to completely switch from REST to GraphQL.</p>\n<p>Lanier&#8217;s WordExpress, which recently passed 1,000 stars on GitHub, is currently the only open source project that is publicly exploring a GraphQL-powered implementation of WordPress. A cursory <a href=\"https://github.com/search?utf8=%E2%9C%93&q=wordpress+graphql\" target=\"_blank\">search on GitHub</a> reveals that many others are experimenting with similar setups. Fortunately, GraphQL doesn&#8217;t require any changes to WordPress core to enable sites to use the API for querying the database.</p>\n<p>Lanier said he appreciates the work of those who are trying to get the WP REST API merged into core and doesn&#8217;t see GraphQL implementations as a threat to that.</p>\n<p>&#8220;I think the work they are doing with the REST API is good stuff,&#8221; he said. &#8220;They definitely needed to take that step. REST has been around for a long time &#8211; GraphQL is still pretty new, so it makes sense to go the REST route. Also, a lot more people know how to use it. The nice thing about GraphQL is that you can use it to wrap a REST API, so they can both co-exist.&#8221;</p>\n<p>The possibility of WordExpress going beyond a simple proof-of-concept depends on feedback from the community. Lanier said developers are demonstrating interest in WordExpress by forking it and asking questions.</p>\n<p>&#8220;People are using it and playing with and (hopefully) making it their own,&#8221; he said. &#8220;I think the interest is there. To make it really feasible, though, you need a whole team of developers making it a top notch option.&#8221;</p>\n<p>Lanier recently took a new job where he&#8217;s using React 100% and hasn&#8217;t had the opportunity to use WordPress for a little while but said he&#8217;s open to exploring collaboration to make WordExpress production ready.</p>\n<p>&#8220;If people were really interested and wanted to get together to grow it into a feasible solution, I would 100% be involved in that,&#8221; he said.</p>\n<p>Developers who want want to test it out and start developing with WordExpress will need a basic understanding of how React works. Lanier has written <a href=\"http://wordexpress.io/articles\" target=\"_blank\">detailed documentation</a> of how the GraphQL implementation is set up and how to extend GraphQL queries and database models. The <a href=\"http://wordexpress.io/\" target=\"_blank\">WordExpress.io</a> site is a live demo of the code, which you can find on <a href=\"https://github.com/ramsaylanier/WordExpress\" target=\"_blank\">GitHub</a>.</p>\n<div id=\"epoch-width-sniffer\"></div>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Thu, 06 Oct 2016 22:46:33 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Sarah Gooding\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:4;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:57:\"WPTavern: XWP Is the First Financial Sponsor of HeroPress\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:29:\"https://wptavern.com/?p=62190\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:68:\"https://wptavern.com/xwp-is-the-first-financial-sponsor-of-heropress\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:2821:\"<p><a href=\"https://i2.wp.com/wptavern.com/wp-content/uploads/2015/01/heropress.jpg?ssl=1\"><img class=\"aligncenter size-full wp-image-37733\" src=\"https://i2.wp.com/wptavern.com/wp-content/uploads/2015/01/heropress.jpg?resize=956%2C423&ssl=1\" alt=\"heropress\" /></a><a href=\"http://heropress.com/\">HeroPress</a>, founded by Topher DeRosia <a href=\"http://heropress.com/heropress-rising/\">in 2015</a>, has obtained its first financial sponsor in <a href=\"https://xwp.co/\">XWP</a>, a web development firm that specializes in WordPress. In recent weeks, DeRosia has added a <a href=\"http://heropress.com/sponsors/\">sponsors page</a> to the site that highlights businesses that are supporting the project.</p>\n<p>Pantheon is hosting the site for free and Ninja Forms, Theme Foundry, Postmatic, and WordImpress have donated licenses for their products. I asked DeRosia how the funds are helping the project, &#8220;This covers about a quarter of the time I spend on HeroPress,&#8221; DeRosia said.</p>\n<p>&#8220;There&#8217;s 100% coverage for Stacey Bartron, who makes the banners every week, plus a little for some skunk works experimentation. There will be more on that in November.&#8221;</p>\n<p>DeRosia said he is grateful to be able to pay Bartron for her efforts, &#8220;It&#8217;s one thing to work for free on my own, but I have a really hard time asking someone else to volunteer their time for my project,&#8221; DeRosia said. &#8220;Yet she did it willingly, so I&#8217;m super happy to be able to pay her now.&#8221;</p>\n<p>I reached out to Tine Haugen, managing director at XWP, and asked why the company is financially supporting the project. Haugen provided the Tavern with the following statement.</p>\n<blockquote><p>\nStorytelling is a powerful way to connect and inspire people. HeroPress is a platform that gives people in the WordPress community and beyond an opportunity to share their personal stories, make meaningful connections with others and inspire them in ways that can have lasting, positive impact on their lives. That is a compelling purpose and mission strongly aligned with our own.</p>\n<p>It should also be said that HeroPress creator, Topher DeRosia, is a former XWP team member. Being part of his journey with HeroPress has been a wonderful way to stay connected and continue to cultivate our relationship with him.</p>\n<p>We hope our contribution will inspire others to also give as a way to encourage its growth so that it can touch and impact even more lives.</p></blockquote>\n<p>If you&#8217;re interested in sponsoring or financially supporting the HeroPress project, you can contact DeRosia by emailing topher @ heropress.com. The additional funds will allow DeRosia to conduct more experiments with the site and travel to more WordCamps.</p>\n<div id=\"epoch-width-sniffer\"></div>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Thu, 06 Oct 2016 20:24:30 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Jeff Chandler\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:5;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:118:\"WPTavern: WPWeekly Episode 250 – Interview with Matt Cromwell, Head of Support and Community Outreach at WordImpress\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:58:\"https://wptavern.com?p=62271&preview=true&preview_id=62271\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:124:\"https://wptavern.com/wpweekly-episode-250-interview-with-matt-cromwell-head-of-support-and-community-outreach-at-wordimpress\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:3691:\"<p>In this episode of WordPress Weekly, <a href=\"http://marcuscouch.com/\">Marcus Couch</a> and I are joined by <a href=\"https://www.mattcromwell.com/\">Matt Cromwell</a>, Head of Support and Community Outreach at <a href=\"https://wordimpress.com/\">WordImpress</a>. We learn how WordImpress was founded, why the company entered the product space with the <a href=\"https://givewp.com/\">GiveWP</a> donations plugin, and the inspiration behind the company&#8217;s mission statement to democratize generosity.</p>\n<p>Cromwell also shared two of his favorite plugins with the audience. The first is <a href=\"https://wordpress.org/plugins/edd-metrics/\">EDD Metrics</a> by <a href=\"https://profiles.wordpress.org/scottopolis/\">Scott Bolinger,</a> that adds metrics for businesses such as average revenue per customer, renewal rate, refund rate, and more. The second is <a href=\"https://wordpress.org/plugins/postman-smtp/\">Postman SMTP Mailer/Email Log</a> by <a href=\"https://profiles.wordpress.org/jasonhendriks/\">Jason Hendriks,</a> that assists in the delivery of email generated by WordPress. You&#8217;ll have to listen to the show to find out why Cromwell enjoys these two particular plugins.</p>\n<h2>Stories Discussed:</h2>\n<p><a href=\"https://wptavern.com/loopconf-postponed-due-to-hurricane-matthew-wordcamp-orlando-is-questionable\">LoopConf Postponed Due to Hurricane Matthew, WordCamp Orlando is Questionable</a><br />\n<a href=\"https://wptavern.com/the-div-selected-by-code-org-to-help-expand-computer-science-education-in-oklahoma\">The Div Selected by Code.org to Help Expand Computer Science Education in Oklahoma</a><br />\n<a href=\"https://wptavern.com/pippin-williamson-shakes-up-page-builder-plugins-with-critical-review\">Pippin Williamson Shakes Up Page Builder Plugins with Critical Review</a><br />\n<a href=\"https://wptavern.com/wordcamp-orlando-cancelled-due-to-hurricane\">WordCamp Orlando Cancelled Due to Hurricane</a></p>\n<h2>Plugins Picked By Marcus:</h2>\n<p><a href=\"https://wordpress.org/plugins/minimum-order-amount-for-woocommerce/\">Minimum Order Amount for Woocommerce</a> allows you to set a minimum amount for WooCommerce orders. You can also configure the notification message that is sent when the minimum amount is not reached.</p>\n<p><a href=\"https://wordpress.org/plugins/waitlist-woocommerce/\">WooCommerce Waitlist</a> lets you track demand for out-of-stock items, ensuring customers feel informed, and therefore more likely to buy. When a product is back in stock, an email is automatically sent to notify interested customers.</p>\n<p><a href=\"https://wordpress.org/plugins/idw-display-woo-dynamic-quantity-table/\">Woo Dynamic Quantity Table</a> works with the official <a href=\"https://woocommerce.com/products/dynamic-pricing/\">WooCommerce Dynamic Pricing</a> plugin, but takes it a step further. Once dynamic pricing data has been entered and the plugin is activated, it automatically displays a table with the price and quantity next to the product.</p>\n<h2>WPWeekly Meta:</h2>\n<p><strong>Next Episode:</strong> Wednesday, October 12th 9:30 P.M. Eastern</p>\n<p><strong>Subscribe To WPWeekly Via Itunes: </strong><a href=\"https://itunes.apple.com/us/podcast/wordpress-weekly/id694849738\" target=\"_blank\">Click here to subscribe</a></p>\n<p><strong>Subscribe To WPWeekly Via RSS: </strong><a href=\"https://wptavern.com/feed/podcast\" target=\"_blank\">Click here to subscribe</a></p>\n<p><strong>Subscribe To WPWeekly Via Stitcher Radio: </strong><a href=\"http://www.stitcher.com/podcast/wordpress-weekly-podcast?refid=stpr\" target=\"_blank\">Click here to subscribe</a></p>\n<p><strong>Listen To Episode #250:</strong><br />\n</p>\n<div id=\"epoch-width-sniffer\"></div>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Thu, 06 Oct 2016 19:26:19 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Jeff Chandler\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:6;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:53:\"WPTavern: WordCamp Orlando Cancelled Due to Hurricane\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:29:\"https://wptavern.com/?p=62188\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:64:\"https://wptavern.com/wordcamp-orlando-cancelled-due-to-hurricane\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:1750:\"<p>Lisa Melegari, lead organizer of WordCamp Orlando, <a href=\"https://2016.orlando.wordcamp.org/2016/10/05/wordcamp-orlando-canceled-due-to-hurricane-matthew/\">confirmed earlier today</a> that the event is cancelled due to hurricane Matthew. Rosen UCF campus, the venue where the event was to be held announced that it is under a mandatory order to remain closed until Sunday, eliminating the possibility of having sessions this weekend.</p>\n<p>Those who purchased tickets are encouraged to fill out the <a href=\"https://docs.google.com/forms/d/e/1FAIpQLSdj5NNMIqpqRahDAVs-FXX1Ppx9QvE-FWHeezJ7ZHgV2W3i_g/viewform\">following form</a> to request a refund. Refund requests will be collected until Friday, October 14th and will be sent to WordCamp Central for processing. Those who purchased tickets more than 60 days ago will be contacted by WordCamp Central to arrange a refund. Ticket buyers can also carry over the ticket price.</p>\n<p>&#8220;We are considering other options so the months of planning WCORL 2016 are not in vain,&#8221; Melegari said. &#8220;If you believe you will be interested in a future WordCamp Orlando event, you have the option of carrying over your ticket price to the next event.&#8221;</p>\n<p>Although ticket buyers who <a href=\"https://2016.orlando.wordcamp.org/2016/10/05/wordcamp-orlando-canceled-due-to-hurricane-matthew/#comments\">commented on the announcement</a> were disappointed, they expressed their understanding and praised the event’s volunteers for their efforts. WordCamp organizers have a lot to plan for but hurricanes in October typically don&#8217;t make the list. WordCamp Orlando 2016 is the first WordCamp in history to be cancelled because of a hurricane.</p>\n<div id=\"epoch-width-sniffer\"></div>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Thu, 06 Oct 2016 00:36:02 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Jeff Chandler\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:7;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:55:\"WPTavern: WordPress.com Adds SEO Tools to Business Plan\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:29:\"https://wptavern.com/?p=62138\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:66:\"https://wptavern.com/wordpress-com-adds-seo-tools-to-business-plan\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:3198:\"<p>WordPress.com is a service that doesn&#8217;t allow users to install plugins to add functionality. Because of this, users are at the mercy of WordPress.com and the tools it offers for managing SEO. These tools have expanded with the ability to create custom meta descriptions, custom title formats, and live previews <a href=\"https://en.blog.wordpress.com/2016/10/03/attract-more-visitors-to-your-business-site-with-our-advanced-seo-tools/\">now available</a> to <a href=\"https://wordpress.com/business\">WordPress.com Business Plan</a> customers.</p>\n<p>Custom Meta Descriptions allow you to create an excerpt of text that is used by search engines and is displayed in search results.</p>\n<p><img class=\" size-full wp-image-62197 aligncenter\" src=\"https://i0.wp.com/wptavern.com/wp-content/uploads/2016/10/CustomMetaDescriptionsWPCom.png?resize=546%2C466&ssl=1\" alt=\"custommetadescriptionswpcom\" /></p>\n<p>You can also customize how page titles appear by rearranging attributes. For example, instead of Site Name, Tagline, Post Title, you can change it to Post Title, Tagline, Site Name.</p>\n<p><img class=\"aligncenter size-full wp-image-62200\" src=\"https://i0.wp.com/wptavern.com/wp-content/uploads/2016/10/CustomeTitleFormatWPCom.jpg?resize=1025%2C1180&ssl=1\" alt=\"CustomeTitleFormatWPCom.png\" /></p>\n<p>After setting a custom meta description and page title, you can use the live preview tool to see how the content will look on WordPress.com Reader, Google, Facebook, and Twitter.</p>\n<p>Considering these tools are new, many users may not know how to properly use them. Rebecca Gill, founder of <a href=\"https://www.web-savvy-marketing.com/\">Web-Savvy-Marketing</a> and co-founder of <a href=\"https://www.web-savvy-marketing.com/2016/08/seo-bootcamp-coming/\">SEO Bootcamp</a>, shared the following advice with the Tavern. These tips also apply to those using the self-hosted version of WordPress.</p>\n<blockquote><p>One thing I constantly state is that meta titles and descriptions are your first opportunity to sell to visitors. It is what the visitor sees before they enter your website or blog. As such, they are very valuable. When used properly, they increase click-through rates from search engines, which drives traffic, and influences SEO.</p>\n<p>Each page or post should have a unique meta title and description. These should be populated by a human, for a human, and should include your focused keyword phrase.</p>\n<p>They should not be filled with a bunch of keywords or phrases. The goal is to use them to articulate what the content is about and encourage the user to read and click-through to the site or blog.</p></blockquote>\n<p>WordPress.com users can also <a href=\"https://en.blog.wordpress.com/2013/03/22/seo-on-wordpress-com/\">read this article</a> published in 2013 that covers most of what you&#8217;re able to do to optimize content on the service. For more tips on SEO, I encourage you to listen to <a href=\"https://wptavern.com/wpweekly-episode-244-myths-lies-and-the-truth-of-seo-with-rebecca-gill\">episode 244 of WordPress Weekly</a> where Rebecca and I discuss a wide range of topics related to SEO and WordPress.</p>\n<div id=\"epoch-width-sniffer\"></div>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Wed, 05 Oct 2016 23:31:52 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Jeff Chandler\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:8;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:40:\"HeroPress: The Bumpy Journey of Becoming\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:55:\"http://heropress.com/?post_type=heropress-essays&p=1369\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:51:\"http://heropress.com/essays/bumpy-journey-becoming/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:16838:\"<img width=\"960\" height=\"480\" src=\"http://heropress.com/wp-content/uploads/2016/10/100516-2-1024x512.jpg\" class=\"attachment-large size-large wp-post-image\" alt=\"Pull Quote: We cannot know the end of any journey until we find ourselves there.\" /><p><em>‘There is a crack in everything. That’s how the light gets in.’  &#8212; Leonard Cohen</em></p>\n<img class=\"wp-image-1376 size-full\" src=\"http://heropress.com/wp-content/uploads/2016/10/meaged5.jpg\" alt=\"Photo of Tamsin, age 5, sitting on the lawn with a cute hat on\" width=\"345\" height=\"357\" />Me aged 5 yrs\n<p><strong>My journey began when I lost my hero.</strong></p>\n<p>(In truth, I didn’t lose her, she died.)</p>\n<p>We had come together during dark times. Her husband, my grandfather, passed away painfully when I was five. Around the same time, my parents were separating. We became acquainted in a black hole. Together, we decided to escape that place and conquer the world.</p>\n<p>Her life had been very different to mine. She was born in a castle, she’d luncheoned with the queen and she’d dined with Louis Armstrong. On paper, my grandmother had led a “perfectly marvelous” life. (I’d just begun mine and my world was painfully ordinary.)</p>\n<p>I came to love her when I realized that her life had also involved struggle. That I related to. We’d watch the Roger and Hammerstein classics; we’d marvel at the gorgeous dresses, beautiful songs and epic dance sequences, but we also understood the tragedy of it all. It hit our hearts in the same way.</p>\n<blockquote><p>In those quiet, domestic moments I saw a little girl re-emerge, just for a moment and only for me. It was there that I discovered that we weren’t so different after all.</p></blockquote>\n<p>As an army brat, her childhood had been turbulent and tough. Her father was a stern Scot who regimentally walked his children up and down hills everyday. For this reason, as an adult, Grandma refused to walk anywhere. Quite soon, after the outbreak of war, her father went missing. He was presumed dead for eight years. In the meantime, Grandma and her siblings were evacuated to Wales, whilst their mother took on factory work in London.</p>\n<p>Her younger brother Stanley spent the war, without his siblings, living with an elusive, elderly man who cut the bread for breakfast against his rotten, wooden leg. The two sisters lived with a couple of mean, closeted, lesbians who immediately disliked my grandmother. (Apparently she wasn’t as pretty as her older sister, Ellen.)</p>\n<p>Needless to say, after the children were all returned to London, none of them ever revisited Wales. And, when the war was finally over, a little man arrived at their doorstep, tiny and broken: their father, a long time prisoner of war, found his way home in the end.</p>\n<p>Grandma had many other bumps along the way. She wouldn’t want them written here so I will resist. Despite having a lot to say, she was equally keen to hear our stories. We discussed politics, parties, Facebook, school, university, virtual reality, our friends, marriage, alien life forms and, of course, the dreams that occupied our minds. We frequently debated and bantered into the night.</p>\n<p>Naturally, as our friendship progressed, I began to dread her demise.</p>\n<h3>It didn’t seem plausible, or fair, that one day my Gandalf would be no more.</h3>\n<a href=\"http://heropress.com/wp-content/uploads/2016/10/grandmaandgrandad.png\"><img class=\"wp-image-1377\" src=\"http://heropress.com/wp-content/uploads/2016/10/grandmaandgrandad-204x300.png\" alt=\"Tamsin\'s Grandparents on their wedding day\" width=\"300\" height=\"441\" /></a>Grandma and Grandpa\n<p>This huggable tornado was still discussing politics with me, waving her big stick around (with a glass of “vino” in one hand) at eighty-seven. She still talked into the night with us, and laughed as she had always laughed. She never went “do-lalley”. She did eventually need a <a href=\"https://en.wikipedia.org/wiki/Walker_(mobility)\">zimmerframe</a> (a.k.a “faithful Fred”) but that was about it. Then one day she was gone. It wasn’t in a puff of smoke but it was close to that.</p>\n<p>When she died I didn’t fall apart. I held it together, somehow. My sister and I wrote and read the content for her memorial. I pressed the button that sent her body into the flames. I did it all with relative composure.</p>\n<p>It helped that, for the first year at least, I sensed that she’d stuck around just for me. I saw her in the black crow following me on my cycle ride to work and in the moth flying around the pulpit, at her funeral. I became attracted to the things that she had loved. I became strong, assertive and bold, as she had been. But, there were signs that I was crumbling.</p>\n<p>I fell twice: once down the stairs (to be found unconscious by my now husband) and, secondly, off a horse on my honeymoon. I still have the scar where my third eye should be to remind me of that second, landing face down in a sand dune, incident. And, a few other strange things occurred, things I won’t bother you with now.</p>\n<p>To cut a long story short, I didn’t know it then but I was ‘becoming’ and, this becoming was painful. It felt like shedding skin or letting a shell fall off. I didn’t want my shell to fall off. It had housed me all this time. But it came off, whether I was prepared for it or not, and all of a sudden I found that I was ‘homeless’.</p>\n<blockquote><p>It was as if the universe turned off all the lights so that I might find my own light.</p></blockquote>\n<p>At some point in the darkness, I began to ask myself: “what do you want to do with the rest of your life?” (I haven’t stopped asking that question. The only difference now is I’m kinder to myself.) I discovered that my intention was to bring magic and light into the world. At that time, I also wanted to bring my grandmother back. A book felt like the right portal from which I might be able to achieve this. Why? Well, stories for me have always managed to make the impossible seem possible. (Just to be safe, I decided that I would write a magical story.)</p>\n<h3>Where does WordPress come in?</h3>\n<p>I had known about WordPress for a number of years because my husband and I had started a business building E-commerce stores with WordPress. He was, and still remains, the technical wiz. Over time, I learned a few things too but, in all honesty, web stuff has never impassioned me all that much. (To this day I still try and get off the computer as much as I can.) However, during this rather difficult year I started a blog. It was a way of exploring the concepts that mattered to me. I could have used a notebook I suppose but it felt better to put my ideas into posts. It felt cleaner, tidier and more productive in this format.</p>\n<p>The blog became a vision board of sorts, where my thoughts (or my ‘wonderings’, as I would later call them) could be expressed, shaped and remade. It also allowed me to keep a record of the research that I was gathering for my book. Every time I watched an inspirational video, or read an interesting book, I would write about it.</p>\n<p>It is worthwhile to experiment in WordPress. Your voice will express itself in its own unique way, and differently at different times. Don’t be afraid of that. You might prefer audio, video, imagery or the written word &#8211; I recommend trying all of these mediums. I am still experimenting.</p>\n<blockquote><p>No one is you so no one will ‘create’ as you will.</p></blockquote>\n<p>Allow your creativity to run wild and try not to think too much about how others might interpret you. I found it incredibly digressive when I started trying to sell myself, and my ideas, especially when I wasn’t ready. I found myself playing the imitation game and constantly looking out for guidance. As a result, the blog got boring.</p>\n<p>What you take away from it, the experience, that’s what matters most. That’s what will last. Not the likes or the shares. It has helped me to look back and remember that, once upon a time, it was just me &#8211; talking to myself, writing alone, trying to find order and clarity during a difficult time. I still value this aspect of the experience more than anything else.</p>\n<h3>Forget the bigger picture</h3>\n<p>In my recent talk for WordCamp Brighton I discussed <a href=\"http://wordpress.tv/2016/08/09/tamsin-taylor-a-heros-journey/\">The Hero’s Journey</a> &#8211; a bumpy journey of becoming that we all must take, over and over again, as we progress throughout our lives. What I didn’t say in that talk was that I don’t think we will ever know the bigger picture until our time has come to leave this Wonderland.</p>\n<blockquote><p>We cannot know the end of any journey until we find ourselves there.</p></blockquote>\n<p>It sounds obvious I know, but we are conditioned to perfect and finish ourselves – to have it all planned out. And what we discover, quite quickly, is that life isn’t like that.</p>\n<p>I don’t know why my grandmother died on that particular Christmas day, several years ago. I don’t know why we never got to say goodbye in person. (I like to think that, perhaps, goodbyes were never going to be possible for friends such as us.) What I do know is that it catapulted me into a new life and a new me. WordPress was helpful in shaping this new identity.</p>\n<p>Needless to say, the journey isn’t over. Writing this first book has been a very mysterious, difficult and sometimes bewildering experience for me. Early on I decided that I wouldn’t plan it, or try to define what it was. I would just trust that something wanted to be written. It sounds strange I know. (By now you may have gathered I am a bit bonkers. They say the best people always are. <img src=\"https://s.w.org/images/core/emoji/2/72x72/1f642.png\" alt=\"?\" class=\"wp-smiley\" /> ) The book first came out like vomit and then it began to form itself inside my head and then one day it was born on the page.</p>\n<p>Only three of us witnessed the birth of <em>The Little book of learning to fly</em>: WordPress, Grandma and I. I was sitting amid lots of paper, staring at the screen and I just knew it was done.</p>\n<p>It wasn’t walking or talking yet but it was out of me and on the page. Moreover, I knew Grandma and I had written the ending together. That was a big feat, considering she was dead and all that. And yes, I did shed a tear, because it was one of the most WONDERful surprises of my life. We somehow managed one final, great adventure together.</p>\n<p>Whatever journey you are on &#8211; grasp it, explore it and cherish it. Don’t race to, or seek to anticipate, the ending. Enjoy the journey instead. Be willing to be brave because life will surprise you. And finally, love.</p>\n<h3>Love with all your heart, even when that heart is broken.</h3>\n<p>Below is the closing extract of the first draft of <em>The Little book of learning to fly</em>. Thank you WordPress.</p>\n<p><em>…Frederic didn’t know that he lived in a mansion of a thousand rooms because he had never bothered to look. He was quite content in the one room that he occupied… At least, he believed himself to be. Sometimes the wallpaper was a bit off, but he got it right in the end. He felt no need to venture further. What would be the point? Would it even be safe?</em></p>\n<p><em>From this room, at the bottom of his mansion, he could see the street and people going about their daily business. He witnessed a few instances of fighting, some moments of self-sacrifice and quite a bit of lovemaking. It was all very entertaining, but a bit disconcerting sometimes.</em></p>\n<p><em>One day he decided to walk around all the rooms of his mansion. He’d gotten a letter in the post about it &#8211; from an estate agent of all people! So, he thought, why not? He tentatively put the dishwasher on, closed the door to his little room and ascended the stairs.</em></p>\n<p><em>The first floor was rather difficult to navigate: some of the doorknobs were rusted from neglect, and so difficult to turn, and many of the rooms were filled with cobwebs and shadows. He found himself clearing these spaces as he went and he gave a great sigh of relief when he was finally able to leave that first floor behind.</em></p>\n<p><em>He quickly discovered that every other floor was different. Some of the rooms were empty; some of them were full. He met many strange creatures along the way. Each of them taught him a new lesson and showed him a different view.</em></p>\n<p><em>Frederic sensed, as he went higher, that he was beginning to forget about the original room. He was pretty sure he wasn’t going to be able to find his way back there, ever again. Nevertheless, he continued to climb.</em></p>\n<p><em>Midway up, from the windows, he was able to see the tops of mountains, peopled by marvelous beings that he had never known to exist before. Higher up he saw a vast sea in the distance and he heard the water folk singing their strange, familiar songs.</em></p>\n<p><em>At the top, on the roof, when he finally got there, he was able to see it all. The view was entirely different. It was far more pleasing and far more abundant than he could have ever dreamed up. And, best of all, from here he could see the stars.</em></p>\n<p><em>It was on this rooftop that he chose to remain for the rest of his life. He liked it best. If someone wanted to see him, they would just have to come up and join him there. He decided he would never descend that stairwell ever again, not for anyone.</em></p>\n<p><em>This rooftop living went on for a very long time. He made many friends and a few foes. It was all great fun. But, one day, he saw a ladder that led to the stars. It hadn’t been there before, or had it? He couldn’t be sure. (He was very forgetful nowadays.) He guessed someone had placed it there, just for him, and so he chose to climb that ladder and, at a certain point, he vanished.</em></p>\n<p><em>But, what of his friends? They had been searching the mansion for hours now, with the obliging estate agent (who secretly wanted to sell the property.) Frederic’s loved ones were genuinely concerned for his safety&#8230; And, they missed him.</em></p>\n<p><em>Well, put simply, he wished they could see the view from here. They would understand why he had to climb that ladder, if they could only see it… Still, it didn’t matter… They would understand when the time came for them to see it too.</em></p>\n<img class=\"wp-image-1378 size-full\" src=\"http://heropress.com/wp-content/uploads/2016/10/1910555_583548434324_1306559_n.jpg\" alt=\"Family with a heart shaped chinese lantern.\" width=\"604\" height=\"453\" />Grandma Jess, Uncle Just and my sister Mads, releasing a lantern on New years eve 2013\n<p>(In loving memory of my grandmother Lady Jessica Urquhart.)</p>\n<div class=\"rtsocial-container rtsocial-container-align-right rtsocial-horizontal\"><div class=\"rtsocial-twitter-horizontal\"><div class=\"rtsocial-twitter-horizontal-button\"><a title=\"Tweet: The Bumpy Journey of Becoming\" class=\"rtsocial-twitter-button\" href=\"https://twitter.com/share?text=The%20Bumpy%20Journey%20of%20Becoming&via=heropress&url=http%3A%2F%2Fheropress.com%2Fessays%2Fbumpy-journey-becoming%2F\" rel=\"nofollow\" target=\"_blank\"></a></div></div><div class=\"rtsocial-fb-horizontal fb-light\"><div class=\"rtsocial-fb-horizontal-button\"><a title=\"Like: The Bumpy Journey of Becoming\" class=\"rtsocial-fb-button rtsocial-fb-like-light\" href=\"https://www.facebook.com/sharer.php?u=http%3A%2F%2Fheropress.com%2Fessays%2Fbumpy-journey-becoming%2F\" rel=\"nofollow\" target=\"_blank\"></a></div></div><div class=\"rtsocial-linkedin-horizontal\"><div class=\"rtsocial-linkedin-horizontal-button\"><a class=\"rtsocial-linkedin-button\" href=\"https://www.linkedin.com/shareArticle?mini=true&url=http%3A%2F%2Fheropress.com%2Fessays%2Fbumpy-journey-becoming%2F&title=The+Bumpy+Journey+of+Becoming\" rel=\"nofollow\" target=\"_blank\" title=\"Share: The Bumpy Journey of Becoming\"></a></div></div><div class=\"rtsocial-pinterest-horizontal\"><div class=\"rtsocial-pinterest-horizontal-button\"><a class=\"rtsocial-pinterest-button\" href=\"https://pinterest.com/pin/create/button/?url=http://heropress.com/essays/bumpy-journey-becoming/&media=http://heropress.com/wp-content/uploads/2016/10/100516-2-150x150.jpg&description=The Bumpy Journey of Becoming\" rel=\"nofollow\" target=\"_blank\" title=\"Pin: The Bumpy Journey of Becoming\"></a></div></div><a rel=\"nofollow\" class=\"perma-link\" href=\"http://heropress.com/essays/bumpy-journey-becoming/\" title=\"The Bumpy Journey of Becoming\"></a></div><p>The post <a rel=\"nofollow\" href=\"http://heropress.com/essays/bumpy-journey-becoming/\">The Bumpy Journey of Becoming</a> appeared first on <a rel=\"nofollow\" href=\"http://heropress.com\">HeroPress</a>.</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Wed, 05 Oct 2016 10:45:39 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Tamsin Taylor\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:9;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:98:\"WPTavern: WordPress 4.7 Will Allow Developers to Register Custom Bulk Actions in Admin List Tables\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:29:\"https://wptavern.com/?p=62132\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:109:\"https://wptavern.com/wordpress-4-7-will-allow-developers-to-register-custom-bulk-actions-in-admin-list-tables\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:2680:\"<a href=\"https://i2.wp.com/wptavern.com/wp-content/uploads/2014/03/bulk-install.jpg?ssl=1\"><img src=\"https://i2.wp.com/wptavern.com/wp-content/uploads/2014/03/bulk-install.jpg?resize=974%2C524&ssl=1\" alt=\"photo credit: -pdp- - cc\" class=\"size-full wp-image-19216\" /></a>photo credit: <a href=\"http://www.flickr.com/photos/51553705@N00/8191743/\">-pdp-</a> &#8211; <a href=\"http://creativecommons.org/licenses/by-nc-sa/2.0/\">cc</a>\n<p>WordPress 4.7 will allow for custom bulk actions in admin list tables, an exciting new feature for developers. List tables are found on various screens throughout the admin. Bulk actions are the dropdowns that let users perform actions such as activate or deactivate plugins in bulk, move multiple posts to the trash, and bulk delete media items.</p>\n<p>The ability for developers to filter bulk actions was introduced in 3.1 but it didn&#8217;t offer much flexibility. Up until 4.7, it only allowed for the removal of items from default bulk actions. The upcoming release will make it possible for developers to register new bulk actions for any admin list table dropdown, including the Attachments list table.</p>\n<a href=\"https://i2.wp.com/wptavern.com/wp-content/uploads/2016/10/custom-bulk-action-screenshot.png?ssl=1\"><img src=\"https://i2.wp.com/wptavern.com/wp-content/uploads/2016/10/custom-bulk-action-screenshot.png?resize=586%2C371&ssl=1\" alt=\"image credit: \" class=\"size-full wp-image-62148\" /></a>image credit: <a href=\"https://make.wordpress.org/core/2016/10/04/custom-bulk-actions/\">Eric Andrew Lewis</a>\n<p>Eric Andrew Lewis posted the <a href=\"https://make.wordpress.org/core/2016/10/04/custom-bulk-actions/\" target=\"_blank\">announcement</a> on the make.wordpress/core blog along with a sample code walkthrough of the steps required for adding a new option to the dropdown, handling a bulk action form submission, and displaying notices to inform users of what happened. The announcement was met with a round of cheers from developers who are delighted to make use of the new ability to register their own bulk actions.</p>\n<p>This small, yet important change resolves a six-year-old <a href=\"https://core.trac.wordpress.org/ticket/16031\" target=\"_blank\">ticket</a> and has the potential to impact many plugins. For example, the <a href=\"https://wordpress.org/plugins/custom-bulk-actions/\" target=\"_blank\">Custom Bulk Actions</a> plugin has been rendered obsolete, as core now provides a better standard. There are many other plugins that register bulk actions through a similar method or another type of hack, but WordPress 4.7 will offer an easier, core-supported way to accomplish this.</p>\n<div id=\"epoch-width-sniffer\"></div>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Tue, 04 Oct 2016 22:24:26 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Sarah Gooding\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:10;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:87:\"WPTavern: LoopConf Postponed Due to Hurricane Matthew, WordCamp Orlando is Questionable\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:29:\"https://wptavern.com/?p=62140\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:97:\"https://wptavern.com/loopconf-postponed-due-to-hurricane-matthew-wordcamp-orlando-is-questionable\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:2203:\"<p><a href=\"https://loopconf.com/\">LoopConf</a>, an event geared towards WordPress developers that was supposed to begin October 5th is<a href=\"https://loopconf.com/hurricane-matthew/\"> postponed</a> due to hurricane Matthew. In today&#8217;s <a href=\"http://www.nhc.noaa.gov/text/refresh/MIATCPAT4+shtml/041503.shtml\">11 AM update</a>, the National Hurricane Center issued a Hurricane Watch for Deerfield Beach to the Volusia/Brevard county line which is near the venue.</p>\n<p>LoopConf organizers are removing property and personnel from the area and cite safety as being the primary reason for postponing the event. Information on when it will be rescheduled will be published within the next week or two. Those who have reservations with hotels in the area need to cancel them on your own.</p>\n<p>I asked Ryan Sullivan, lead organizer for LoopConf, what the toughest part of making this decision is. He responded with no comment and emphasized that he&#8217;s occupied with logistics on trying to make sure everyone is safe.</p>\n<h2>WordCamp Orlando is Questionable</h2>\n<p><a href=\"https://2016.orlando.wordcamp.org/\">WordCamp Orlando</a> is scheduled to take place this weekend and is also near the projected path of Hurricane Matthew. <a href=\"https://2016.orlando.wordcamp.org/friday-schedule/\">Workshops</a> that are scheduled for Friday may be cancelled. Lisa Melegari, lead organizer for WordCamp Orlando, says cancelling the event depends on whether the venue has power.</p>\n<p>&#8220;Right now, we&#8217;re waiting on word from our venue as to their closure plans,&#8221; Melegari said. &#8220;It&#8217;s a university campus so we are anticipating Friday will be canceled. They told us that as long as they have power Saturday, we will still be able to hold the weekend sessions.&#8221;</p>\n<p>Melegari says she&#8217;ll likely have a definitive answer concerning Friday by the end of today. Speakers and attendees are encouraged to keep an eye on <a href=\"https://twitter.com/lmelegari\">Melegari&#8217;s Twitter account</a> and the official <a href=\"https://2016.orlando.wordcamp.org/\">WordCamp Orlando blog</a> for updates on this fluid situation.</p>\n<div id=\"epoch-width-sniffer\"></div>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Tue, 04 Oct 2016 18:10:05 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Jeff Chandler\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:11;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:77:\"WPTavern: Geek Mental Help Week 2016 Explores Issues Related to Tech Industry\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:29:\"https://wptavern.com/?p=61976\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:90:\"https://wptavern.com/geek-mental-health-week-2016-explores-issues-related-to-tech-industry\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:2057:\"<a href=\"https://i1.wp.com/wptavern.com/wp-content/uploads/2016/10/mental-health.jpg?ssl=1\"><img src=\"https://i1.wp.com/wptavern.com/wp-content/uploads/2016/10/mental-health.jpg?resize=960%2C495&ssl=1\" alt=\"photo credit: Ales Krivec\" class=\"size-full wp-image-62121\" /></a>photo credit: <a href=\"https://stocksnap.io/photo/LOJD881EX1\">Ales Krivec</a>\n<p>The third annual edition of <a href=\"http://geekmentalhelp.com\" target=\"_blank\">Geek Mental Help Week</a> kicked off yesterday. This week-long event will feature articles, podcasts, and other media addressing topics related to mental health issues in the tech industry. It is organized by a group of UK-based tech professionals but participation in the event is open to anyone in any location.</p>\n<p>The <a href=\"http://geekmentalhelp.com/#articles\" target=\"_blank\">articles</a> posted Monday address many common stressors experienced by those in tech-related professions, such as burnout, Imposter Syndrome, and keeping pace with a fast-moving industry. Contributors wrote frankly about their struggles with anxiety disorders, PTSD, grief, depersonalization disorder, and depression.</p>\n<p>In addition to raising awareness and support, the event is designed to foster conversations. That&#8217;s why Geek Mental Help Week doesn&#8217;t just include articles from people who have successfully navigated mental health issues but also features posts from those who are still figuring things out. This includes people who are learning how to live with others who have mental health issues.</p>\n<p>If you have something to contribute or want to join the conversation, the event&#8217;s website is hosted on GitHub pages. Pull requests with a link to an article, podcast episode, or helpful resource can be submitted to the <a href=\"https://github.com/malarkey/geek-mental-help-week\" target=\"_blank\">Geek Mental Help Week repository</a>. Follow <a href=\"https://twitter.com/geekmentalhelp\" target=\"_blank\">@geekmentalhelp</a> on Twitter for all the latest articles.</p>\n<div id=\"epoch-width-sniffer\"></div>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Tue, 04 Oct 2016 16:00:22 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Sarah Gooding\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:12;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:29:\"Matt: Back on Tim’s Podcast\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:22:\"https://ma.tt/?p=46841\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:43:\"https://ma.tt/2016/10/back-on-tims-podcast/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:471:\"<p>I went back for a <a href=\"http://fourhourworkweek.com/2016/10/01/matt-mullenweg-on-the-characteristics-and-practices-of-successful-entrepreneurs/\">Round 2 answering follow-up questions from Tim&#8217;s readers on the Tim Ferriss podcast</a>. About an hour long and covered a wide range of topics. One of these days I need to start podcasting more directly. In the meantime, please give it a listen! Already some great tweets and responses have started to come in.</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Tue, 04 Oct 2016 05:01:23 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:4:\"Matt\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:13;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:92:\"WPTavern: The Div Selected by Code.org to Help Expand Computer Science Education in Oklahoma\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:29:\"https://wptavern.com/?p=61986\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:103:\"https://wptavern.com/the-div-selected-by-code-org-to-help-expand-computer-science-education-in-oklahoma\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:3085:\"<p><a href=\"http://thediv.org/\">The Div</a>, a 501c3 nonprofit organization founded by Jay Chapman, Cory Miller, and Scott Day in Oklahoma, has been selected by <a href=\"http://thediv.org/2016/10/03/div-joins-code-org-professional-learning-partner/\">Code.org</a> to be a learning partner. The organization will help expand access to computer science education across the state by being the designated provider of Code.org educational programs.</p>\n<p>Thanks to funding provided by Code.org, The Div is offering development and course curriculum to local teachers and school districts at no cost to them.</p>\n<p>Curriculum and courses include, <a href=\"https://code.org/educate/csd\">Computer Science Discoveries</a> for grades 7-9 and <a href=\"https://code.org/educate/csp\">Computer Science Principles</a> for high school and AP students. There&#8217;s also a <a href=\"https://code.org/educate/curriculum/elementary-school\">Computer Science Fundamentals</a> course that teachers can implement in elementary school classrooms.</p>\n<p>Miller, founder of iThemes and board President of The Div, spoke in Washington DC last week at an event hosted by The White House Office of Science and Technology Policy. At the event, he discussed why businesses like iThemes are supporting and advocating for computer science education.</p>\n<p>I spoke with Miller and asked him what the partnership means to him on a personal level. &#8220;We started The Div 5 years ago to simply give back to our local community in meaningful ways,&#8221; Miller said.</p>\n<p>&#8220;By far the most impactful thing we&#8217;ve done, and now our primary focus, is teaching kids to code through our in-person workshops. When I see kids in those workshops learning and growing, then reading their feedback forms afterward, that’s all the validation we need that we’re achieving our mission and doing good here in Oklahoma.&#8221;</p>\n<p>Miller explains why the partnership with Code.org is instrumental to accomplishing the organization&#8217;s goals.</p>\n<p>&#8220;The partnership with <a href=\"https://code.org/\">Code.org</a> takes this simple vision to the next level with computer science education resources and connections to make an even greater exponential impact for kids as it is an in-school initiative where we equip schools to be able to offer computer science at a time when most schools don&#8217;t.&#8221;</p>\n<p>According to The Div, only 25 schools in the state of Oklahoma or 8% of schools with AP programs offered the AP computer science course in 2014-2015. Out of all STEM (science, technology, engineering, and mathematics) subject areas, computer science has the least amount of exams taken by students.</p>\n<p>Beginning January 2017, applications will open for teachers who want to learn a curriculum. Until then, educators are encouraged to keep an eye on the <a href=\"https://code.org/educate/csd\">Computer Science Discoveries</a> and the <a href=\"https://code.org/educate/csp\">AP Computer Science Principles</a> pages for updates.</p>\n<div id=\"epoch-width-sniffer\"></div>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Mon, 03 Oct 2016 22:13:01 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Jeff Chandler\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:14;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:109:\"WPTavern: State of JavaScript Survey Results Published, React Emerges as Clear Winner in Front-End Frameworks\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:29:\"https://wptavern.com/?p=61973\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:119:\"https://wptavern.com/state-of-javascript-survey-results-published-react-emerges-as-clear-winner-in-front-end-frameworks\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:4363:\"<p><a href=\"https://i0.wp.com/wptavern.com/wp-content/uploads/2016/10/state-of-javascript-2016.png?ssl=1\"><img src=\"https://i0.wp.com/wptavern.com/wp-content/uploads/2016/10/state-of-javascript-2016.png?resize=1025%2C556&ssl=1\" alt=\"state-of-javascript-2016\" class=\"aligncenter size-full wp-image-62071\" /></a></p>\n<p>The results from Sacha Greif&#8217;s &#8220;State of JavaScript&#8221; survey were <a href=\"http://stateofjs.com/2016/introduction/\" target=\"_blank\">published</a> today. Greif, who is co-author of <a href=\"http://discovermeteor.com/\" target=\"_blank\">Discover Meteor</a> and the creator of <a href=\"http://telescopeapp.org/\" target=\"_blank\">Telescope</a>, began his journey in modern JavaScript development a year ago with a beginner&#8217;s course in React but was overwhelmed with the many options for extending his knowledge into other frameworks. He launched the 89-question <a href=\"http://stateofjs.com/\" target=\"_blank\">State of JavaScript</a> survey to get a better picture of ecosystem and was surprised to receive more than 9,300 responses.</p>\n<p>Instead of analyzing all the results himself, Greif enlisted the help of experts for each topic to give the results a more informed, well-rounded presentation. The survey covers front-end, full-stack, mobile and testing frameworks, build tools, developer profiles, and much more.</p>\n<p>React won out in terms of developer satisfaction for <a href=\"http://stateofjs.com/2016/frontend/\" target=\"_blank\">front-end frameworks</a> at 92%, closely followed by Vue.js (89%). Redux is the most popular tool for state management by a wide margin.</p>\n<p><a href=\"https://i1.wp.com/wptavern.com/wp-content/uploads/2016/10/state-of-javascript-survey-frontend-framework-satisfaction.png?ssl=1\"><img src=\"https://i1.wp.com/wptavern.com/wp-content/uploads/2016/10/state-of-javascript-survey-frontend-framework-satisfaction.png?resize=1025%2C904&ssl=1\" alt=\"state-of-javascript-survey-frontend-framework-satisfaction\" class=\"aligncenter size-full wp-image-62065\" /></a></p>\n<p>In breaking down <a href=\"http://stateofjs.com/2016/api/\" target=\"_blank\">API layers</a>, REST APIs dominate the landscape with 79% of developers who have used them before being willing to use them again. Firebase comes in much further behind at 18%, followed by GraphQL at 5%.</p>\n<p>Greif&#8217;s questions regarding build tools show that Webpack and Gulp are used roughly twice as much as Grunt and Browserify. Grunt, however, has a high dissatisfaction rate with 42% of those who have used it before indicating they would not use it again.</p>\n<p>The State of JavaScript survey results are packed full of insights for those who are currently working in the industry or looking to begin their JavaScript education. Conclusions from the <a href=\"http://stateofjs.com/2016/opinions/\" target=\"_blank\">opinions section</a> of the results are not surprising: a majority of developers think building JavaScript apps is overly complex right now and the ecosystem is changing too fast.</p>\n<p>&#8220;If one thing has become clear to me, it’s that the growing pains that JavaScript is going through right now are only the beginning,&#8221; Greif said. &#8220;While React has barely emerged as the victor of the Front-End Wars of 2015, some developers are already decrying React for not being functional enough, and embracing Elm or ClojureScript instead.&#8221;</p>\n<p>As the WordPress development community moves towards incorporating more JavaScript and API-driven interfaces into projects, React has so far been the framework of choice. It powers some of the most visible applications and plugin interfaces, including <a href=\"https://wptavern.com/early-reviews-show-applications-like-calypso-are-the-future-of-wordpress\" target=\"_blank\">Calypso</a> (WordPress.com&#8217;s publishing interface) and the <a href=\"https://wptavern.com/jetpack-4-3-released-features-new-react-js-powered-admin-interface\" target=\"_blank\">Jetpack admin</a>.</p>\n<p>Greif plans on offering the survey again next year, which may reveal major changes in the most used technologies, given how fast the JavaScript ecosystem is changing. <a href=\"http://sachagreif.us2.list-manage2.com/subscribe?u=b5af47765edbd2fc173dbf27a&id=d8282e7e96\" target=\"_blank\">Sign up</a> to be notified when he opens it again in 2017.</p>\n<div id=\"epoch-width-sniffer\"></div>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Mon, 03 Oct 2016 21:05:34 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Sarah Gooding\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:15;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:68:\"WPTavern: digitale Pracht: A Minimalist Blogging Theme for WordPress\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:29:\"https://wptavern.com/?p=61840\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:78:\"https://wptavern.com/digitale-pracht-a-minimalist-blogging-theme-for-wordpress\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:3882:\"<p><a href=\"https://wordpress.org/themes/digitale-pracht/\" target=\"_blank\">digitale Pracht</a> is a new theme on WordPress.org created by the folks at <a href=\"https://palasthotel.de/\" target=\"_blank\">PALASTHOTEL</a>, a digital products company based in Germany. The name translates to &#8220;digital splendor,&#8221; which aptly describes the theme&#8217;s bright new twist on the traditional blog design.</p>\n<p>The designers made a few bold choices with the layout, which does not support a top menu or include a sidebar. digitale Pracht&#8217;s liberal use of white space puts the content in focus and also highlights the typography selections. <a href=\"https://fonts.google.com/specimen/Lora\">Lora</a> and <a href=\"https://fonts.google.com/specimen/Lato\" target=\"_blank\">Lato</a>, a set of light, contemporary Google fonts, are used for the header and paragraph text.</p>\n<p>This minimalist theme has just enough color and character to avoid looking stark. digitale Pracht&#8217;s golden yellow accent color is used for separator lines, buttons, and headers that are links. It&#8217;s also used for the reading indicator, a unique feature of the theme that displays a visual marker on the side of the viewport as the reader scrolls.</p>\n<p><a href=\"https://i1.wp.com/wptavern.com/wp-content/uploads/2016/09/digitale-pracht.png?ssl=1\"><img src=\"https://i1.wp.com/wptavern.com/wp-content/uploads/2016/09/digitale-pracht.png?resize=1025%2C769&ssl=1\" alt=\"digitale-pracht\" class=\"aligncenter size-full wp-image-61956\" /></a></p>\n<p>PALASTHOTEL&#8217;s company blog currently uses the theme and provides the nice <a href=\"http://digitale-pracht.de/\" target=\"_blank\">live demo</a> of digitale Pracht in action.</p>\n<p>The customizer is lean on settings for this theme, but that also means it&#8217;s more similar to the demo upon activation. Users can easily change the highlight color using the customizer and can also enable a small sharing button for posts that appears at the bottom right corner of the page when scrolling.</p>\n<p><a href=\"https://i1.wp.com/wptavern.com/wp-content/uploads/2016/09/digitale-pracht-single-post.png?ssl=1\"><img src=\"https://i1.wp.com/wptavern.com/wp-content/uploads/2016/09/digitale-pracht-single-post.png?resize=1025%2C854&ssl=1\" alt=\"digitale-pracht-single-post\" class=\"aligncenter size-full wp-image-61962\" /></a></p>\n<p>A related articles section is displayed beneath single posts in the same style as the posts on the homepage. The theme uses square featured images in the archives and they are also displayed overhanging the right column at the top of single posts. Square featured images make it relatively easy to activate this theme and have it look decent no matter what the shape or size of images used in the previous theme used.</p>\n<p><a href=\"https://i0.wp.com/wptavern.com/wp-content/uploads/2016/09/digitale-pracht-related-posts.png?ssl=1\"><img src=\"https://i0.wp.com/wptavern.com/wp-content/uploads/2016/09/digitale-pracht-related-posts.png?resize=1025%2C708&ssl=1\" alt=\"digitale-pracht-related-posts\" class=\"aligncenter size-full wp-image-61963\" /></a></p>\n<p>digitale Pracht includes support for PALASTHOTEL&#8217;s free <a href=\"https://wordpress.org/plugins/grid\" target=\"_blank\">Grid plugin</a> that allows users to create custom landing pages with containers and content boxes. This approach makes it possible to add pages with business or portfolio type content.</p>\n<p>If you like minimalist design and don&#8217;t want a load of settings to configure when setting a theme, <a href=\"https://wordpress.org/themes/digitale-pracht/\" target=\"_blank\">digitale Pracht</a> might be a good choice for your blog. Previewing the theme on WordPress.org doesn&#8217;t do it justice but using the live preview inside the WordPress admin offers a decent look at how it will display on your site.</p>\n<div id=\"epoch-width-sniffer\"></div>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Mon, 03 Oct 2016 04:52:17 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Sarah Gooding\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:16;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:44:\"WPTavern: In Case You Missed It – Issue 16\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:29:\"https://wptavern.com/?p=61906\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:51:\"https://wptavern.com/in-case-you-missed-it-issue-16\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:9020:\"<p><a href=\"https://i2.wp.com/wptavern.com/wp-content/uploads/2016/01/ICYMIFeaturedImage.png?ssl=1\" rel=\"attachment wp-att-50955\"><img class=\"size-full wp-image-50955\" src=\"https://i2.wp.com/wptavern.com/wp-content/uploads/2016/01/ICYMIFeaturedImage.png?resize=676%2C292&ssl=1\" alt=\"In Case You Missed It Featured Image\" /></a>photo credit: <a href=\"http://www.flickr.com/photos/112901923@N07/16153818039\">Night Moves</a> &#8211; <a href=\"https://creativecommons.org/licenses/by-nc/2.0/\">(license)</a>There’s a lot of great WordPress content published in the community but not all of it is featured on the Tavern. This post is an assortment of items related to WordPress that caught my eye but didn’t make it into a full post.</p>\n<h2>Four Great How-to Videos From Bob Dunn</h2>\n<p>Bob Dunn, founder of <a href=\"https://bobwp.com\">BobWP.com</a>, has <a href=\"https://bobwp.com/starting-wordpress-watch-four-videos/\">published four videos</a> that explain how to solve common pain points experienced by users.</p>\n<ul>\n<li>How To Get Rid of the Blog That is Showing On Your WordPress Sites Homepage</li>\n<li>How To Create Two WordPress Blogs On a Single WordPress Site</li>\n<li>How To Make Sense of Your WordPress Reading Settings</li>\n<li>How To Add Formatted HTML to the Text Widget Without Knowing HTML</li>\n</ul>\n<p>Dunn has years of experience teaching WordPress and it shows in these videos.</p>\n<div class=\"embed-wrap\"></div>\n<h2 class=\"selectionShareable\">Matt Mullenweg Appears on Fortune&#8217;s 40 Under 40 List</h2>\n<p>Since Matt Mullenweg is now in his 30s, he&#8217;s graduated to the <a href=\"http://fortune.com/40-under-40/matt-mullenweg-20/\">40 Under 40</a> list put together by <a href=\"http://fortune.com/\">Fortune</a>. He also <a href=\"http://www.heinzawards.net/recipients/matthew-mullenweg\">received the Heinz Award</a> in the Technology, Economy, and Employment category. The Heinz award is given to individuals who make significant contributions to the areas of Arts and Humanities, Environment, Human Condition, Public Policy, Technology, Economy and Employment. Mullenweg was also recently <a href=\"http://www.houstonchronicle.com/local/history/innovators-inventions/article/Wordpress-founder-finds-inspiration-in-his-9403035.php?t=cf1ab658da438d9cbb\">profiled in the Houston Chronicle</a> by Anita Hassan.</p>\n<p>In the article, David Caceres, one of Mullenweg&#8217;s music teachers is quoted as saying, &#8220;All the success hasn&#8217;t seemed to have affected him at all. You might just see him driving a fancier car.&#8221;</p>\n<p>This quote sticks out to me because it&#8217;s true based on my experience. He doesn&#8217;t have bodyguards, is incredibly approachable at events, and is the opposite of everything rich celebrities are. I continue to be impressed by how humble and down-to-earth he is.</p>\n<h2>Leland Fiegel Debunks GPL Myths</h2>\n<p>Leland Fiegel, founder of <a href=\"https://themetry.com\">Themetry</a>, debunks at least <a href=\"https://leland.me/gpl-myths/\">a dozen myths</a> around the GPL including, redistribution of paid for code, what customers are buying when they purchase GPL licensed products, and providing free copies of code upon request. If you&#8217;re thinking about entering the WordPress product space, consider this advice.</p>\n<blockquote><p>If you’re a developer of paid GPL code and imagine you’d be upset if somebody resold or gave away your code for free, you may want to reconsider releasing under the GPL at all.</p>\n<p>Or better yet, focus on building such a rock-solid brand that any code redistribution would have an inconsequential effect on your business.</p></blockquote>\n<p>While his post does a great job covering common misconceptions, I encourage anyone doing business in the WordPress space to read and familiarize yourself with the <a href=\"https://www.gnu.org/licenses/old-licenses/gpl-2.0.en.html\">GPL v2 license </a>itself.</p>\n<h2>Changes to the Customize Sliding Panels/Sections in WordPress 4.7</h2>\n<p>The WordPress development team is requesting that developers test important changes that have been made to the sliding panels and sections of the customizer. The description is technical in nature but the changes allow the removal of margin-top hacks by separating the root &#8216;panel&#8217; of the customizer from the container elements for the sections they link to. Developers are encouraged to review Trac ticket <a href=\"https://core.trac.wordpress.org/ticket/34391\">#34391</a> for more details.</p>\n<blockquote class=\"wp-embedded-content\"><p><a href=\"https://make.wordpress.org/core/2016/09/28/changes-to-customizer-sliding-panelssections-in-wordpress-4-7/\">Changes to Customizer Sliding Panels/Sections in WordPress 4.7</a></p></blockquote>\n<p></p>\n<h2>WP101 Turns 8 Years Old</h2>\n<p><a href=\"https://www.wp101.com/\">WP101</a>, founded by Shawn Hesketh, has <a href=\"https://www.wp101.com/wp101-8-years/\">turned eight years old</a>. This year, Hesketh celebrates the milestone by thanking eight important people that include license partners and customers.</p>\n<blockquote><p>There are many others who have contributed to WP101’s success over the years, to say nothing of the countless friendships Kay and I have made over the years, thanks to the WordPress community. We are who we are today because of <strong>YOU</strong>.</p>\n<p>We’re humbled and grateful, and look forward to celebrating many, many years to come!</p></blockquote>\n<p>Happy birthday to WP101!</p>\n<h2>0-$4,000 in Monthly Revenue in 10 Months</h2>\n<p>Over on the Cozmoslabs blog, <span class=\"byline\"><span class=\"author vcard\">Adrian Spiac <a href=\"https://www.cozmoslabs.com/53386-lessons-learned-launching-free-membership-plugin/\">published the lessons</a> they&#8217;ve learned since launching the Paid Member Subscriptions plugin. The article includes the ups and downs experienced, challenges faced, and tough decisions that were made. </span></span></p>\n<h2>W3 Total Cache 0.9.5.1 Released</h2>\n<p>Hot on the heels of <a href=\"https://wptavern.com/w3-total-cache-0-9-5-packages-xss-vulnerability-patch-with-major-update\">W3 Total Cache 0.9.5</a> released earlier this week, Frederick Townes has <a href=\"https://www.w3-edge.com/weblog/2016/09/w3-total-cache-v0-9-5-1/\">released 0.9.5.1</a> to address plugin incompatibilities. According to <a href=\"https://wordpress.org/plugins/w3-total-cache/changelog/\">the changelog</a>, Yoast SEO and Jetpack are among the plugins addressed. The new version also improves backwards compatibility for third-party implementations using legacy W3TC functions.</p>\n<h2>Major Changes in Store for FooPlugins</h2>\n<p>Adam Warner, co-founder of <a href=\"http://fooplugins.com/\">FooPlugins</a>, published an <a href=\"http://fooplugins.com/the-challenges-of-growing-a-plugin-business-and-what-were-doing-about-it/?utm_content=bufferc8b0b&utm_medium=social&utm_source=twitter.com&utm_campaign=buffer\">in-depth article</a> on the challenges associated with growing a plugin business and what his team is doing to overcome them. The article covers what the team has done right, wrong, and lists significant changes it&#8217;s making, including retiring unpopular plugins. Perhaps the most important part of the post however, is the promise made by Warner to current and future users.</p>\n<blockquote><p>My intention with this post is not to make anyone nervous about the future of our plugins. It’s quite the opposite.</p>\n<p>I hope by sharing these insights that our intentions are clear. We are committed to the future of our brand, our products, and their features (both free and pro), and most of all, you.</p>\n<p>We plan to be around for years to come. And to keep learning and pivoting as necessary to make certain that happens.</p>\n<p>Lastly, for the 400,000+ combined users of all our all publicly available plugins, we thank you for your support thus far and hope we can count on you to keep teaching us how to continue our success.</p></blockquote>\n<h2>Swag Wapuu!</h2>\n<p>In what is a traditional part of this series, I end each issue by featuring a Wapuu design. For those who don&#8217;t know, Wapuu is the <a href=\"http://wapuu.jp/2015/12/12/wapuu-origins/\">unofficial mascot</a> of the WordPress project.</p>\n<p>Swag Wapuu is making the rounds and its next stop is <a href=\"http://2016.orlando.wordcamp.org/\">WordCamp Orlando</a>, FL, October 7-9. Swag Wapuu loves wearing conference shirts and free swag but hates wearing pants. Below is a preview of one of the shirt designs that will be given out as swag at the event.</p>\n<p><a href=\"https://i2.wp.com/wptavern.com/wp-content/uploads/2016/09/SwagWapuu2.png?ssl=1\"><img class=\"size-full wp-image-61926\" src=\"https://i2.wp.com/wptavern.com/wp-content/uploads/2016/09/SwagWapuu2.png?resize=808%2C541&ssl=1\" alt=\"Swag Wapuu!\" /></a>Swag Wapuu!That&#8217;s it for issue sixteen. If you recently discovered a cool resource or post related to WordPress, please share it with us in the comments.</p>\n<div id=\"epoch-width-sniffer\"></div>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Fri, 30 Sep 2016 22:51:22 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Jeff Chandler\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:17;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:79:\"WPTavern: Pippin Williamson Shakes Up Page Builder Plugins with Critical Review\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:29:\"https://wptavern.com/?p=61819\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:90:\"https://wptavern.com/pippin-williamson-shakes-up-page-builder-plugins-with-critical-review\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:11150:\"<a href=\"https://i1.wp.com/wptavern.com/wp-content/uploads/2016/09/building-blocks.jpg?ssl=1\"><img src=\"https://i1.wp.com/wptavern.com/wp-content/uploads/2016/09/building-blocks.jpg?resize=1024%2C522&ssl=1\" alt=\"photo credit: ruudgreven DSC_0012 - (license)\" class=\"size-full wp-image-61914\" /></a>photo credit: ruudgreven <a href=\"http://www.flickr.com/photos/40811229@N07/6180817922\">DSC_0012</a> &#8211; <a href=\"https://creativecommons.org/licenses/by-nc-sa/2.0/\">(license)</a>\n<p>Pippin Williamson has published a comprehensive <a href=\"https://pippinsplugins.com/wordpress-page-builder-plugins-critical-review/\" target=\"_blank\">review of some of the most popular WordPress page builder plugins</a>. The post has received more than 90 comments and is already inspiring changes across the page builder plugin market. Williamson, a prolific plugin developer and mentor to many others, is one of the most authoritative voices in the community on the topic of plugins, which has caused this post to be well-received.</p>\n<p>The idea started with a Twitter rant where Williamson collectively slammed popular page builder plugins for their &#8220;subpar user experiences&#8221; and compatibility problems they cause for other plugins. After realizing he had never truly used any of these plugins, he decided it would only be fair to try them and give a full review.</p>\n<blockquote class=\"twitter-tweet\"><p lang=\"en\" dir=\"ltr\">I’m sorry is this hurts anyone feelings, but seriously, all of the majorly popular page builders for <a href=\"https://twitter.com/hashtag/WordPress?src=hash\">#WordPress</a> are terrible.</p>\n<p>&mdash; Pippinsplugins (@pippinsplugins) <a href=\"https://twitter.com/pippinsplugins/status/776169605299597314\">September 14, 2016</a></p></blockquote>\n<p></p>\n<p>Williamson&#8217;s review is written from the perspective of a developer who supports a large number of plugins and routinely deals with plugin conflicts caused by page builder plugins.</p>\n<p>&#8220;The page builder ecosystem is a wild west right now and is in a gold rush,&#8221; Williamson said. &#8220;A lot of different players are building their own versions and many are reaping good rewards for their efforts&#8230;What the page builder industry is severely lacking is standardization.&#8221;</p>\n<p>Williamson compared the current state of the page builder ecosystem to that of the commercial themes industry a few years ago before theme developers agreed on the standards that now guide their products. His critical review examines each plugin&#8217;s usability, UI, content &#8220;lock in,&#8221; and whether the plugin interferes with filters, such as the_content, that might cause incompatibility with other plugins.</p>\n<h3>Page Builder Plugin Authors Are Responding with Updates to their Plugins</h3>\n<p>Many of the plugin authors whose page builders were included in the review were quick to respond and are already working on changes based on Williamson&#8217;s feedback.</p>\n<p>I spoke with Ben Pines, CMO at <a href=\"https://elementor.com/\" target=\"_blank\">Elementor</a>, a newer page builder <a href=\"https://wordpress.org/plugins/elementor/\" target=\"_blank\">plugin</a> included in the 13 reviewed. After just three months on WordPress.org, Elementor is <a href=\"https://elementor.com/our-journey-from-0-to-10k-active-users-in-under-3-months/\" target=\"_blank\">active on more than 10,000 WordPress sites</a>. The plugin&#8217;s contributors continue to add new features to the free version and Pines said they hope to release a commercial version in the next two months.</p>\n<p>&#8220;We release new features and bug fixes on a weekly basis, based on our user feedback, so of course we take Pippin&#8217;s feedback seriously,&#8221; Pines said. &#8220;We have addressed the only two issues he critiqued us about, and will release an update next week that will address how shortcodes and widgets load scripts on Elementor.&#8221;</p>\n<p><a href=\"https://www.brixbuilder.com/\" target=\"_blank\">Brix Builder</a>, a GPL-licensed commercial plugin, was criticized in the review for major compatibility issues: restricting other plugins&#8217; ability to utilize <a href=\"https://codex.wordpress.org/Plugin_API/Filter_Reference/the_content\" target=\"_blank\">the_content</a> filter and shortcode enclosures not working across builder elements. Apart from these and a few other issues with the plugin&#8217;s UI, Williamson ranked the plugin near the top of the list in terms of usability.</p>\n<p>Brix co-creator Simone Maranzana was quick to respond in the comments that their team has already fixed some of the issues Williamson pointed out and they are working on the others.</p>\n<p>&#8220;Concerning the other issues you mentioned, we are going to release an update to our plugin tomorrow that will add support for shortcode enclosures,&#8221; Maranzana said.</p>\n<p>&#8220;Also, we’ve corrected how we hook into the_content for display: this way, other plugins will be able to hook either before or after the content generated by Brix, just like they’d do normally.&#8221;</p>\n<p>I spoke with Matt Medeiros, whose <a href=\"https://conductorplugin.com/\" target=\"_blank\">Conductor</a> plugin was included among the page builders Williamson reviewed. He said his team has never considered Conductor to be a page builder similar to others on the list, as the plugin focuses on giving users control over their content displays without framing a fully-designed layout.</p>\n<p>&#8220;We wanted customers to easily stack types of content, display custom fields, and drag-and-drop blocks of that content around a page, not design a layout,&#8221; Medeiros said. &#8220;Since we launched we’ve had over 500 customers using it, and Pippin&#8217;s findings are something we’ve always struggled with — finding people who want to shape their content displays, but not buy a full page builder.&#8221;</p>\n<p>Medeiros said his team will be acting on this feedback in the coming months with the launch of a new website that better communicates the purpose of the plugin, differentiating it from more traditional page builders. They are also working on making their flagship Baton theme support Beaver Builder layouts, as Medeiros said they do not intend to compete in the page builder space.</p>\n<p><a href=\"https://www.wpbeaverbuilder.com/\" target=\"_blank\">Beaver Builder</a>, one of the most popular plugins reviewed, does not support multisite in its standard license, something Williamson only discovered after installing it.</p>\n<p>&#8220;I’m entirely fine with limiting the number of domains the plugin is activated on but this limitation should not affect my ability to use a core WordPress feature,&#8221; Williamson said.</p>\n<p>Robby McCullough, co-founder of Beaver Builder, was quick to respond to the feedback on the multisite settings and said the team will reconsider its decision to restrict the feature.</p>\n<p><a href=\"https://wordpress.org/plugins/page-builder-sandwich/\" target=\"_blank\">Page Builder Sandwich</a>, a commercial plugin that has a free version on WordPress.org with more than 6,000 active installs, was criticized in Williamson&#8217;s review for the &#8220;rainbow of unnecessary colors&#8221; used in its interface. This issue plus a few editor glitches prevented the plugin from being listed among his favorites.</p>\n<p>Benjamin Intal, the plugin&#8217;s creator, said that his team is working on toning down the colors used in the interface so that it&#8217;s not such a jarring experience.</p>\n<p>&#8220;I agree with you regarding the interface, it does need some toning down,&#8221; Intal said. &#8220;We’ve been rethinking the interface for the past couple of weeks on how we can improve the user experience. We are revamping it, and the colors are now being adjusted to be more subtle.&#8221;</p>\n<h3>Williamson Finds 3 Page Builder Plugins Worthy of Recommendation</h3>\n<p>Williamson concluded the review by selecting three favorites, which he said he could happily recommend to his customers: <a href=\"https://wordpress.org/plugins/tailor/\" target=\"_blank\">Tailor</a>, <a href=\"https://wordpress.org/plugins/pootle-page-builder/\" target=\"_blank\">Pootle Page Builder</a>, and <a href=\"https://wordpress.org/plugins/beaver-builder-lite-version/\" target=\"_blank\">Beaver Builder</a>. As he is not an affiliate with any of the plugins and has stated multiple times that he has no interest in creating his own page builder, his selections were based solely on the criteria he identified before testing.</p>\n<p>One important aspect of the plugins Williamson did not take into account was licensing, which he said was &#8220;not relevant for the review or the vast majority of end users.&#8221; The license may not be something users care about but it certainly can impact their ability to fork the plugin or improve upon it if the company abandons it or goes out of business.</p>\n<p>I spoke with Luke Beck, founder of <a href=\"https://theme-fusion.com/\" target=\"_blank\">ThemeFusion</a>, which packages its <a href=\"http://avada.theme-fusion.com/fusion-builder-2/\" target=\"_blank\">Fusion Builder</a> plugin with <a href=\"https://themeforest.net/item/avada-responsive-multipurpose-theme/2833226\" target=\"_blank\">Avada</a>, one of the most widely used WordPress themes. His team was not immediately available to answer questions pertaining to the review, although we will update if we receive comments from them.</p>\n<p>Beck was hesitant to answer whether Fusion Builder is 100% GPL and directed me to ThemeForest, which lists Avada as split GPL. Avada&#8217;s creators also <a href=\"https://theme-fusion.com/avada-multisite-setup/#comment-2829\" target=\"_blank\">require users to purchase multiple licenses</a> when using the theme on WordPress multisite. Visual Composer, another plugin included in the review, shares the same kind of split licensing. It only offers the PHP under GPL, restricting the Javascript, CSS, and images. Putting part of the product under a proprietary license severely restricts users&#8217; freedoms and should be disclosed as part of any future reviews.</p>\n<p>All three plugins that won out are 100% GPL and two out of the three have fewer than 4,000 active installs. This demonstrates that high quality WordPress plugins may not always be widely known and the size of the user base is not always an indication of the plugin&#8217;s code quality.</p>\n<p>After receiving several comments about other page builder plugins not included in the review, Williamson said he may try to do a second set of reviews. Despite not being especially fond of these types of plugins, he recognizes the demand for page builders and their usefulness to the community.</p>\n<p>Williamson&#8217;s critical review is a powerful example of the change that can be precipitated by one highly-regarded expert offering constructive, unbiased feedback to plugins that fall into a particular niche. Hopefully this and any future reviews will be the first cracks in the ice towards accelerating standardization of the disparate products in WordPress&#8217; page builder ecosystem.</p>\n<div id=\"epoch-width-sniffer\"></div>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Fri, 30 Sep 2016 21:49:48 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Sarah Gooding\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:18;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:24:\"Matt: Happy Birthday Om!\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:22:\"https://ma.tt/?p=46789\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:40:\"https://ma.tt/2016/09/happy-birthday-om/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:3384:\"<p>Today the legendary <a href=\"http://om.co/\">Om Malik</a> celebrates his 50th time around the sun. For many that know him, Om defies definition: He&#8217;s first a writer, and finally always a true friend, but in between he&#8217;s an investor, photographer, oenophile, closet Bollywood fan, critical thinker, and sartorialist. He&#8217;s also been my friend and confidant for over a decade now, and I cannot wait to see what his next 50 years bring for him and the world.</p>\n<p>Here&#8217;s some snaps of Om over the years, from 2008 to just a few weeks ago when he was blonde for a few days. Happy birthday, buddy. <img src=\"https://s.w.org/images/core/emoji/2.2.1/72x72/1f600.png\" alt=\"?\" class=\"wp-smiley\" /></p>\n<p><img class=\"alignnone size-full wp-image-46807\" src=\"https://i0.wp.com/ma.tt/files/2016/09/MAT_2822.jpg?resize=604%2C402&ssl=1\" alt=\"MAT_2822\" /><img class=\"alignnone size-full wp-image-46808\" src=\"https://i0.wp.com/ma.tt/files/2016/09/MAT_3038.jpg?resize=604%2C402&ssl=1\" alt=\"MAT_3038\" /><img class=\"alignnone size-full wp-image-46809\" src=\"https://i1.wp.com/ma.tt/files/2016/09/MCM_5436.jpg?resize=604%2C402&ssl=1\" alt=\"MCM_5436\" /><img class=\"alignnone size-full wp-image-46806\" src=\"https://i1.wp.com/ma.tt/files/2016/09/MCM_9460.jpg?resize=604%2C402&ssl=1\" alt=\"MCM_9460\" /><img class=\"alignnone size-full wp-image-46804\" src=\"https://i2.wp.com/ma.tt/files/2016/09/IMG_4856.jpg?resize=604%2C453&ssl=1\" alt=\"IMG_4856\" /><img class=\"alignnone size-full wp-image-46805\" src=\"https://i0.wp.com/ma.tt/files/2016/09/MCM_5807.jpg?resize=604%2C402&ssl=1\" alt=\"MCM_5807\" /><img class=\"alignnone size-full wp-image-46801\" src=\"https://i1.wp.com/ma.tt/files/2016/09/FullSizeRender.jpg?resize=604%2C402&ssl=1\" alt=\"FullSizeRender\" /><img class=\"alignnone size-full wp-image-46802\" src=\"https://i2.wp.com/ma.tt/files/2016/09/IMG_8178.jpg?resize=604%2C453&ssl=1\" alt=\"IMG_8178\" /><img class=\"alignnone size-full wp-image-46803\" src=\"https://i0.wp.com/ma.tt/files/2016/09/IMG_9322.jpg?resize=604%2C453&ssl=1\" alt=\"IMG_9322\" /><img class=\"alignnone size-full wp-image-46800\" src=\"https://i0.wp.com/ma.tt/files/2016/09/IMG_2343.jpg?resize=604%2C453&ssl=1\" alt=\"IMG_2343\" /><img class=\"alignnone size-full wp-image-46796\" src=\"https://i0.wp.com/ma.tt/files/2016/09/IMG_4620.jpg?resize=604%2C453&ssl=1\" alt=\"IMG_4620\" /><img class=\"alignnone size-full wp-image-46798\" src=\"https://i2.wp.com/ma.tt/files/2016/09/IMG_9092.jpg?resize=604%2C453&ssl=1\" alt=\"IMG_9092\" /><img class=\"alignnone size-full wp-image-46799\" src=\"https://i2.wp.com/ma.tt/files/2016/09/IMG_9214.jpg?resize=604%2C453&ssl=1\" alt=\"IMG_9214\" /><img class=\"alignnone size-full wp-image-46793\" src=\"https://i0.wp.com/ma.tt/files/2016/09/IMG_1076.jpg?resize=604%2C453&ssl=1\" alt=\"OLYMPUS DIGITAL CAMERA\" /><img class=\"alignnone size-full wp-image-46810\" src=\"https://i1.wp.com/ma.tt/files/2016/09/IMG_2852-1.jpg?resize=604%2C453&ssl=1\" alt=\"IMG_2852\" /><img class=\"alignnone size-full wp-image-46795\" src=\"https://i1.wp.com/ma.tt/files/2016/09/IMG_4566.jpg?resize=604%2C453&ssl=1\" alt=\"IMG_4566\" /><img class=\"alignnone size-full wp-image-46792\" src=\"https://i0.wp.com/ma.tt/files/2016/09/IMG_8461.jpg?resize=604%2C403&ssl=1\" alt=\"Shot with DXO ONE Camera\" /><img class=\"alignnone size-full wp-image-46797\" src=\"https://i2.wp.com/ma.tt/files/2016/09/MCM_0056.jpg?resize=604%2C403&ssl=1\" alt=\"MCM_0056\" /></p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Thu, 29 Sep 2016 23:09:51 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:4:\"Matt\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:19;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:18:\"HeroPress: Rebirth\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:55:\"http://heropress.com/?post_type=heropress-essays&p=1358\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:36:\"http://heropress.com/essays/rebirth/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:7053:\"<img width=\"960\" height=\"480\" src=\"http://heropress.com/wp-content/uploads/2016/09/092816-vladimir_petkov-1024x512.jpg\" class=\"attachment-large size-large wp-post-image\" alt=\"Pull Quote: I started translating WordPress so that my seven-year-old daughter can share her personal stories.\" /><p>I started working with the web 16 years ago (yes, I am that old) because I wanted to make a web page of my IRC channel. IRC was my new hobby and every respectable channel had a site with a list of its members, photos and some texts. I have always had hobbies which arise, light a spark in me, I devote myself to them for a couple of months and in a year I turn to something else. I have always felt changed after that. My hobbies arise out of some personal ambition that excites me so much that captures all my free time and thoughts.</p>\n<p>My “Web” hobby came after my “IRC” hobby and devoting myself to it I started to maintain an ezine with more than 400 static html publications. I remember that I worked on it 3-4 hours every day, changing its design, adding articles, images, talking to people. I guess now you all expect me to tell you how I discovered WordPress and all my troubles disappeared. No, this is not my story for two reasons &#8211; 1) WordPress did not exist at the time and 2) when you do something you love, it is not a burden. And I really loved online communities, experimenting with digital journalism and that filled me with extraordinary energy.</p>\n<p>My WordPress story starts when I wanted to make that ezine more democratic by adding a section that was much more informal and written by the users. The blog had to be something like a filter on various topics and contained 9 sub-blogs in which everyone could publish interesting links with a short commentary about movies, music, cyber culture etc. I needed a CMS and that’s how I found… b2 (cafelog.com) which allowed a number of users to publish without problems and its design was simple enough so that it could be changed to be in line with the one of our ezine. We installed it and set it up for one night.</p>\n<p>Now we will speed up the story. The blog of my ezine was a success, blogs as a trend were a global success and little by little killed the electronic magazines (ezines) like mine. They killed them because they made publishing more democratic and everyone could have their own media.</p>\n<p>B2 died and then Movable Type appeared, but it was not free and used Perl (awful) and then WordPress appeared, which was free (yay) and used PHP (yay times 2) and literally swept over Movable Type.</p>\n<blockquote><p>I saw with my own eyes how WordPress empowered all people who needed to publish and break the chains of the physical limitations of traditional journalism.</p></blockquote>\n<p>In 2006 the Web was an immensely interesting place and WordPress was one of the “culprits” for that. Then social media appeared, killed the blogs and took over their function (and the function of the web as a whole) as the main platform for democratic content sharing. Something new is born, develops, fulfills its role and then declines and dies. It is the natural order of things.</p>\n<p>I watched with great interest what was happening with WordPress, which I was happy to see, did not die but changed its mission and now made more democratic not only a part of the Web (blogs) but the whole open Web. Rebirth.</p>\n<p>While I was watching WordPress, I also passed through a number of lives. I was editor-in-chief of a site for art and culture, then I was Free and Open Source Advocate, a translator, a trainer, then I led the digital business of a media group and now I do automatic aggregation of data and make sense of it using artificial intelligence. Rebirth.</p>\n<p>Throughout all this time, after the death of the ezine, WordPress has been present in my life in some especially charming form of background regime. It was the main engine of my personal blog allowing me to share stories about my current hobbies, travels and jobs. That continued until a year ago when my relationship with WordPress went into a deeper level because of a change.</p>\n<p>My daughter, Kalina, seven and a half years old, <a href=\"https://kikipetkova.wordpress.com/\">wanted to have a blog</a> (had watched “A dog with a blog” on Disney channel) because she wanted to share. The concept of sharing was not unfamiliar to her &#8211; she already shared in Youtube where she has a channel with video clips of her playing with toys and dancing to pop songs.</p>\n<blockquote><p>When she started going to school and learned to read and write, she wanted to express herself through text, too.</p></blockquote>\n<p>WordPress was the only platform that came to my mind.</p>\n<p>I started translating WordPress so that my seven-year-old daughter can share her personal stories in her childish way, the same way I started having a blog and sharing my life twelve years ago. My story with Web, WordPress and technologies, going through so many years, Kalina experienced within a couple of days. Kalina is my mission and reason after a hard day at work to find strength to search for the best translation of complex words or improve already translated ones with only one thought in mind &#8211; “can an eight-year-old person understand that?” It is not easy, but it feels good.</p>\n<p>Rebirth.</p>\n<div class=\"rtsocial-container rtsocial-container-align-right rtsocial-horizontal\"><div class=\"rtsocial-twitter-horizontal\"><div class=\"rtsocial-twitter-horizontal-button\"><a title=\"Tweet: Rebirth\" class=\"rtsocial-twitter-button\" href=\"https://twitter.com/share?text=Rebirth&via=heropress&url=http%3A%2F%2Fheropress.com%2Fessays%2Frebirth%2F\" rel=\"nofollow\" target=\"_blank\"></a></div></div><div class=\"rtsocial-fb-horizontal fb-light\"><div class=\"rtsocial-fb-horizontal-button\"><a title=\"Like: Rebirth\" class=\"rtsocial-fb-button rtsocial-fb-like-light\" href=\"https://www.facebook.com/sharer.php?u=http%3A%2F%2Fheropress.com%2Fessays%2Frebirth%2F\" rel=\"nofollow\" target=\"_blank\"></a></div></div><div class=\"rtsocial-linkedin-horizontal\"><div class=\"rtsocial-linkedin-horizontal-button\"><a class=\"rtsocial-linkedin-button\" href=\"https://www.linkedin.com/shareArticle?mini=true&url=http%3A%2F%2Fheropress.com%2Fessays%2Frebirth%2F&title=Rebirth\" rel=\"nofollow\" target=\"_blank\" title=\"Share: Rebirth\"></a></div></div><div class=\"rtsocial-pinterest-horizontal\"><div class=\"rtsocial-pinterest-horizontal-button\"><a class=\"rtsocial-pinterest-button\" href=\"https://pinterest.com/pin/create/button/?url=http://heropress.com/essays/rebirth/&media=http://heropress.com/wp-content/uploads/2016/09/092816-vladimir_petkov-150x150.jpg&description=Rebirth\" rel=\"nofollow\" target=\"_blank\" title=\"Pin: Rebirth\"></a></div></div><a rel=\"nofollow\" class=\"perma-link\" href=\"http://heropress.com/essays/rebirth/\" title=\"Rebirth\"></a></div><p>The post <a rel=\"nofollow\" href=\"http://heropress.com/essays/rebirth/\">Rebirth</a> appeared first on <a rel=\"nofollow\" href=\"http://heropress.com\">HeroPress</a>.</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Wed, 28 Sep 2016 12:00:41 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:15:\"Vladimir Petkov\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:20;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:78:\"Post Status: The art of being a self-employed web consultant — Draft podcast\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"https://poststatus.com/?p=27006\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:70:\"https://poststatus.com/art-self-employed-web-consultant-draft-podcast/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:1952:\"<p>Welcome to the Post Status <a href=\"https://poststatus.com/category/draft\">Draft podcast</a>, which you can find <a href=\"https://itunes.apple.com/us/podcast/post-status-draft-wordpress/id976403008\">on iTunes</a>, <a href=\"https://play.google.com/music/m/Ih5egfxskgcec4qadr3f4zfpzzm?t=Post_Status__Draft_WordPress_Podcast\">Google Play</a>, <a href=\"http://www.stitcher.com/podcast/krogsgard/post-status-draft-wordpress-podcast\">Stitcher</a>, and <a href=\"http://simplecast.fm/podcasts/1061/rss\">via RSS</a> for your favorite podcatcher. Post Status Draft is hosted by Brian Krogsgard and this week&#8217;s special guest host, Diane Kinney.</p>\n<p><span>Diane is a web professional and solo practitioner based in Florida. She’s writing a book with Carrie Dils called Real World Freelancing, and I thought it’d be fun to chat with her about freelancing.</span></p>\n<!--[if lt IE 9]><script>document.createElement(\'audio\');</script><![endif]-->\n<a href=\"http://audio.simplecast.com/48334.mp3\">http://audio.simplecast.com/48334.mp3</a>\n<p><a href=\"http://audio.simplecast.com/48334.mp3\">Direct Download</a></p>\n<h3>Links and Topics</h3>\n<ul>\n<li><a href=\"http://realworldfreelancing.com/\">Real World Freelancing</a></li>\n<li><a href=\"http://theversatilitygroup.com/\">The Versatility Group</a>, Diane&#8217;s primary business</li>\n<li><a href=\"https://poststatus.com/wordpress-website-cost/\">How much should a website cost?</a></li>\n<li><a href=\"http://dianekinney.com/\">DianeKinney.com</a>, a blog in development. It will focus on business topics, WordPress, and beyond</li>\n</ul>\n<h3>Sponsor: Yoast</h3>\n<p><a href=\"https://yoast.com/\">Yoast</a> SEO Premium gives you 24/7 support from a dedicated support team and extra features such as a redirect manager, tutorial videos and integration with Google Webmaster Tools! Go to <a href=\"https://yoast.com/\">yoast.com</a> for more information, and thanks to Yoast for being a Post Status partner</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Sat, 24 Sep 2016 15:05:55 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:14:\"Katie Richards\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:21;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:63:\"WordPress.tv Blog: The Humanity Of WordPress – Rich Robinkoff\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"http://blog.wordpress.tv/?p=654\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:78:\"https://blog.wordpress.tv/2016/09/23/the-humanity-of-wordpress-rich-robinkoff/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:1279:\"<p>Rich Robinkoff &#8220;nails it&#8221; during his presentation titled The Humanity of WordPress!</p>\n<p>Rich gave this presentation at <a href=\"https://2016.columbus.wordcamp.org/speakers/\">WordCamp Columbus</a> on August 27th and again at <a href=\"https://wordpress.tv/?s=pittsburgh\">WordCamp Pittsburgh</a> on September 17th. I was lucky enough to be in attendance in Pittsburgh.</p>\n<p>He talks about human interactions and the fact that people may not realize the impact they might have on somebodies life in just a short conversation. Rich gives several examples of the relationships that can be built and the giving nature of the WordPress Community.</p>\n<p>Please watch until the end as Rich talks about the contributions to the WordPress Community by #WPMOM.</p>\n<p></p>\n<p>See more great WordCamp videos at <a href=\"https://wordpress.tv\" target=\"_blank\">WordPress.tv »</a></p>\n<p>&nbsp;</p>\n<p>&nbsp;</p><br />  <a rel=\"nofollow\" href=\"http://feeds.wordpress.com/1.0/gocomments/wptvblog.wordpress.com/654/\"><img alt=\"\" border=\"0\" src=\"http://feeds.wordpress.com/1.0/comments/wptvblog.wordpress.com/654/\" /></a> <img alt=\"\" border=\"0\" src=\"https://pixel.wp.com/b.gif?host=blog.wordpress.tv&blog=5310177&post=654&subd=wptvblog&ref=&feed=1\" width=\"1\" height=\"1\" />\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Fri, 23 Sep 2016 17:14:34 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:14:\"John Parkinson\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:22;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:17:\"Matt: 40 under 40\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:22:\"https://ma.tt/?p=46784\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:34:\"https://ma.tt/2016/09/40-under-40/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:351:\"<p>I&#8217;m still catching up with things after the Automattic Grand Meetup, but excited today to be included on the <a href=\"http://fortune.com/40-under-40/\">Fortune 40 under 40 list</a>, which I&#8217;ve graduated to after being termed out of the under 30 lists. I came in at #20 and it&#8217;s great to see lots of friends on the list as well.</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Thu, 22 Sep 2016 19:33:14 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:4:\"Matt\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:23;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:35:\"BuddyPress: BuddyPress 2.7.0 Beta 1\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:32:\"https://buddypress.org/?p=258997\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:55:\"https://buddypress.org/2016/09/buddypress-2-7-0-beta-1/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:3511:\"<p>BuddyPress 2.7.0 Beta 1 is lovingly packed with new features and enhancements and is now available for testing. You can download the <a href=\"https://downloads.wordpress.org/plugin/buddypress.2.7.0-beta1.zip\">BP 2.7.0-beta1</a> zip or get a copy via our Subversion repository. We’d love to have your feedback and testing help.</p>\n<p><strong>N.B.</strong>If you are still using WordPress 4.1, we remind you that <a href=\"https://bpdevel.wordpress.com/2016/07/21/in-accordance-with-our-wp/\">BuddyPress 2.7.0 will require at least WordPress 4.2</a>.</p>\n<p>A detailed changelog will be part of our official release notes, but, until then, here’s a tasty list of some of our favorite changes. (Check out <a href=\"https://buddypress.trac.wordpress.org/query?status=closed&group=resolution&milestone=2.7\">this report</a> on Trac for the full list.)</p>\n<ul>\n<li><a href=\"https://bpdevel.wordpress.com/2016/09/19/group-queries-have-been-rewritten-for-bp-2-7/\">Groups query overhaul</a> (<a href=\"https://buddypress.trac.wordpress.org/ticket/5451\">#5451</a>)</li>\n<li>Improved extended profile date field (<a href=\"https://buddypress.trac.wordpress.org/ticket/5500\">#5500</a>)</li>\n<li>Localized timestamps (<a href=\"https://buddypress.trac.wordpress.org/ticket/5757\">#5757</a>)</li>\n<li>Easy unsubscribe from email links (<a href=\"https://buddypress.trac.wordpress.org/ticket/6932\">#6932</a>)</li>\n<li>Front-end group types integration (<a href=\"https://buddypress.trac.wordpress.org/ticket/7210\">#7210</a>)</li>\n<li>Member type and group type filters in Users and Groups admin screens (<a href=\"https://buddypress.trac.wordpress.org/ticket/6060\">#6060</a>, <a href=\"https://buddypress.trac.wordpress.org/ticket/7175\">#7175</a>)</li>\n<li>Use WP page names for BP directory pages headings (<a href=\"https://buddypress.trac.wordpress.org/ticket/6765\">#6765</a>)</li>\n<li>Accessibility updates for the front-end and back-end screens (<a href=\"https://buddypress.trac.wordpress.org/ticket/6871\">#6871</a>, <a href=\"https://buddypress.trac.wordpress.org/ticket/7105\">#6881</a>, <a href=\"https://buddypress.trac.wordpress.org/ticket/7090\">#7090</a>, <a href=\"https://buddypress.trac.wordpress.org/ticket/7222\">#7222</a>, and many others!)</li>\n<li>Templating enhancements (<a href=\"https://buddypress.trac.wordpress.org/ticket/6844\">#6884</a>, <a href=\"https://buddypress.trac.wordpress.org/ticket/7132\">#7132</a>)</li>\n<li>Improvements to a single group&#8217;s management screens (<a href=\"https://buddypress.trac.wordpress.org/ticket/7079\">#7079</a>, <a href=\"https://buddypress.trac.wordpress.org/ticket/6385\">#6385</a>, <a href=\"https://buddypress.trac.wordpress.org/ticket/7105\">#7105</a>)</li>\n<li>Many, many performance improvements (<a href=\"https://buddypress.trac.wordpress.org/ticket/7120\">#7120</a>, <a href=\"https://buddypress.trac.wordpress.org/ticket/6978\">#6978</a>, <a href=\"https://buddypress.trac.wordpress.org/ticket/7208\">#7208</a>, and more!)</li>\n<li>Support for querying for groups by new column <code>parent_id</code> (<a href=\"https://buddypress.trac.wordpress.org/ticket/3961\">#3961</a>)</li>\n</ul>\n<p>BP 2.7.0 is almost ready, but please do not run it in a production environment just yet. Let us know of any issues you find in the <a href=\"https://buddypress.org/support/\">support forums</a> and/or <a href=\"https://buddypress.trac.wordpress.org/\">development tracker</a>.</p>\n<p>Thanks everyone for all your help to date. We are excited to release BuddyPress 2.7.0 in mid-October!</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Thu, 22 Sep 2016 03:05:41 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:8:\"@mercime\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:24;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:36:\"HeroPress: Growing Up With WordPress\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:55:\"http://heropress.com/?post_type=heropress-essays&p=1339\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:54:\"http://heropress.com/essays/growing-up-with-wordpress/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:5035:\"<img width=\"960\" height=\"480\" src=\"http://heropress.com/wp-content/uploads/2016/09/092116-1024x512.jpg\" class=\"attachment-large size-large wp-post-image\" alt=\"Pull Quote: I\'ve loved seeing how the WordPress community has become more kid friendly.\" /><p>Hey gang, I’m Sophia DeRosia, I’m 14 years old, I’m homeschooled, and I’m here to tell you my WordPress story.</p>\n<p>I grew up with WordPress. My entire life my dad, Topher DeRosia, worked with WordPress. At one point a couple years ago he tried to convince me to create a blog, and I had originally said no, but maybe a year or two later <a href=\"http://eringoblog.org/\">Erin Go Blog</a> was born and I started my long journey with WordPress.</p>\n<p>My first WordCamp was in Grand Rapids and my family had decided to help out with it. It was awesome, we did that twice and attended once. I believe my first WordCamp that I attended was actually in Chicago which was also, yes, awesome. I met a lot of great people there, they all made me feel welcome even though I was only eleven or twelve at the time.</p>\n<blockquote><p>I have NEVER felt like people in WordPress talk down to me or think of me as a five year old just because I’m a kid.</p></blockquote>\n<p>Last night my mom was asking me some questions for this essay and one of them was “How has WordPress changed you?” And that one took me a minute to answer. I didn’t really know how WordPress itself had changed me, but then I thought about the people I had met, those who have taught me, and the support I’ve always felt. It was the WordPress community that really changed me.</p>\n<p>Being a kid in WordPress has definitely benefited me. Being around adults so much I’ve learned how to talk to them, I’m not afraid to talk to adults or ask for help, and I’ve made some awesome friends that I know I can count on. I also have some really good job options, whether it’s designer, developer, or business. Having my own blog has helped me with writing as well. I may not have a deep passion for it but I certainly like it and may not have known that if I hadn’t had a blog.</p>\n<p>I’ve loved seeing how the WordPress community has become more kid friendly. It’s a safe, fun environment for kids and it’s only becoming more so. I’ve loved seeing how WordPress has grown and changed over the years I’ve been using it. So to parents out there who have kids that may be a designer, developer, or business aficionado I recommend WordPress.</p>\n<blockquote><p>WordPress is a fun, easy way to open your kids up to many options for their future.</p></blockquote>\n<p>And to the kids out there who are interested in WordPress, WordCamps aren’t the only way to learn it. All over the world they have meetups where you can ask questions and meet some cool people, and there are countless other ways to learn it.</p>\n<p>If you think WordPress may be the way you want to go then try it. You don’t have to stick with it but at least try it, I guarantee you will make some great friends like I have and learn lots.</p>\n<p>Have fun on your adventure!</p>\n<div class=\"rtsocial-container rtsocial-container-align-right rtsocial-horizontal\"><div class=\"rtsocial-twitter-horizontal\"><div class=\"rtsocial-twitter-horizontal-button\"><a title=\"Tweet: Growing Up With WordPress\" class=\"rtsocial-twitter-button\" href=\"https://twitter.com/share?text=Growing%20Up%20With%20WordPress&via=heropress&url=http%3A%2F%2Fheropress.com%2Fessays%2Fgrowing-up-with-wordpress%2F\" rel=\"nofollow\" target=\"_blank\"></a></div></div><div class=\"rtsocial-fb-horizontal fb-light\"><div class=\"rtsocial-fb-horizontal-button\"><a title=\"Like: Growing Up With WordPress\" class=\"rtsocial-fb-button rtsocial-fb-like-light\" href=\"https://www.facebook.com/sharer.php?u=http%3A%2F%2Fheropress.com%2Fessays%2Fgrowing-up-with-wordpress%2F\" rel=\"nofollow\" target=\"_blank\"></a></div></div><div class=\"rtsocial-linkedin-horizontal\"><div class=\"rtsocial-linkedin-horizontal-button\"><a class=\"rtsocial-linkedin-button\" href=\"https://www.linkedin.com/shareArticle?mini=true&url=http%3A%2F%2Fheropress.com%2Fessays%2Fgrowing-up-with-wordpress%2F&title=Growing+Up+With+WordPress\" rel=\"nofollow\" target=\"_blank\" title=\"Share: Growing Up With WordPress\"></a></div></div><div class=\"rtsocial-pinterest-horizontal\"><div class=\"rtsocial-pinterest-horizontal-button\"><a class=\"rtsocial-pinterest-button\" href=\"https://pinterest.com/pin/create/button/?url=http://heropress.com/essays/growing-up-with-wordpress/&media=http://heropress.com/wp-content/uploads/2016/09/092116-150x150.jpg&description=Growing Up With WordPress\" rel=\"nofollow\" target=\"_blank\" title=\"Pin: Growing Up With WordPress\"></a></div></div><a rel=\"nofollow\" class=\"perma-link\" href=\"http://heropress.com/essays/growing-up-with-wordpress/\" title=\"Growing Up With WordPress\"></a></div><p>The post <a rel=\"nofollow\" href=\"http://heropress.com/essays/growing-up-with-wordpress/\">Growing Up With WordPress</a> appeared first on <a rel=\"nofollow\" href=\"http://heropress.com\">HeroPress</a>.</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Wed, 21 Sep 2016 16:36:26 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:14:\"Sophia DeRosia\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:25;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:64:\"Post Status: What is a WordPress theme anyway? — Draft podcast\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"https://poststatus.com/?p=26808\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:60:\"https://poststatus.com/wordpress-theme-anyway-draft-podcast/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:2659:\"<p>Welcome to the Post Status <a href=\"https://poststatus.com/category/draft\">Draft podcast</a>, which you can find <a href=\"https://itunes.apple.com/us/podcast/post-status-draft-wordpress/id976403008\">on iTunes</a>, <a href=\"https://play.google.com/music/m/Ih5egfxskgcec4qadr3f4zfpzzm?t=Post_Status__Draft_WordPress_Podcast\">Google Play</a>, <a href=\"http://www.stitcher.com/podcast/krogsgard/post-status-draft-wordpress-podcast\">Stitcher</a>, and <a href=\"http://simplecast.fm/podcasts/1061/rss\">via RSS</a> for your favorite podcatcher. Post Status Draft is hosted by Joe Hoyle &#8212; the CTO of Human Made &#8212; and Brian Krogsgard.</p>\n<p><span>In this episode, Joe and Brian discuss WordPress themes, the functionality people put into them, and the challenges that face the WordPress ecosystem with the current state of theming. They also discuss various theme frameworks and how they are setup, common post types and how they can better be supported, and the popularity of page builders.</span></p>\n<p><a href=\"https://audio.simplecast.com/47827.mp3\">https://audio.simplecast.com/47827.mp3</a><br />\n<a href=\"http://audio.simplecast.com/47827.mp3\">Direct Download</a></p>\n<h3>Topics</h3>\n<ul>\n<li>What should a theme do?</li>\n<li>Theme vs. Plugin functionality &#8212; and mobility potential between themes\n<ul>\n<li>Canonical post types</li>\n</ul>\n</li>\n<li>Difference between commercial themes and .org distributed free themes\n<ul>\n<li>Restrictions</li>\n<li>All-in-one solution &#8220;promises&#8221;</li>\n</ul>\n</li>\n<li>Page builders and their role in theming</li>\n<li>Other theme options via the REST API</li>\n</ul>\n<h3>Links</h3>\n<ul>\n<li><a href=\"https://poststatus.com/on-wordpress-themes-and-frameworks/\">On WordPress themes and frameworks</a></li>\n<li><a href=\"http://underscores.me/\">Underscores</a></li>\n<li><a href=\"http://www.csszengarden.com/\">CSS Zen Garden</a></li>\n<li><a href=\"http://themehybrid.com/hybrid-core\">Hybrid Core</a></li>\n<li><a href=\"http://my.studiopress.com/themes/genesis/\">Genesis</a></li>\n<li><a href=\"https://poststatus.com/wordpress-com-jetpack-lead-way-toward-standardizing-custom-post-types/\">WordPress.com and Jetpack should lead the way to standardizing CPTs</a></li>\n</ul>\n<h3>Sponsor: WP101</h3>\n<p><span>The <a href=\"https://wp101plugin.com/\">WP101 Plugin</a> frees your time, enabling you to focus on what you do best, while providing our popular WordPress 101 tutorial videos directly in your client&#8217;s dashboard. You can even add your own videos! Go to <a href=\"https://wp101plugin.com/\">wp101plugin.com</a> for more information, and thanks to WP101 for being a Post Status partner.</span></p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Mon, 19 Sep 2016 17:29:12 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:14:\"Katie Richards\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:26;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:74:\"WordPress.tv Blog: Data-Driven SEO with Google Analytics – Rebecca Haden\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"http://blog.wordpress.tv/?p=634\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:89:\"https://blog.wordpress.tv/2016/09/10/data-driven-seo-with-google-analytics-rebecca-haden/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:1048:\"<div class=\"video-description\">\n<p>SEO can be confusing if you rely on tips and tricks. Instead, you can rely on data from your own website.This presentation by Rebecca Haden from  <a href=\"http://wordpress.tv/event/wordcamp-fayetteville-2016/\">WordCamp Fayetteville 2016</a> helps you to get to know Google Analytics and other analytics tools with WordPress plugins, find the actionable information in your analytics reports, and implement your own SEO strategy.</p>\n<p></p>\n<p><a href=\"http://2016.fayetteville.wordcamp.org/files/2016/07/Data-Driven-SEO.ppt\">Presentation Slides »</a></p>\n<p>More great WordCamp videos on <a href=\"http://wordpress.tv/\">WordPress.tv »</a></p>\n</div><br />  <a rel=\"nofollow\" href=\"http://feeds.wordpress.com/1.0/gocomments/wptvblog.wordpress.com/634/\"><img alt=\"\" border=\"0\" src=\"http://feeds.wordpress.com/1.0/comments/wptvblog.wordpress.com/634/\" /></a> <img alt=\"\" border=\"0\" src=\"https://pixel.wp.com/b.gif?host=blog.wordpress.tv&blog=5310177&post=634&subd=wptvblog&ref=&feed=1\" width=\"1\" height=\"1\" />\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Sat, 10 Sep 2016 00:16:08 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:11:\"Jerry Bates\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:27;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:58:\"Dev Blog: WordPress 4.6.1 Security and Maintenance Release\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:34:\"https://wordpress.org/news/?p=4507\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:84:\"https://wordpress.org/news/2016/09/wordpress-4-6-1-security-and-maintenance-release/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:2756:\"<p>WordPress 4.6.1 is now available. This is a <strong>security release</strong> for all previous versions and we strongly encourage you to update your sites immediately.</p>\n<p>WordPress versions 4.6 and earlier are affected by two security issues: a cross-site scripting vulnerability via image filename, reported by SumOfPwn researcher <a href=\"https://twitter.com/cengizhansahin\">Cengiz Han Sahin</a>; and a path traversal vulnerability in the upgrade package uploader, reported by <a href=\"https://dominikschilling.de/\">Dominik Schilling</a> from the WordPress security team.</p>\n<p>Thank you to the reporters for practicing <a href=\"https://make.wordpress.org/core/handbook/testing/reporting-security-vulnerabilities/\">responsible disclosure</a>.</p>\n<p>In addition to the security issues above, WordPress 4.6.1 fixes 15 bugs from 4.6. For more information, see the <a href=\"https://codex.wordpress.org/Version_4.6.1\">release notes</a> or consult the <a href=\"https://core.trac.wordpress.org/query?milestone=4.6.1\">list of changes</a>.</p>\n<p><a href=\"https://wordpress.org/download/\">Download WordPress 4.6.1</a> or venture over to Dashboard → Updates and simply click “Update Now.” Sites that support automatic background updates are already beginning to update to WordPress 4.6.1.</p>\n<p>Thanks to everyone who contributed to 4.6.1:</p>\n<p><a href=\"https://profiles.wordpress.org/azaozz\">Andrew Ozz</a>, <a href=\"https://profiles.wordpress.org/gitlost\">bonger</a>, <a href=\"https://profiles.wordpress.org/boonebgorges\">Boone Gorges</a>, <a href=\"https://profiles.wordpress.org/chaos-engine\">Chaos Engine</a>, <a href=\"https://profiles.wordpress.org/danielkanchev\">Daniel Kanchev</a>, <a href=\"https://profiles.wordpress.org/dd32\">Dion Hulse</a>, <a href=\"https://profiles.wordpress.org/drewapicture\">Drew Jaynes</a>, <a href=\"https://profiles.wordpress.org/flixos90\">Felix Arntz</a>, <a href=\"https://profiles.wordpress.org/frozzare\">Fredrik Forsmo</a>, <a href=\"https://profiles.wordpress.org/pento\">Gary Pendergast</a>, <a href=\"https://profiles.wordpress.org/geminorum\">geminorum</a>, <a href=\"https://profiles.wordpress.org/iandunn\">Ian Dunn</a>, <a href=\"https://profiles.wordpress.org/ionutst\">Ionut Stanciu</a>, <a href=\"https://profiles.wordpress.org/jeremyfelt\">Jeremy Felt</a>, <a href=\"https://profiles.wordpress.org/joemcgill\">Joe McGill</a>, <a href=\"https://profiles.wordpress.org/clorith\">Marius L. J. (Clorith)</a>, <a href=\"https://profiles.wordpress.org/swissspidy\">Pascal Birchler</a>, <a href=\"https://profiles.wordpress.org/rpayne7264\">Robert D Payne</a>, <a href=\"https://profiles.wordpress.org/sergeybiryukov\">Sergey Biryukov</a>, and <a href=\"https://profiles.wordpress.org/nmt90\">Triet Minh</a>.</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Wed, 07 Sep 2016 15:52:09 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:11:\"Jeremy Felt\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:28;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:51:\"Akismet: Akismet WordPress Plugin 3.2 Now Available\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"http://blog.akismet.com/?p=1915\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:65:\"https://blog.akismet.com/2016/09/06/akismet-wordpress-plugin-3-2/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:1308:\"<p>Version 3.2 of <a href=\"http://wordpress.org/plugins/akismet/\">the Akismet plugin for WordPress</a> is available.</p>\n<p>In addition to six minor bugfixes, version 3.2 includes a <a href=\"http://wp-cli.org\">WP-CLI</a> module, so you can now check and recheck comments from the command line. (For usage instructions, run <code>wp help akismet</code> or see the documentation in <a href=\"https://plugins.trac.wordpress.org/browser/akismet/trunk/class.akismet-cli.php\">the module</a>.) For full details on all of the changes since version 3.1.11, see <a href=\"https://plugins.trac.wordpress.org/log/akismet/trunk?rev=1491265&stop_rev=1418219&verbose=on\">the changelog</a>.</p>\n<p>To upgrade, visit the Updates page of your WordPress dashboard and follow the instructions. If you need to download the plugin zip file directly, links to all versions are available in <a href=\"http://wordpress.org/plugins/akismet/\">the WordPress plugins directory</a>.</p><br />  <a rel=\"nofollow\" href=\"http://feeds.wordpress.com/1.0/gocomments/akismet.wordpress.com/1915/\"><img alt=\"\" border=\"0\" src=\"http://feeds.wordpress.com/1.0/comments/akismet.wordpress.com/1915/\" /></a> <img alt=\"\" border=\"0\" src=\"https://pixel.wp.com/b.gif?host=blog.akismet.com&blog=116920&post=1915&subd=akismet&ref=&feed=1\" width=\"1\" height=\"1\" />\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Tue, 06 Sep 2016 17:44:17 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:17:\"Christopher Finke\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:29;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:46:\"WP Mobile Apps: WordPress for iOS: Version 6.4\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:33:\"http://apps.wordpress.com/?p=3568\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:68:\"https://apps.wordpress.com/2016/08/26/wordpress-for-ios-version-6-4/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:4716:\"<p>Hi there, WordPress users! <a href=\"https://itunes.apple.com/us/app/wordpress/id335703880?mt=8&uo=6&at=&ct=\">Version 6.4 of the WordPress for iOS app</a> is now available in the App Store.</p>\n<h1>What&#8217;s New:</h1>\n<p><strong>iPad Keyboard Shortcuts.</strong> Press down the command key on your external keyboard to see a list of available shortcuts in the main screen and in the post editor.</p>\n\n<a href=\"https://apps.wordpress.com/img_0007/\"><img width=\"300\" height=\"225\" src=\"https://apps.files.wordpress.com/2016/08/img_0007.png?w=300&h=225\" class=\"attachment-medium size-medium\" alt=\"Hold down the command key, and see the available shortcuts.\" /></a>\n<a href=\"https://apps.wordpress.com/img_0006/\"><img width=\"300\" height=\"225\" src=\"https://apps.files.wordpress.com/2016/08/img_0006.png?w=300&h=225\" class=\"attachment-medium size-medium\" alt=\"There are many shortcuts you can use in the post editor, too.\" /></a>\n\n<p><strong>Share Media.</strong> Our sharing extension now supports media, too!</p>\n\n<a href=\"https://apps.wordpress.com/img_2385/\"><img width=\"169\" height=\"300\" src=\"https://apps.files.wordpress.com/2016/08/img_2385.png?w=169&h=300\" class=\"attachment-medium size-medium\" alt=\"Select any image and tap on the WordPress icon.\" /></a>\n<a href=\"https://apps.wordpress.com/img_2386/\"><img width=\"169\" height=\"300\" src=\"https://apps.files.wordpress.com/2016/08/img_2386.png?w=169&h=300\" class=\"attachment-medium size-medium\" alt=\"Add a message and share it to your blog!\" /></a>\n\n<p><strong>People Management.</strong> You can now manage your site&#8217;s users and roles using your mobile device.</p>\n\n<a href=\"https://apps.wordpress.com/img_2392/\"><img width=\"169\" height=\"300\" src=\"https://apps.files.wordpress.com/2016/08/img_2392.png?w=169&h=300\" class=\"attachment-medium size-medium\" alt=\"A new people management section is available.\" /></a>\n<a href=\"https://apps.wordpress.com/img_2393/\"><img width=\"169\" height=\"300\" src=\"https://apps.files.wordpress.com/2016/08/img_2393.png?w=169&h=300\" class=\"attachment-medium size-medium\" alt=\"See a list of your blog\'s users and their roles.\" /></a>\n<a href=\"https://apps.wordpress.com/img_2394/\"><img width=\"169\" height=\"300\" src=\"https://apps.files.wordpress.com/2016/08/img_2394.png?w=169&h=300\" class=\"attachment-medium size-medium\" alt=\"Tap on any person to see their details.\" /></a>\n\n<p><strong>Search in the Reader.</strong> The Reader now has search capability and autocompletes suggestions.</p>\n\n<a href=\"https://apps.wordpress.com/img_2390/\"><img width=\"169\" height=\"300\" src=\"https://apps.files.wordpress.com/2016/08/img_23901.png?w=169&h=300\" class=\"attachment-medium size-medium\" alt=\"Tap the magnification icon on the top right corner.\" /></a>\n<a href=\"https://apps.wordpress.com/img_2389/\"><img width=\"169\" height=\"300\" src=\"https://apps.files.wordpress.com/2016/08/img_2389.png?w=169&h=300\" class=\"attachment-medium size-medium\" alt=\"Searching is easier than ever.\" /></a>\n\n<p><strong>Improved Gestures.</strong> Full screen image previews can be dismissed with a swanky flick/toss gesture.</p>\n<p><strong>Bugs Squashed.</strong> A new homemade bug spray formula has allowed us to squash <a href=\"https://github.com/wordpress-mobile/WordPress-iOS/issues?q=is%3Aclosed+is%3Aissue+milestone%3A6.4+label%3A%22%5BType%5D+Bug%22\">many uninvited guests</a>.</p>\n<p><strong>And much more! </strong>You can see the full list of changes <a href=\"https://github.com/wordpress-mobile/WordPress-iOS/issues?utf8=✓&q=is%3Aissue%20is%3Aclosed%20milestone%3A6.4\">here</a>.</p>\n<h1>Thank You</h1>\n<p>Thanks to all of the contributors who worked on this release:<br />\n<a href=\"https://github.com/aerych\">@aerych</a>, <a href=\"https://github.com/astralbodies\">@astralbodies</a>, <a href=\"https://github.com/claudiosmweb\">@claudiosmweb</a>, <a href=\"https://github.com/diegoreymendez\">@diegoreymendez</a>, <a href=\"https://github.com/frosty\">@frosty</a>, <a href=\"https://github.com/jleandroperez\">@jleandroperez</a>, <a href=\"https://github.com/koke\">@koke</a>, <a href=\"https://github.com/kurzee\">@kurzee</a>, <a href=\"https://github.com/kwonye\">@kwonye</a>, <a href=\"https://github.com/oguzkocer\">@oguzkocer</a>, <a href=\"https://github.com/sendhil\">@sendhil</a>, <a href=\"https://github.com/SergioEstevao\">@SergioEstevao</a>.</p>\n<p>You can track the development progress for the next update by visiting <a href=\"https://github.com/wordpress-mobile/WordPress-iOS/issues?utf8=✓&q=is%3Aissue+milestone%3A6.5+\" target=\"_blank\">our 6.5 milestone on GitHub</a>. Until next time!</p><img alt=\"\" border=\"0\" src=\"https://pixel.wp.com/b.gif?host=apps.wordpress.com&blog=108068616&post=3568&subd=apps&ref=&feed=1\" width=\"1\" height=\"1\" />\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Fri, 26 Aug 2016 12:27:45 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:14:\"diegoreymendez\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:30;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:50:\"WP Mobile Apps: WordPress for Android: Version 5.7\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:33:\"http://apps.wordpress.com/?p=3535\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:72:\"https://apps.wordpress.com/2016/08/26/wordpress-for-android-version-5-7/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:2814:\"<p>Hello WordPress users! <a href=\"https://play.google.com/store/apps/details?id=org.wordpress.android\" target=\"_blank\">Version 5.7 of the WordPress for Android app</a> is now available in the Google Play Store.</p>\n<h1>New &#8220;Plans&#8221; section in My Site</h1>\n<p>Starting with 5.7, you can see your current WordPress.com plan and learn more about the benefits we offer in other plans.</p>\n<p><img class=\"aligncenter wp-image-3532\" src=\"https://apps.files.wordpress.com/2016/08/screenshot-2016-08-02_15-46-12-755.png?w=600\" alt=\"screenshot-2016-08-02_15.46.12.755\" /></p>\n<h1>Manage your followers and viewers from the &#8220;People Management&#8221; screen</h1>\n<p>You&#8217;re now able to use the app to invite new Administrators, Editors, Authors or Contributors to your site, or remove unwanted followers.</p>\n<p><img class=\"aligncenter wp-image-3533\" src=\"https://apps.files.wordpress.com/2016/08/screenshot-2016-08-02_15-51-08-242.png?w=600\" alt=\"screenshot-2016-08-02_15.51.08.242\" /></p>\n<h1 id=\"other-changes\">Other Changes</h1>\n<p>Version 5.7 also comes with a few other changes and fixes:</p>\n<ul>\n<li>Reader tweaks in the Post Detail screen for tablets.</li>\n<li>Keeps the &#8220;View Site&#8221; link visible for newly created users.</li>\n<li>Fixes a rare crash when creating a new account.</li>\n</ul>\n<p>You can track our development progress for the next release by visiting <a href=\"https://github.com/wordpress-mobile/WordPress-Android/milestones/5.8\">our 5.8 milestone on GitHub</a>.</p>\n<h1>Beta</h1>\n<p>Do you like keeping up with what’s new in the app? Do you enjoy testing new stuff before anyone else? Our testers have access to beta versions with updates shipped directly through Google Play. The beta versions may have new features, new fixes — and possibly new bugs! Testers make it possible for us to improve the overall app experience, and offer us invaluable development feedback.</p>\n<p>Want to become a tester? <a href=\"https://play.google.com/apps/testing/org.wordpress.android\">Opt-in</a>!</p>\n<h1>Thank you</h1>\n<p>Thanks to our GitHub contributors: <a href=\"https://github.com/0nko\">@0nko</a>, <a href=\"https://github.com/aforcier\">@aforcier</a>, <a href=\"https://github.com/hypest\">@hypest</a>, <a href=\"https://github.com/karambir252\">@karambir252</a>, <a href=\"https://github.com/khaykov\">@khaykov</a>, <a href=\"https://github.com/kwonye\">@kwonye</a>, <a href=\"https://github.com/maxme\">@maxme</a>, <a href=\"https://github.com/mzorz\">@mzorz</a>, <a href=\"https://github.com/nbradbury\">@nbradbury</a>, <a href=\"https://github.com/oguzkocer\">@oguzkocer</a>, and <a href=\"https://github.com/theck13\">@theck13</a>.</p><img alt=\"\" border=\"0\" src=\"https://pixel.wp.com/b.gif?host=apps.wordpress.com&blog=108068616&post=3535&subd=apps&ref=&feed=1\" width=\"1\" height=\"1\" />\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Fri, 26 Aug 2016 11:33:19 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:6:\"Maxime\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:31;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:36:\"Dev Blog: WordPress 4.6 “Pepper”\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:34:\"https://wordpress.org/news/?p=4444\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:42:\"https://wordpress.org/news/2016/08/pepper/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:24736:\"<p>Version 4.6 of WordPress, named “Pepper” in honor of jazz baritone saxophonist Park Frederick “Pepper” Adams III, is available for download or update in your WordPress dashboard. New features in 4.6 help you to focus on the important things while feeling more at home.</p>\n<p></p>\n<hr />\n<h2>Streamlined Updates</h2>\n<p><img class=\"aligncenter wp-image-4454 size-large\" src=\"https://i0.wp.com/wordpress.org/news/files/2016/08/streamlined-updates.png?resize=632%2C379&ssl=1\" /></p>\n<p>Don’t lose your place: stay on the same page while you update, install, and delete your plugins and themes.</p>\n<hr />\n<h2>Native Fonts</h2>\n<p><img class=\"aligncenter wp-image-4455 size-large\" src=\"https://i2.wp.com/wordpress.org/news/files/2016/08/native-fonts.png?resize=632%2C379&ssl=1\" /></p>\n<p>The WordPress dashboard now takes advantage of the fonts you already have, making it load faster and letting you feel more at home on whatever device you use.</p>\n<hr />\n<h2>Editor Improvements</h2>\n<div>\n<h3>Inline Link Checker</h3>\n<p><img class=\"aligncenter wp-image-4456 size-full\" src=\"https://i1.wp.com/wordpress.org/news/files/2016/08/inline-link-checker.png?resize=632%2C379&ssl=1\" /></p>\n<p>Ever accidentally made a link to https://wordpress.org/example.org? Now WordPress automatically checks to make sure you didn’t.</p>\n</div>\n<div>\n<h3>Content Recovery</h3>\n<p><img class=\"aligncenter wp-image-4457 size-full\" src=\"https://i1.wp.com/wordpress.org/news/files/2016/08/content-recovery.png?resize=632%2C379&ssl=1\" /></p>\n<p>As you type, WordPress saves your content to the browser. Recovering saved content is even easier with WordPress 4.6.</p>\n</div>\n<hr />\n<h2>Under The Hood</h2>\n<h3>Resource Hints</h3>\n<p><a href=\"https://make.wordpress.org/core/2016/07/06/resource-hints-in-4-6/\">Resource hints help browsers</a> decide which resources to fetch and preprocess. WordPress 4.6 adds them automatically for your styles and scripts making your site even faster.</p>\n<h3>Robust Requests</h3>\n<p>The HTTP API now leverages the Requests library, improving HTTP standard support and adding case-insensitive headers, parallel HTTP requests, and support for Internationalized Domain Names.</p>\n<h3><code>WP_Term_Query</code> and <code>WP_Post_Type</code></h3>\n<p>A new <code><a href=\"https://developer.wordpress.org/reference/classes/wp_term_query\">WP_Term_Query</a></code> class adds flexibility to query term information while a new <code><a href=\"https://developer.wordpress.org/reference/classes/wp_post_type\">WP_Post_Type</a></code> object makes interacting with post types more predictable.</p>\n<h3>Meta Registration API</h3>\n<p>The Meta Registration API <a href=\"https://make.wordpress.org/core/2016/07/08/enhancing-register_meta-in-4-6/\">has been expanded</a> to support types, descriptions, and REST API visibility.</p>\n<h3>Translations On Demand</h3>\n<p>WordPress will install and use the newest language packs for your plugins and themes as soon as they’re available from <a href=\"https://translate.wordpress.org/\">WordPress.org’s community of translators</a>.</p>\n<h3>JavaScript Library Updates</h3>\n<p>Masonry 3.3.2, imagesLoaded 3.2.0, MediaElement.js 2.22.0, TinyMCE 4.4.1, and Backbone.js 1.3.3 are bundled.</p>\n<h3>Customizer APIs for Setting Validation and Notifications</h3>\n<p>Settings now have an <a href=\"https://make.wordpress.org/core/2016/07/05/customizer-apis-in-4-6-for-setting-validation-and-notifications/\">API for enforcing validation constraints</a>. Likewise, customizer controls now support notifications, which are used to display validation errors instead of failing silently.</p>\n<h3>Multisite, now faster than ever</h3>\n<p>Cached and comprehensive site queries improve your network admin experience. The addition of <code><a href=\"https://developer.wordpress.org/reference/classes/wp_site_query\">WP_Site_Query</a></code> and <code><a href=\"https://developer.wordpress.org/reference/classes/wp_network_query\">WP_Network_Query</a></code> help craft advanced queries with less effort.</p>\n<hr />\n<h2>The Crew</h2>\n<p>This release was led by <a href=\"https://dominikschilling.de/\">Dominik Schilling</a>, backed up by <a href=\"https://www.garthmortensen.com/\">Garth Mortensen</a> as Release Deputy, and with the help of these fine individuals. There are <span>272</span> contributors with props in this release. Pull up some Pepper Adams on your music service of choice, and check out some of their profiles:</p>\n<a href=\"https://profiles.wordpress.org/a5hleyrich\">A5hleyRich</a>, <a href=\"https://profiles.wordpress.org/jorbin\">Aaron Jorbin</a>, <a href=\"https://profiles.wordpress.org/achbed\">achbed</a>, <a href=\"https://profiles.wordpress.org/adamsilverstein\">Adam Silverstein</a>, <a href=\"https://profiles.wordpress.org/adamsoucie\">Adam Soucie</a>, <a href=\"https://profiles.wordpress.org/adrianosilvaferreira\">Adriano Ferreira</a>, <a href=\"https://profiles.wordpress.org/afineman\">afineman</a>, <a href=\"https://profiles.wordpress.org/mrahmadawais\">Ahmad Awais</a>, <a href=\"https://profiles.wordpress.org/aidvu\">aidvu</a>, <a href=\"https://profiles.wordpress.org/akibjorklund\">Aki Bj&#246;rklund</a>, <a href=\"https://profiles.wordpress.org/xknown\">Alex Concha</a>, <a href=\"https://profiles.wordpress.org/xavortm\">Alex Dimitrov</a>, <a href=\"https://profiles.wordpress.org/alexkingorg\">Alex King</a>, <a href=\"https://profiles.wordpress.org/viper007bond\">Alex Mills (Viper007Bond)</a>, <a href=\"https://profiles.wordpress.org/alexvandervegt\">alexvandervegt</a>, <a href=\"https://profiles.wordpress.org/ambrosey\">Alice Brosey</a>, <a href=\"https://profiles.wordpress.org/aaires\">Ana Aires</a>, <a href=\"https://profiles.wordpress.org/afercia\">Andrea Fercia</a>, <a href=\"https://profiles.wordpress.org/andg\">Andrea Gandino</a>, <a href=\"https://profiles.wordpress.org/nacin\">Andrew Nacin</a>, <a href=\"https://profiles.wordpress.org/azaozz\">Andrew Ozz</a>, <a href=\"https://profiles.wordpress.org/rockwell15\">Andrew Rockwell</a>, <a href=\"https://profiles.wordpress.org/afragen\">Andy Fragen</a>, <a href=\"https://profiles.wordpress.org/andizer\">Andy Meerwaldt</a>, <a href=\"https://profiles.wordpress.org/andy\">Andy Skelton</a>, <a href=\"https://profiles.wordpress.org/anilbasnet\">Anil Basnet</a>, <a href=\"