INSERT INTO `wp_posts` VALUES ('248', '23', '2016-09-29 19:59:30', '2016-09-29 11:59:30', '<div>广东惠州男S，寻一个真心偶尔能来惠州玩和调教的女奴或母狗</div>\r\n<div></div>\r\n<div>我也怕给骗，所以，希望你能理解，也最好你是广东惠州本地的。</div>\r\n<div></div>\r\n<div>我也不要多么漂亮，多么的丑。我只要你平平凡凡足以。但是，我也不喜欢太胖的。100-150之间的女性我能接受。</div>\r\n<div></div>\r\n<div>我明年开春后，会自己弄一个调教室，从而，让我心爱的你玩的更刺激，更爽。</div>\r\n<div></div>\r\n<div>另外，我要求的年龄：18-45岁之间，年龄太小我不喜欢，太老我也不怎么爱好。</div>\r\n<div></div>\r\n<div>所以，我年龄有要求点，但是，我也不介意你有孩子，若你是母女或者是孕妇，我也不介意。</div>\r\n<div></div>\r\n<div>若是孕妇，我会适当的调教你，最好你是生了孩子，有人奶的（因为，我喜欢喝人奶）。</div>\r\n<div></div>\r\n<div>我今年30岁，玩SM有六年多。可以玩各类口味，但是，我也会适当的帮你定制一些口味，但不会超出你的接受范围。</div>\r\n<div></div>\r\n<div>我也会让你达到一天几十次的gao潮。我性交一次可以几个小时，一天晚上最少需要三次。也希望你能闷骚点，从而达到你勾引我调教你。</div>\r\n<div></div>\r\n<div>我的调教是很严厉的哦。另外，见面前，我希望你能给我拍你自己的照片或者与我视频（我会让你做出我想要的动作来证明你是真实的。）</div>\r\n<div></div>\r\n<div>我也接受夫妻奴、绿帽奴等等的。</div>\r\n<div></div>\r\n<div>我能让你感到刺激，感到gao潮，感到快乐</div>', '个人介绍-31男王', '', 'publish', 'closed', 'closed', '', '%e4%b8%aa%e4%ba%ba%e4%bb%8b%e7%bb%8d-31%e7%94%b7%e7%8e%8b', '', '', '2016-09-29 19:59:30', '2016-09-29 11:59:30', '', '0', 'http://www.romewg.me/?p=248', '0', 'post', '', '0');
