INSERT INTO `wp_posts` VALUES ('250', '23', '2016-09-29 19:59:41', '2016-09-29 11:59:41', '本主在泰山脚下，平时生活里温文尔雅，生活之外的一面只有你会看到。有3年的现实经验，调教手段多样，擅长开发奴性，现在泰安或泰安周边招一女奴。可以圈养，熟悉之后可以来我公司做我的办公室女奴。\r\n具体要求如下：\r\n1、年龄18—35岁，最好是刚要毕业的大学生，可以以实习的名义来我公司；\r\n2、有奴性或不确定自己有奴性，期待被主人开发；\r\n3、能分清游戏和现实的区别，以不影响彼此的正常生活为前提；\r\n4、野奴不要，允许你之前有主人，但是不能超过2个；现实经验很多的同样不要；\r\n5、确定关系之前你我平等的交流，互相接触和了解（通过网络或现实）；确定关系之后，要忠诚；不允许再有其他的主人；\r\n6、最重要的一点：有一颗真诚的心！', '个人介绍-30男王', '', 'publish', 'closed', 'closed', '', '%e4%b8%aa%e4%ba%ba%e4%bb%8b%e7%bb%8d-30%e7%94%b7%e7%8e%8b', '', '', '2016-09-29 19:59:41', '2016-09-29 11:59:41', '', '0', 'http://www.romewg.me/?p=250', '0', 'post', '', '0');
