INSERT INTO `wp_posts` VALUES ('272', '34', '2016-09-30 18:03:32', '0000-00-00 00:00:00', '<table cellspacing=\"0\" cellpadding=\"0\">\r\n<tbody>\r\n<tr>\r\n<td id=\"postmessage_6531190\" class=\"t_f\">入圈3年了，沉沉浮浮好几次，现在重新找一个适合自己的奴\r\n喜欢羞辱和控制奴的行为我想获得一种他人臣服于我的感觉  一种征服他人的感觉\r\n希望能把一位听从我命令的人调教成我的奴\r\n这种不是靠几次现实几次啪啪啪几次床上运动就能达成的\r\n这个是需要从生活中慢慢渗透慢慢潜移默化完成的\r\n让自己的奴体会被调教的感觉，体会羞耻的感觉\r\n所以从网络慢慢开始调教，一点一滴的进行驯化，然后再考虑现实的那些问题\r\n\r\n玩了也3年了   什么样的人都见过\r\n所以加了我请抛弃你的面具和尊严，把自己的想法大胆的说出来\r\n加了好友，希望能及时回复</td>\r\n</tr>\r\n</tbody>\r\n</table>', '[管理员审核结果：请添加标题]', '', 'pending', 'closed', 'closed', '', '', '', '', '2016-09-30 18:03:32', '2016-09-30 10:03:32', '', '0', 'http://www.romewg.me/?p=272', '0', 'post', '', '0');
