INSERT INTO `wp_posts` VALUES ('303', '1', '2016-10-01 18:27:50', '2016-10-01 10:27:50', '最近收到多位女子民们投诉“男主/男奴联系方式有误或配对后失联”，王国现对<strong>男子民</strong>做出如下配对策略调整：\r\n\r\n1）从原来的7日不登陆王国停止配对，更改为<strong>3日不登录将停止配对。</strong>停止配对的子民可在“个人资料”中重新开启配对。\r\n\r\n2）开启配对需要在王国“资源”中添加3个及以上高质量资源，并在“贡献者”处填写自己的<strong>用户名</strong>（注意是注册时候的<strong>用户名</strong>，不是昵称，可在“个人账户”查看）。\r\n\r\n3）关于提供资源突出的子民，将给出奖励，具体请参看“王国9月30日的公告”。\r\n\r\n以上规则调整仅针对男性子民。\r\n\r\n感谢大家一起携手共建和谐的<strong>罗马王国</strong>！', '【王国公告】配对规则更新！男子民们必读！（10月1日更新）', '', 'publish', 'closed', 'closed', '', '%e3%80%90%e7%8e%8b%e5%9b%bd%e5%85%ac%e5%91%8a%e3%80%91%e9%85%8d%e5%af%b9%e8%a7%84%e5%88%99%e6%9b%b4%e6%96%b0%ef%bc%81%e7%94%b7%e5%ad%90%e6%b0%91%e4%bb%ac%e5%bf%85%e8%af%bb%ef%bc%81%ef%bc%8810%e6%9c%88', '', '', '2016-10-02 12:43:12', '2016-10-02 04:43:12', '', '0', 'http://www.romewg.me/?p=303', '0', 'post', '', '0');
